INSERT INTO `posts` VALUES ('1', 'Britain\'s Prince Charles promises not to meddle when he\'s king', 'britain-s-prince-charles-promises-not-to-meddle-when-he-s-king', null, '', null, null, null, null, null, null, 'http://vuongtronspa.com.vn/storage/uploads/2019-01-13/95f932214028a176f839_size_1280x852.jpg', '1', 'publish', null, null, '0', '', 'post', '0', '0', '0', '0', '2019-01-13 07:45:00', '2019-01-13 07:45:54', '2019-01-13 07:46:16');
INSERT INTO `posts` VALUES ('2', 'Bột Ngũ Cốc', 'san-pham-1', null, '', '<ul>\r\n<li>Làm mờ vết thâm, hạn chế tối đa mụn đầu đen và mụn trứng cá.</li>\r\n<li>Loại bỏ da chết và các chất bẩn từ lổ chân lông, nuôi dưỡng tận gốc, bổ sung vitamin E và các khoáng chất từ thiên nhiên.</li>\r\n<li>Đặc biệt không khô da, giúp da sáng mịn và mềm mại nhanh chóng.</li>\r\n</ul>', '<ul>\r\n<li>Lấy 1 muỗng cafe bột, cho ít nước quậy đều thoa và massage mặt.</li>\r\n<li>Để nguyên trong 5 phút rồi rửa lại bằng nước. Nếu da bạn khô thì cho vài giọt dầu hạnh nhân hay dầu oliu, tốt hơn nữa là dầu gấc nguyên chất vào.</li>\r\n<li>Ngày dùng 2 lần, sáng và tối trước khi ngủ.</li>\r\n</ul>', '', '', '', '', 'http://vuongtronspa.com.vn/storage/uploads/2019-04-09/bot-ngu-coc-1-1_size_4000x4000.jpg', '1', 'publish', null, null, '0', '', 'product', '0', '0', '0', '0', '2019-02-13 01:53:00', '2019-02-13 01:54:23', '2019-04-09 03:32:55');
INSERT INTO `posts` VALUES ('8', 'GIỚI THIỆU VỀ VUÔNG TRÒN SPA', 'gioi-thieu-ve-vuong-tron-spa', 'Vuông Tròn Spa mang đến những dịch vụ chăm sóc cho mẹ bầu và sau sinh tại spa hoặc tại nhà. Với nguyên liệu an toàn và kỹ thuật chăm sóc đúng chuẩn mong rằng sẽ giúp các chị em luôn khỏe mạnh và xinh đẹp.\r\n\r\nVuông Tròn Spa còn mang đến cho khách hàng các dịch vụ điều trị công nghệ cao giúp chị em đẹp hơn, khoẻ hơn. Với máy móc nhập khẩu trực tiếp từ Châu Âu, tuyệt đối an toàn với sức khoẻ.', '<p>Vuông Tròn Spa mang đến những dịch vụ chăm sóc cho mẹ bầu và sau sinh tại spa hoặc tại nhà. Với nguyên liệu an toàn và kỹ thuật chăm sóc đúng chuẩn mong rằng sẽ giúp các chị em luôn khỏe mạnh và xinh đẹp.</p>\r\n<p>Vuông Tròn Spa còn mang đến cho khách hàng các dịch vụ điều trị công nghệ cao giúp chị em đẹp hơn, khoẻ hơn. Với máy móc nhập khẩu trực tiếp từ Châu Âu, tuyệt đối an toàn với sức khoẻ.</p>', '', '', '', '', '', '', 'http://vuongtronspa.com.vn/storage/uploads/2020-02-11/qp9a3305_size_6589x4392.JPG', '1', 'publish', null, null, '0', '', 'introduction', '0', '0', '0', '0', '2019-02-15 03:34:00', '2019-02-15 03:38:03', '2020-02-11 07:03:39');
INSERT INTO `posts` VALUES ('9', 'Chăm Sóc Da Mặt Cơ Bản', 'cham-soc-co-ban', 'Vuông Tròn Spa mang đến những dịch vụ chăm sóc cho mẹ bầu và sau sinh tại spa hoặc tại nhà. Với nguyên liệu an toàn và kỹ thuật chăm sóc đúng chuẩn mong rằng sẽ giúp các chị em luôn khỏe mạnh và xinh đẹp.', '<p><strong>Chăm sóc da mặt cơ bản</strong> là một quy trình không thế thiếu để cung cấp độ ẩm, dưỡng chất và cải thiện làn da của bạn với những thảo dược tự nhiên, an toàn.</p>\r\n<p><br /><strong>Quy trình Chăm sóc da mặt cơ bản:</strong><br />Bước 1: Tẩy trang lớp trang điểm và Rửa mặt. Giúp loại bỏ hết lớp trang điểm, các bụi bẩn, các nhờn dầu trên da. Làm sạch sẽ, thông thoáng da.<br />Bước 2: Tẩy tế bào chết. Bước này có thể loại bỏ các tế bào da chết ẩn sâu bên trong nang lông. Giúp thông thoáng lỗ chân lông và giúp làn da dễ hấp thu các dưỡng chất ở các bước tiếp theo.<br />Bước 3: Xông hơi, hút mụn. Xông hơi làm sạch sâu các lỗ chân lông, loại bỏ được hết tạp chất, mụn cám, mụn đầu đen ở mũi, vùng chữ T và giảm lượng dầu nhờn trên da.<br />Bước 4: Massage mặt thư giãn, giải tỏa những căng thẳng.<br />Bước 5: Đắp mặt nạ với loại mặt nạ phù hợp với từng loại da. Giúp cung cấp các dưỡng chất nuôi dưỡng làn da mềm mịn, làm sáng và trẻ hóa làn da.</p>', '', '', '<p>60’– 380.000VNĐ</p>', '', '<p>Chăm sóc da mặt cơ bản nhằm cung cấp độ ẩm, dưỡng chất và cải thiện làn da của bạn với những thảo dược tự nhiên, an toàn</p>', '', 'http://vuongtronspa.com.vn/storage/uploads/2019-05-15/close-up-of-young-woman-getting-spa-massage-treatment-at-beauty-spa-salon-23-2147939875-size-626x417_size_454x417.jpg', '1', 'publish', null, 'http://vuongtronspa.com.vn/contents/images/defaults/no-image.jpg', '0', '', 'service', '0', '0', '0', '0', '2019-02-16 01:21:00', '2019-02-16 01:27:31', '2019-07-12 02:33:10');
INSERT INTO `posts` VALUES ('11', '7 lý do để cho bé bú mẹ hoàn toàn trong 06 tháng đầu', '7-ly-do-de-cho-be-bu-me-hoan-toan-trong-06-thang-dau', 'Một số bác sĩ khuyên các bà mẹ đừng quá máy móc trong việc thai giáo mà hãy linh hoạt khi áp dụng nó. Những hoạt động hằng ngày có sự hỗ trợ của bố như vuốt ve, kể chuyện hay cho bé nghe, âm thanh sẽ được vận dụng thích hợp.', '<p>Một số bác sĩ khuyên các bà mẹ đừng quá máy móc trong việc thai giáo mà hãy linh hoạt khi áp dụng nó. Những hoạt động hằng ngày có sự hỗ trợ của bố như vuốt ve, kể chuyện hay cho bé nghe, âm thanh sẽ được vận dụng thích hợp. Hiện nay, việc áp dụng thai giáo bằng âm thanh rất phổ biến, chúng ta có thể tìm thấy rất nhiều các thể loại âm nhạc cho bé, phương pháp thai giáo này rất hiệu quả. Những bảnnhạc cổ điển trữ tình của Mozart, Beethoven. Tuy nhiên nếu sử dụng nó một cách vô thức thì hiệu quả nó mang lại sẽ ngược lại. Tại sao như vậy? Ông ấy chia sẻ rằng: nếu bạn có áp dụng việc nghe nhạc thì cũng điều độ và có thời lượng nhất định, không phải cứ muốn con thành thiên tài thì lúc nào cũng nghe nhạc. Bởi vì giống như bạn đang ép thai nhi một món ăn mà làm chúng bội thực, và kết quả lần sau khi nghe lại thai nhi sẽ cảm thấy sợ hay còn gọi là bị “tra tấn”. Ông ấy kể lại một câu chuyện mà ông ấy nhớ mãi đó là một lần có một bà mẹ mang thai đến tháng thứ 7, đến bệnh viện trong tình trạng stress nặng, cô ấy lo sợ cái thai bị ảnh hưởng vì cô ấy đã sử dụng thai giáo âm thanh quá nhiều. Liều ở chỗ là cô ấy có nhiều thời gian nên suốt ngày mở nhạc cho em bé. Kết quả qua một tuần, thai nhi hoạt động dữ dội, đạp thình thịch.Cô ấy lo lắng em bé sẽ bị sinh non.Thật ra ở giai đoạn này của thai kỳ, khoảng 20 tuần tuổi, tai bé đã hoàn thiện về cấu trúc, có thể cảm nhận các hoạt động diễn ra xung quanh, việc sử dụng âm thanh ở giai đoạn này nên tư vấn với bác sĩ là tốt nhất. Những bản nhạc du dương dễ chịu hoặc những bài dân ca có tiết tấu đơn giản nhẹ nhàng sẽ làm thai nhi dễ chịu hơn, cũng sẽ giúp ích cho người mẹ có được cảm giác dễ chịu, xóa tan muộn phiền. Phải lưu ý đến tần suất của việc nghe nhạc, trong lúc bạn nằm thư giãn nghe nhạc có thể dùng tay để vuốt ve bé, xoa bụng để bé biết việc bạn đang bên cạnh bé. Cũng không được sử dụng âm thanh quá lớn sẽ ảnh hưởng đến thính giác của bé sau này.</p>\r\n<p> </p>\r\n<p><a href=\"http://vuongtronspa.com.vn/storage/uploads/2019-03-13/close-up-of-young-woman-getting-spa-massage-treatment-at-beauty-spa-salon-23-2147939875_size_626x417.jpg\" target=\"_blank\" rel=\"noopener\"><img title=\"close-up-of-young-woman-getting-spa-massage-treatment-at-beauty-spa-salon-23-2147939875\" src=\"http://vuongtronspa.com.vn/storage/uploads/2019-03-13/close-up-of-young-woman-getting-spa-massage-treatment-at-beauty-spa-salon-23-2147939875_size_626x417.jpg\" alt=\"close-up-of-young-woman-getting-spa-massage-treatment-at-beauty-spa-salon-23-2147939875\" /></a></p>\r\n<p> </p>\r\n<p>Link bài viết chi tiết tham khảo tại:</p>\r\n<p><strong><a href=\"http://www.mommyspa.vn/cham-soc-suc-khoe-va-sac-dep-voi-phuong-phap-nhat-ban-watanabe.html\">http://www.mommyspa.vn/cham-soc-suc-khoe-va-sac-dep-voi-phuong-phap-nhat-ban-watanabe.html</a></strong></p>', '', '', '', '', '', '', 'http://vuongtronspa.com.vn/storage/uploads/2019-05-18/chua-nac-cut-cho-tre_size_764x858.jpg', '1', 'draft', null, null, '0', '', 'knowledge', '0', '0', '0', '0', '2019-02-16 06:30:00', '2019-02-16 06:31:56', '2019-05-18 05:19:06');
INSERT INTO `posts` VALUES ('12', 'SỰ KIỆN ĐẶC BIỆT (VÍ DỤ TÊN CỦA SỰ KIỆN CÓ 2 HÀNG)', 'su-kien-dac-biet-vi-du-ten-cua-su-kien-co-2-hang-', 'Một số bác sĩ khuyên các bà mẹ đừng quá máy móc trong việc thai giáo mà hãy linh hoạt khi áp dụng nó. Những hoạt động hằng ngày có sự hỗ trợ của bố như vuốt ve, kể chuyện hay cho bé nghe, âm thanh sẽ được vận dụng thích hợp.', '<p>Một số bác sĩ khuyên các bà mẹ đừng quá máy móc trong việc thai giáo mà hãy linh hoạt khi áp dụng nó. Những hoạt động hằng ngày có sự hỗ trợ của bố như vuốt ve, kể chuyện hay cho bé nghe, âm thanh sẽ được vận dụng thích hợp.</p>', '', '', '', '', '', '', 'http://vuongtronspa.com.vn/storage/uploads/2019-03-13/coconut-and-coconut-oil-on-wood-background-45583-1086_size_626x417.jpg', '1', 'publish', null, null, '0', '', 'knowledge', '0', '0', '0', '0', '2019-02-16 06:32:00', '2019-02-16 06:32:54', '2019-03-13 15:06:06');
INSERT INTO `posts` VALUES ('17', 'CÂU CHUYỆN & SỨ MỆNH', 'cau-chuyen-su-menh', 'Sự ra đời của Vuông Tròn Spa là kết quả của khát khao và mong muốn mang lại giá trị cân bằng cho người phụ nữ mang thai và sau khi sinh trong nhịp sống hiện đại. Vuông Tròn Spa mong muốn mang đến một lý tưởng sống mới qua những dịch vụ chăm sóc đầy ân cần và thấu hiểu.', '<p>Sự ra đời của Vuông Tròn Spa là kết quả của khát khao và mong muốn mang lại giá trị cân bằng cho người phụ nữ mang thai và sau khi sinh trong nhịp sống hiện đại. Với sự ô nhiễm về nguồn nguyên liệu, sự căng thẳng áp lực mà một nửa thế giới yêu thương phải đối diện hằng ngày. Vuông Tròn Spa mong muốn mang đến một lý tưởng sống mới qua những dịch vụ chăm sóc đầy ân cần và thấu hiểu. Để các chị em có thể chạm tay đến sự cân bằng, trở về hòa quyện cùng thiên nhiên qua nhưng nguyên liệu sạch mang tiêu chuẩn Organic ở tại spa hoặc ngay trong chính ngôi nhà của mình. Quá trình vượt cạn đầy gian nan sẽ được xoa dịu bởi đôi bàn tay khéo léo và tỉ mỉ như những cô gái hiền hòa. Sức khỏe của mẹ và bé chính là nguồn động lực để Vuông Tròn tiếp tục sáng tạo và không ngừng đổi mới giúp cho cuộc sống của chúng ta vẹn toàn hơn.</p>', '', '', '', '', '', '', 'http://vuongtronspa.com.vn/storage/uploads/2020-02-11/6436434-prancheta-1_size_3830x2419.jpg', '1', 'publish', null, null, '0', '', 'introduction', '0', '0', '0', '1', '2019-02-23 06:52:00', '2019-02-23 06:53:47', '2020-02-11 07:16:33');
INSERT INTO `posts` VALUES ('18', 'ĐỘI NGŨ CỦA CHÚNG TÔI', 'doi-ngu-cua-chung-toi', 'Với đội ngũ KTV có kinh nghiệm cùng với trang thiết bị hiện đại, chúng tôi tự hào là Spa hàng đầu trong lĩnh vực chăm sóc mẹ bầu trước & sau khi sinh. Vuông Tròn Spa mang đến những dịch vụ chăm sóc cho mẹ bầu và sau sinh tại spa hoặc tại nhà.', '<p>Với đội ngũ KTV có kinh nghiệm cùng với trang thiết bị hiện đại, chúng tôi tự hào là Spa hàng đầu trong lĩnh vực chăm sóc mẹ bầu trước & sau khi sinh</p>\r\n<p>Vuông Tròn Spa mang đến những dịch vụ chăm sóc cho mẹ bầu và sau sinh tại spa hoặc tại nhà. Với nguyên liệu an toàn và kỹ thuật chăm sóc đúng chuẩn mong rằng sẽ giúp các chị em luôn khỏe mạnh và xinh đẹp.</p>', '', '', '', '', '', '', 'http://vuongtronspa.com.vn/storage/uploads/2020-02-11/qp9a3378_size_6532x4354.JPG', '1', 'publish', null, null, '0', '', 'introduction', '0', '0', '0', '2', '2019-03-20 12:07:00', '2019-03-20 12:08:38', '2020-02-11 07:05:21');
INSERT INTO `posts` VALUES ('20', 'Chính Sách Bảo Mật', 'chinh-sach-bao-mat', null, '<p>Chính Sách Bảo Mật</p>', '', '', '', '', '', '', null, '1', 'publish', null, null, '0', '', 'page', '0', '0', '0', '0', '2019-03-23 06:20:00', '2019-03-23 06:20:35', '2019-03-23 06:20:35');
INSERT INTO `posts` VALUES ('21', 'Chăm Sóc Da Bột Cỏ Hương', 'cham-soc-da-bot-co-huong', 'Cỏ hương là nguồn cung cấp tuyệt vời các khoáng chất cần thiết cho da như canxi, photpho và kali..các khoáng chất giúp nuôi dưỡng da từ bên trong. ', '<p style=\"text-align: justify;\"><strong>Chăm sóc da mặt Bột cỏ hương</strong> là một quy trình đặc biệt cung cấp độ ẩm, dưỡng chất và cải thiện làn da của bạn với nguyên liệu chính là bột cỏ hương. Thành phần cỏ hương là nguồn cung cấp tuyệt vời các khoáng chất cần thiết cho da như canxi, photpho và kali.. các khoáng chất giúp nuôi dưỡng da từ bên trong.</p>\r\n<p> </p>\r\n<p><strong>Quy trình Chăm sóc da mặt:</strong></p>\r\n<p style=\"text-align: justify;\">Bước 1: Tẩy trang lớp trang điểm và Rửa mặt.Đây là phương pháp giúp loại bỏ hết lớp trang điểm. Làm sạch các bụi bẩn, nhờn dầu trên da. Làm sạch các nang lông và thông thoáng da mặt.</p>\r\n<p style=\"text-align: justify;\">Bước 2: Tẩy tế bào chết, từ đó có thể loại bỏ các tế bào da chết, lớp vẩy tích tụ sâu bên trong nang lông. Ngoài ra, tẩy tế bào chết còn làm giãn nở lỗ chân lông giúp các dưỡng chất có thể thẩm thấu vào sâu bên trong và đạt được kết quả tốt hơn.</p>\r\n<p style=\"text-align: justify;\">Bước 3: Xông hơi, hút mụn. Xông hơi làm sạch sâu các lỗ chân lông, loại bỏ được hết tạp chất, mụn cám, mụn đầu đen ở mũi, vùng chữ T và giảm lượng dầu nhờn trên da.</p>\r\n<p style=\"text-align: justify;\">Bước 4: Massage mặt thư giãn, giải tỏa những căng thẳng.</p>\r\n<p style=\"text-align: justify;\">Bước 5: Đắp mặt nạ với loại mặt nạ từ Cỏ hương. Các dưỡng chất từ bột cỏ hương sẽ nuôi dưỡng giúp làn da được trẻ hóa, sáng da và mềm mịn.</p>', '', '', '<p>60\' - 400.000VNĐ</p>', '', '<p>Massage mặt bằng bột cỏ hương cung cấp độ ẩm, dưỡng chất và cải thiện làn da bằng các khoáng chất nuôi dưỡng da từ bên trong, cần thiết cho da như canxi, photpho và kali.. </p>', '', 'http://vuongtronspa.com.vn/storage/uploads/2019-04-18/dat-set-4_size_800x800.JPG', '1', 'publish', null, null, '0', '', 'service', '0', '0', '0', '0', '2019-04-08 07:58:00', '2019-04-08 08:02:09', '2019-04-18 12:48:36');
INSERT INTO `posts` VALUES ('22', 'Chăm Sóc Da Đất Sét Xanh Pháp', 'cham-soc-da-dat-set-xanh-phap', null, '<p><strong>Đất sét xanh Pháp</strong> là thành phần luôn được các chuyên da da liễu tin dùng nhằm kích thích máu và lưu thông bạch huyết, loại bỏ các tế bào chết, tăng cường liên kết các mô của da, đặc biệt thích hợp cho da nhờn. Vì thế đây là một quy trình tuyệt vời nhằm cung cấp dưỡng chất, tái tạo và cải thiện làn da của bạn.</p>\r\n<p><br /><strong>Quy trình Chăm sóc da với Đất sét xanh Pháp:</strong><br />Bước 1: Tẩy trang lớp trang điểm và Rửa mặt. Làn da của khách hàng sẽ được làm sạch, loại bỏ lớp trang điểm, các bụi bẩn, nhờn dầu có sẵn trên da.<br />Bước 2: Tẩy tế bào chết. Tẩy tế bào là một bước không thể thiếu của các quy trình chăm sóc da. Bước này sẽ giúp lấy đi các tế bào da chết, bị ẩn sâu trong lỗ chân lông, gây bí tắc. Sau khi tẩy tế bào, các nang lông sẽ thông thoáng, từ đó các dưỡng chất sẽ dễ dàng thẩm thấu vào lớp biểu bì. <br />Bước 3: Xông hơi, hút mụn. Xông hơi làm sạch sâu các lỗ chân lông, loại bỏ được hết tạp chất. Ngoài ra, đây là bước đặc biệt giúp làm sạch hoàn toàn mụn cám, mụn đầu đen ở mũi, vùng chữ T ẩn trên da và giảm lượng dầu nhờn trên da.<br />Bước 4: Massage mặt thư giãn, giải tỏa những căng thẳng trong công việc, cuộc sống.<br />Bước 5: Đắp mặt nạ với loại mặt nạ từ Đất sét xanh Pháp. Làn da sẽ được chăm sóc, cải thiện làm sáng, trẻ hóa nhờ những dưỡng chất có trong Đất sét xanh Pháp.</p>', '', '', '<p>60\' - 450.000VNĐ</p>', '', '<p>Massage mặt bằng đất sét xanh Pháp nhằm kích thích máu và lưu thông bạch huyết, loại bỏ các tế bào chết, tăng cường liên kết các mô của da. Làn da sẽ được chăm sóc, cải thiện làm sáng, trẻ hóa làn da một cách tốt nhất.</p>\r\n<p>Thích hợp cho da nhờn.</p>', '', 'http://vuongtronspa.com.vn/storage/uploads/2019-05-07/dat-set-xanh_size_3610x3264.jpg', '1', 'publish', null, 'http://vuongtronspa.com.vn/contents/images/defaults/no-image.jpg', '0', '', 'service', '0', '0', '0', '0', '2019-04-08 14:31:00', '2019-04-08 14:34:43', '2019-05-07 04:43:14');
INSERT INTO `posts` VALUES ('23', 'TUYỂN DỤNG & ĐÀO TẠO', 'tuyen-dung-dao-tao', 'Nhằm tạo điều kiện cho các bạn hộ lý, điều dưỡng, các bạn chưa có kinh nghiệm trong lĩnh vực chăm sóc sức khỏe và sắc đẹp có cơ hội kiếm việc làm tốt với thu nhập cao, Vuông Tròn Spa thường xuyên mở các lớp đào tạo kỹ thuật viên chuyên nghiệp.\r\nVuông Tròn tuyển 02 Lễ Tân, và 10 KTV\r\n- Yêu cầu : nhanh nhẹn, trung thực, làm lâu dài \r\n- Quyền lợi : được làm việc trong môi trường thân thiện, học hỏi được nhiều điều', '<p>Nhằm tạo điều kiện cho các bạn hộ lý, điều dưỡng, các bạn chưa có kinh nghiệm trong lĩnh vực chăm sóc sức khỏe và sắc đẹp có cơ hội kiếm việc làm tốt với thu nhập cao, Vuông Tròn Spa thường xuyên mở các lớp đào tạo kỹ thuật viên chuyên nghiệp.</p>\r\n<p> </p>\r\n<p>Đảm bảo 100% sau khi hoàn tất khóa đào tạo các bạn sẽ có việc làm ổn định, thu nhập cao.<br />Ưu tiên cho 10 bạn đăng ký đầu tiên sẽ được giảm 2.000.000đ học phí.</p>\r\n<p> </p>\r\n<p>1. Khóa Kỹ Thuật Trọn Gói: 15.000.000đ - đối với học viên làm việc tại Vuông Tròn Spa<br />2. Khóa Kỹ Thuật Trọn Gói: 30.000.000đ - đối với học viên tự do</p>', '', '', '', '', '', '', 'http://vuongtronspa.com.vn/storage/uploads/2020-02-11/qp9a3218_size_5308x3539.JPG', '1', 'publish', null, null, '0', '', 'introduction', '0', '0', '0', '3', '2019-04-08 14:43:00', '2019-04-08 14:44:29', '2020-02-11 07:23:49');
INSERT INTO `posts` VALUES ('24', 'Chăm Sóc Da Tảo Spirulina', 'cham-soc-da-tao-spirulina', 'Mặt nạ Tảo Spirulina là một sự lựa chọn tuyệt vời đối với làn da của phái đẹp, đặc biệt là thần dược đối với làn da khô. Tảo Spirulina là thành phần tự nhiên giúp chống viêm nhiễm, kháng khuẩn, giảm kích ứng da, giúp làn da khỏe khoắn, mềm mại.', '<p><strong>Mặt nạ Tảo Spirulina</strong> là một sự lựa chọn tuyệt vời đối với làn da của phái đẹp, đặc biệt là thần dược đối với làn da khô. Tảo Spirulina là thành phần tự nhiên giúp chống viêm nhiễm, kháng khuẩn, giảm kích ứng da, giúp làn da khỏe khoắn, mềm mại.</p>\r\n<p><strong> Quy trình Chăm sóc da mặt với Tảo Spirulina:</strong><br /> Bước 1: Tẩy trang lớp trang điểm và Rửa mặt, để loại bỏ lớp trang điểm, các bụi bẩn, nhờn dầu trên da.</p>\r\n<p>Bước 2: Tẩy tế bào chết để loại bỏ các tế bào da chết, mảng vẩy ẩn sâu bên trong nang lông. Giúp thông thoáng lỗ chân lông để các dưỡng chất có thể thấm thấu sâu vào lớp biểu bì.</p>\r\n<p>Bước 3: Xông hơi, hút mụn. Xông hơi làm sạch sâu các lỗ chân lông, lấy được hết tạp chất, mụn cám, mụn đầu đen ở mũi, vùng chữ T và giảm lượng dầu nhờn được tiết trên da.</p>\r\n<p>Bước 4: Massage mặt thư giãn, giải tỏa những căng thẳng.</p>\r\n<p>Bước 5: Đắp mặt nạ với mặt nạ Tảo Spirulina. Giúp cung cấp các dưỡng chất nuôi dưỡng làn da khỏe khoắn, mượt mà, giảm kích ứng da, sưng tấy do mụn gây ra.</p>', '', '', '<p>60\' - 450.000VNĐ</p>', '', '<p>Massage mặt với Tảo Spirulina cung cấp các dưỡng chất nuôi dưỡng làn da khỏe khoắn, mượt mà, giảm kích ứng da, sưng tấy do mụn gây ra</p>', '', 'http://vuongtronspa.com.vn/storage/uploads/2019-05-07/tao-spiruna_size_3610x3264.jpg', '1', 'publish', null, 'http://vuongtronspa.com.vn/storage/uploads/2019-06-12/dscf3236_size_1040x641.jpg', '0', '', 'service', '0', '0', '0', '0', '2019-04-09 03:16:00', '2019-04-09 03:19:15', '2020-02-12 08:08:56');
INSERT INTO `posts` VALUES ('25', 'Chăm Sóc Da Yến Mạch Organic', 'cham-soc-da-yen-mach-organic', null, '<p><strong>Mặt nạ Yến mạch Organic</strong> có thành phần chính là chất chống viêm tự nhiên avenanthramide làm lành nhanh vết thương cải thiện làn da bị vẩy nến hay chàm eczema, dưỡng trắng da, tăng cường độ ẩm, làm dịu làn da bị cháy nắng. Với khả năng hấp thụ dầu, vi khuẩn trên da, bột Yến mạch Organic còn có tác dụng loại bỏ mụn hiệu quả, đặc biệt là mụn trứng cá</p>\r\n<p> </p>\r\n<p><strong>Quy trình Chăm sóc da mặt Yến mạch Organic:</strong></p>\r\n<p>Bước 1: Tẩy trang lớp trang điểm và Rửa mặt, làm sạch da, thông thoáng lỗ chân lông.</p>\r\n<p>Bước 2: Tẩy tế bào chết để loại bỏ các tế bào da chết, mảng vẩy nến ẩn sâu bên trong nang lông. Giúp các dưỡng chất dễ dàng thấm sâu vào da.</p>\r\n<p>Bước 3: Xông hơi, hút mụn. Xông hơi làm sạch sâu các lỗ chân lông, lấy được hết tạp chất, mụn cám, mụn đầu đen ở mũi, vùng chữ T và giảm lượng dầu nhờn được tiết trên da.</p>\r\n<p>Bước 4: Massage mặt thư giãn, giải tỏa những căng thẳng.</p>\r\n<p>Bước 5: Đắp mặt nạ với mặt nạ Yến mạch Organic, giúp nuôi dưỡng làn da mịn màng, khỏe khoắn.</p>\r\n<p> </p>', '', '', '<p>60\' - 450.000VNĐ</p>', '', '<p>Massage mặt bằng Yến mạch Organic làm lành nhanh vết thương cải thiện làn da bị vẩy nến hay chàm eczema, dưỡng trắng da, tăng cường độ ẩm, làm dịu làn da bị cháy nắng, loại bỏ mụn hiệu quả, đặc biệt là mụn trứng cá.</p>', '', 'http://vuongtronspa.com.vn/storage/uploads/2019-05-07/yen-mach-2_size_3299x2982.jpg', '1', 'publish', null, 'http://vuongtronspa.com.vn/contents/images/defaults/no-image.jpg', '0', '', 'service', '0', '0', '0', '0', '2019-04-09 03:31:00', '2019-04-09 03:35:13', '2019-05-07 04:25:14');
INSERT INTO `posts` VALUES ('26', 'Massage Đầu Cổ Vai', 'massage-dau-co-vai', null, '<p><strong>Massage đầu, cổ, vai</strong> là phương pháp rất quan trọng và cần thiết đối với phụ nữ, đặc biệt là đối vợi mẹ bầu ở giai đoạn thai kỳ dưới 12 tuần tuổi. Massage đầu, cổ, vai có tác dụng rất tốt giúp phụ nữ thư giãn, xua tan những căng thẳng, mệt mỏi trong cuộc sống cũng như giải tỏa những áp lực thai nhi đè nặng lên cơ thể người mẹ. Ngoài ra, massage còn giúp phụ nữ ngủ ngon và sâu giấc hơn.</p>\r\n<p> </p>\r\n<p><strong>Quy trình massage đầu, cổ, vai:</strong></p>\r\n<ul>\r\n<li>Ngâm chân thư giãn với thảo dược, chống phù nề, nhức mỏi.</li>\r\n<li>Massage đầu, cổ, vai thư giãn với những kĩ thuật đặc biệt, trị mỏi nhức, cải thiện tuần hoàn máu lưu thông dưới da.</li>\r\n</ul>', '', '', '<p>30\' - 230.000VNĐ</p>\r\n<p>60\' - 450.000VNĐ</p>', '<p>Massage thư giãn đầu, cổ, vai</p>', '', '', 'http://vuongtronspa.com.vn/storage/uploads/2019-05-02/dau-co-vai-fi_size_400x400.jpg', '1', 'publish', null, 'http://vuongtronspa.com.vn/contents/images/defaults/no-image.jpg', '0', '', 'service', '0', '0', '0', '0', '2019-04-09 03:53:00', '2019-04-09 04:03:43', '2019-05-15 10:39:39');
INSERT INTO `posts` VALUES ('27', 'Massage Chân', 'massage-chan', null, '<p><strong>Massage chân</strong> là một liệu trình không thể thiếu với phụ nữ và phụ nữ đang mang thai.</p>\r\n<p>Trong lúc đang mang thai, cơ thể của mẹ bầu thay đổi rất nhiều, đặc biệt là đôi chân có thể trở nên phù nề, tê cứng do phải gánh chịu sức nặng của cơ thể. </p>\r\n<p>Đông y cho rằng với hơn 60 huyệt ở chân có quan hệ mật thiết với lục phủ ngũ tạng, vì vậy massage chân còn có tác dụng rất tốt giúp phục hồi trạng thái cân bằng của cơ thể.</p>\r\n<p> </p>\r\n<p><strong>Quy trình massage chân:</strong></p>\r\n<ul>\r\n<li>Ngâm chân thư giãn với thảo dược, chống phù nề, nhức mỏi.</li>\r\n<li>Massage chân ( gót chân, mặt dưới của bàn chân; mắt cá chân; ngón chân; cẳng chân) với kĩ thuật đặc biệt giúp phụ nữ giảm tình trạng chuột rút, căng cơ trong giai đoạn mang thai cũng như xua tan, mệt mỏi đau nhức từ những hoạt động hằng ngày.</li>\r\n</ul>', '', '', '<p>60\' - 450.000VNĐ</p>', '<p style=\"text-align: justify;\">Massage chân bằng kĩ thuật đặc biệt tại các vị trí gót chân, mặt dưới của bàn chân; mắt cá chân; ngón chân; cẳng chân giúp phụ nữ giảm tình trạng chuột rút, căng cơ; xua tan, mệt mỏi đau nhức từ những hoạt động hằng ngày</p>', '', '', 'http://vuongtronspa.com.vn/storage/uploads/2019-05-15/13501867-1340481685969458-8669450412019674213-n_size_766x766.jpg', '1', 'publish', null, 'http://vuongtronspa.com.vn/contents/images/defaults/no-image.jpg', '0', '', 'service', '0', '0', '0', '0', '2019-04-09 04:05:00', '2019-04-09 04:16:58', '2019-05-15 10:38:24');
INSERT INTO `posts` VALUES ('28', 'Massage Tinh Dầu Thảo Mộc Organic', 'massage-tinh-dau-thao-moc-organic', 'Massage tinh dầu thảo mộc Organic', '<p style=\"text-align: justify;\"><strong>Massage Tinh dầu thảo mộc Organic</strong> là một liệu trình đặc biệt, mang lại nhiều hiệu quả đối với phụ nữ và phụ nữ đang mang thai. Massage cơ thể với Tinh dầu thảo mộc Organic có tác dụng rất tốt giúp phụ nữ thư giãn, xua tan những căng thẳng, mệt mỏi trong cuộc sống, tái tạo năng lượng và cải thiện tuần hoàn máu lưu thông dưới da. Ngoài ra, massage Tinh dầu thảo mộc Organic còn giúp phụ nữ ngủ ngon và sâu giấc hơn.<br /> <br /> <strong>Quy trình massage Tinh dầu thảo mộc Organic:</strong></p>\r\n<ul>\r\n<li>Ngâm chân thư giãn với thảo dược, chống phù nề, nhức mỏi.</li>\r\n<li>Massage toàn thân bằng Tinh dầu thảo mộc Organic giúp giảm bớt căng thẳng mệt mỏi, phục hồi tinh thần và sức khỏe.</li>\r\n</ul>', '', '', '<p>60\' - 450.000VNĐ</p>\r\n<p>90\' - 550.000VNĐ</p>', '<p style=\"text-align: justify;\">Massage toàn thân bằng Tinh dầu thảo mộc Organic có tác dụng rất tốt giúp phụ nữ thư giãn, xua tan những căng thẳng, mệt mỏi trong cuộc sống, tái tạo năng lượng và cải thiện tuần hoàn máu lưu thông dưới da</p>', '', '', 'http://vuongtronspa.com.vn/storage/uploads/2020-02-12/qp9a3502_size_6253x4169.JPG', '1', 'publish', '1', 'http://vuongtronspa.com.vn/storage/uploads/2020-02-12/qp9a3502_size_6253x4169.JPG', '0', '', 'service', '0', '0', '0', '0', '2019-04-09 04:31:00', '2019-04-09 04:36:21', '2020-02-12 08:08:04');
INSERT INTO `posts` VALUES ('29', 'Massage Dầu Mè Gừng Tươi', 'massage-dau-me-gung-tuoi', null, '<p style=\"text-align: justify;\"><strong>Massage dầu mè, gừng tươi</strong> là một phương pháp rất hiệu quả đối với phụ nữ và mẹ bầu đang mang thai. Massage cơ thể dầu mè, gừng tươi có tác dụng rất tốt giúp phụ nữ thư giãn, xua tan những căng thẳng, mệt mỏi trong cuộc sống, tái tạo năng lượng và cải thiện tuần hoàn máu lưu thông dưới da và đánh thức mọi giác quan của cơ thể.</p>\r\n<p> </p>\r\n<p><strong>Quy trình massage dầu mè, gừng tươi:</strong></p>\r\n<ul>\r\n<li>Ngâm chân thư giãn với thảo dược, chống phù nề, nhức mỏi.</li>\r\n<li>Massage toàn thân bằng dầu mè, gừng tươi giúp giảm bớt căng thẳng mệt mỏi, phục hồi tinh thần và sức khỏe.</li>\r\n</ul>', '', '', '<p>60\' - 480.000VNĐ</p>\r\n<p>90\' - 580.000VNĐ</p>', '<p style=\"text-align: justify;\">Massage toàn thân bằng dầu mè, gừng tươi có tác dụng rất tốt giúp phụ nữ thư giãn, xua tan những căng thẳng, mệt mỏi trong cuộc sống, tái tạo năng lượng và cải thiện tuần hoàn máu lưu thông dưới da và đánh thức mọi giác quan của cơ thể</p>', '', '', 'http://vuongtronspa.com.vn/storage/uploads/2019-05-15/12705711-734090180061447-416346890743494469-n_size_802x802.jpg', '1', 'publish', null, 'http://vuongtronspa.com.vn/contents/images/defaults/no-image.jpg', '0', '', 'service', '0', '0', '0', '0', '2019-04-09 04:43:00', '2019-04-09 04:48:26', '2019-07-12 09:32:07');
INSERT INTO `posts` VALUES ('30', 'Massage Đá Nóng', 'massage-da-nong', 'Massage cơ thể bằng đá nóng nhằm tiếp thêm luồng sinh khí mới cho cơ thể con người sau những giây phút làm việc căng thẳng, mệt mỏi. Đá có khả năng hút độc tố ra khỏi cơ thể, giảm sức ỳ, cân bằng trạng thái tâm lý, chống trầm cảm và hỗ trợ điều trị các vấn để về cơ, xương, khớp', '<p style=\"text-align: justify;\"><strong>Massage đá nóng</strong> là phương pháp tác động lên cơ thể bằng các rung động cực nhỏ do sự thay đổi nhiệt độ, nhằm kích thích sâu vào các huyệt đạo từ đó giúp bạn tăng cường năng lượng trong cơ thể. Ngoài ra, massage đá nóng còn có tác dụng tiếp thêm luồng sinh khí mới cho cơ thể con người sau những giây phút làm việc căng thẳng, mệt mỏi. Đá có khả năng hút độc tố ra khỏi cơ thể, giảm sức ỳ, cân bằng trạng thái tâm lý, chống trầm cảm và hỗ trợ điều trị các vấn để về cơ, xương, khớp.</p>\r\n<p> </p>\r\n<p><strong>Quy trình massage đá nóng:</strong></p>\r\n<ul>\r\n<li>Ngâm chân thư giãn với thảo dược, chống phù nề, nhức mỏi.</li>\r\n<li>Massage toàn thân bằng sức nóng của đá tự nhiên hòa quyện cùng tinh dầu thảo mộc Organic giúp cân bằng các cơ, xua tan mệt mỏi, tái tạo năng lượng.</li>\r\n</ul>', '', '', '<p>90\' - 550.000VNĐ</p>', '<p style=\"text-align: justify;\">Massage cơ thể bằng đá nóng nhằm tiếp thêm luồng sinh khí mới cho cơ thể con người sau những giây phút làm việc căng thẳng, mệt mỏi. Đá có khả năng hút độc tố ra khỏi cơ thể, giảm sức ỳ, cân bằng trạng thái tâm lý, chống trầm cảm và hỗ trợ điều trị các vấn để về cơ, xương, khớp</p>', '', '', 'http://vuongtronspa.com.vn/storage/uploads/2019-05-12/da-nong-123_size_823x823.jpg', '1', 'publish', null, 'http://vuongtronspa.com.vn/storage/uploads/2019-06-12/dscf3272_size_1061x654.jpg', '0', '', 'service', '0', '0', '0', '0', '2019-04-09 04:57:00', '2019-04-09 04:59:29', '2020-02-12 08:08:34');
INSERT INTO `posts` VALUES ('31', 'Massage Thảo Dược Tươi', 'massage-thao-duoc-tuoi', null, '<p style=\"text-align: justify;\"><strong>Massage Thảo dược tươi</strong> là phương pháp có sự kết hợp hoàn hảo giữa kỹ thuật massage và liệu pháp thảo dược. Không chỉ mang lại sự thư giãn tuyệt vời cho cả tinh thần và cơ thể, phương pháp massage này còn tác động sâu vào các cơ bắp, làm mềm vùng cơ căng cứng, mang lại hiệu quả thư giãn tuyệt vời. Ngoài ra, massage thảo dược tươi còn giúp lưu thông tuần hoàn máu, làm dịu các vùng cơ mỏi, tan mỡ, tạo sự săn chắc, thon gọn và mang lại sự mịn màng, tươi sáng cho làn da toàn thân.</p>\r\n<p><strong>Phù hợp với phụ nữ và phụ nữ đang mang thai.</strong></p>\r\n<p><br /> <strong>Quy trình massage thảo dược tươi:</strong></p>\r\n<ul>\r\n<li>Ngâm chân thư giãn với thảo dược, chống phù nề, nhức mỏi.</li>\r\n<li>Massage toàn thân bằng thảo dược tươi mang đến cảm giác thư giãn, sảng khoái cho cơ thể và tinh thần.</li>\r\n</ul>', '', '', '<p>90\' - 560.000VNĐ</p>', '<p style=\"text-align: justify;\">Massage toàn thân bằng thảo dược tươi giúp lưu thông tuần hoàn máu, làm dịu các vùng cơ mỏi, tan mỡ, tạo sự săn chắc, thon gọn và mang lại sự mịn màng, tươi sáng cho làn da toàn thân</p>', '', '', 'http://vuongtronspa.com.vn/storage/uploads/2019-05-15/thao-duoc-tuoi_size_799x799.jpg', '1', 'publish', null, 'http://vuongtronspa.com.vn/contents/images/defaults/no-image.jpg', '0', '', 'service', '0', '0', '0', '0', '2019-04-09 05:08:00', '2019-04-09 05:10:54', '2019-07-12 02:34:44');
INSERT INTO `posts` VALUES ('32', 'Hạnh Phúc Tròn Đầy 30 Ngày', 'hanh-phuc-tron-day-30-ngay', 'Chăm Sóc Sau Sinh tại nhà 30 ngày - liệu trình độc quyền nhà Vuông Tròn Spa', '<p style=\"text-align: justify;\"><strong>\"Hạnh phúc tròn đầy 30 ngày\"</strong> được xem là liệu trình tuyệt vời nhất để chăm sóc cơ thể, sắc đẹp và sức khỏe dành riêng cho những ai sau khi sinh em bé. Xuyên suốt liệu trình, bạn sẽ được trải nghiệm nhiều bước khác nhau kết hợp với các dược liệu từ thiên nhiên hoàn toàn tốt cho sức khỏe.</p>\r\n<p><strong>Các bước cho một liệu trình bao gồm:</strong></p>\r\n<ul>\r\n<li>Chăm sóc da mặt bằng bột nghệ đen hay nghệ trắng trứng gà;</li>\r\n<li>Hơ mặt với lá trầu không và muối nghệ giúp da trắng sáng, hồng hào, săn chắc hơn;</li>\r\n<li>Xoa dịu đôi mắt giảm quầng thâm với trà xanh Organic;</li>\r\n<li>Massage giúp kích sữa và thông tắc tuyến sữa;</li>\r\n<li>Massage giảm nhức mỏi bằng tinh dầu thảo mộc Organic;</li>\r\n<li>Xoa bóp toàn thân bằng rượu gừng, nghệ, thuốc bắc hạ thổ làm cơ thể thư giãn và vô cùng thoải mái;</li>\r\n<li>Xông và vệ sinh vùng kín với thảo dược;</li>\r\n<li>Gội đầu thảo dược nấu (bồ kết, sả, chanh...);</li>\r\n<li>Tẩy thâm nách, bẹn, mông;</li>\r\n<li>Massage giảm thâm và vết rạn vùng bụng;</li>\r\n<li>Chườm ấm bụng co hồi dạ con và giảm vết rạn bằng thảo dược (muối, gừng, ngải cứu);</li>\r\n<li>Đắp nạ bụng, thảo dược săn chắc bụng;</li>\r\n<li>Ngâm chân thảo mộc giúp lưu thông khí huyết;</li>\r\n<li>Massage chân giảm nhức mỏi và đào thải nước;</li>\r\n<li>Tẩy tế bào chết và đắp ủ nghệ đen toàn thân giúp da trắng sáng và mịn màng;</li>\r\n<li>Xông hơi và tắm thảo dược cổ truyền của người dân tộc Dao Đỏ.</li>\r\n</ul>\r\n<p style=\"text-align: justify;\">Hoàn tất liệu trình bạn sẽ cảm nhận sự thay đổi rõ rệt với làn da trắng sáng, mịn màng cùng với tình trạng sức khỏe được cải thiện tốt nhất.</p>', '', '', '<p>30 Ngày - 19.600.000VNĐ (120\'/Ngày)</p>\r\n<p>Liên hệ để được tư vấn tốt nhất</p>', '<p>Liệu trình Chăm Sóc Sau Sinh 30 ngày tại nhà độc quyền.</p>\r\n<p>Qua liệu trình này, các mẹ sau sinh sẽ lấy lại vóc dáng \"con gái\" nhanh nhất.</p>', '<p>Chăm sóc da mặt bằng bột nghệ đen hay nghệ trắng trứng gà</p>', '<p>Gội đầu với thảo dược nấu (bồ kết, sả, chanh,...)</p>', 'http://vuongtronspa.com.vn/storage/uploads/2020-02-12/qp9a3479-2_size_6720x4480.JPG', '1', 'publish', '1', 'http://vuongtronspa.com.vn/storage/uploads/2020-02-12/qp9a3489_size_6292x3876.JPG', '0', '', 'service', '0', '0', '0', '0', '2019-04-09 07:28:00', '2019-04-09 07:40:13', '2020-02-12 08:09:24');
INSERT INTO `posts` VALUES ('33', 'Phục Hồi Nhanh Chóng 5 Ngày', 'phuc-hoi-nhanh-chong-5-ngay', 'Với liệu trình này, phụ nữ sau sinh sẽ được chăm sóc một cách toàn diện để phục hồi cơ thể một cách mau chóng. Sau các bước chăm sóc của liệu trình, các bạn sẽ cảm thấy thư giãn hơn, thoải mái hơn và lấy lại vẻ đẹp nhanh chóng giúp mang lại sự tự tin sau khi sinh.', '<p>Với liệu trình này, phụ nữ sau sinh sẽ được chăm sóc một cách toàn diện để phục hồi cơ thể một cách mau chóng.</p>\r\n<p style=\"text-align: justify;\">Đầu tiên, các bạn sẽ được hơ mắt cùng lá trầu không kết hợp với đắp trà xanh organic, giúp xoa dịu đôi mắt, giảm đỏ mắt và quầng thăm.</p>\r\n<p style=\"text-align: justify;\">Cùng với hơ mắt, các bạn sẽ được hơ mặt cùng lá trầu không và chăm sóc da mặt bằng tinh bột nghệ đen, mật ong giúp da trở nên trắng sáng, hồng hào và săn chắc hơn.</p>\r\n<p style=\"text-align: justify;\">Chuyên viên sẽ gội thảo dược nấu (chanh, sả, bồ kết) giúp các bạn thoải mái, thư giản mà còn giúp tóc bóng mượt giảm hư tổn.</p>\r\n<p>Tiếp đến phần chăm sóc cơ thể, gồm các bước như sau:</p>\r\n<ul>\r\n<li style=\"text-align: justify;\">Massage lưng, cổ, vai, gáy cùng với xoa bóp toàn thân bằng rượu ngâm gừng, nghệ, thuốc bắc, địa liền hạ thổ làm giảm nhức mỏi; </li>\r\n<li style=\"text-align: justify;\">Chườm ấm bụng bằng muối, gừng, ngải cứu có tác dụng giảm mỡ bụng, nhanh co dạ con, mờ thâm rạn và phòng hậu sản. Bên cạnh đó, các bạn sẽ được đắp nạ bụng bằng thảo dược để bụng được săn chắc hơn; </li>\r\n<li style=\"text-align: justify;\">Xông vùng kín với thảo dược;</li>\r\n<li style=\"text-align: justify;\">Tẩy thâm, nách, bẹn, mông ;</li>\r\n<li style=\"text-align: justify;\">Massage ngực kết hợp đắp thảo dược vùng ngực giúp nhũ hoa giảm thâm và trở nên hồng hơn; </li>\r\n<li style=\"text-align: justify;\">Xông hơi, tắm bằng thảo dược Dao Mama của người dân tộc Dao đỏ, cùng với tẩy tế bào chết và đắp ủ toàn thân giúp da trắng sáng và mịn màng;</li>\r\n</ul>\r\n<p style=\"text-align: justify;\">Sau các bước chăm sóc của liệu trình, các bạn sẽ cảm thấy thư giãn hơn, thoải mái hơn và lấy lại vẻ đẹp nhanh chóng giúp mang lại sự tự tin sau khi sinh.</p>', '', '', '<p>Giá trọn gói - 3.800.000VND (150\'/ngày)</p>\r\n<p>Giá 1 ngày - 800.000VND</p>', '<p style=\"text-align: justify;\">Xoa bóp toàn thân bằng rượu ngâm gừng, nghệ, thuốc bắc, địa liền hạ thổ</p>', '<p style=\"text-align: justify;\">Chăm sóc da mặt bằng tinh bột nghệ đen, mật ong</p>', '<p style=\"text-align: justify;\">Gội thảo dược nấu (chanh, sả, bồ kết)</p>', 'http://vuongtronspa.com.vn/storage/uploads/2019-05-15/13507105-1340478465969780-1841230215691059342-n-2_size_350x350.jpg', '1', 'publish', null, 'http://vuongtronspa.com.vn/storage/uploads/2019-05-15/525x350_size_520x346.jpg', '0', '', 'service', '0', '0', '0', '0', '2019-04-09 07:55:00', '2019-04-09 08:03:32', '2019-06-12 15:35:40');
INSERT INTO `posts` VALUES ('34', 'Phục Hồi Cơ Bản', 'phuc-hoi-co-ban', 'Đa phần phụ nữ thường bị mệt mỏi sau khi sinh, Vuông Tròn Spa hiểu được điều đó nên đã mang đến các bạn liệu trình \" Phục Hồi Cơ Bản\".', '<p style=\"text-align: justify;\">Đa phần phụ nữ thường bị mệt mỏi sau khi sinh, Vuông Tròn Spa hiểu được điều đó nên đã mang đến các bạn liệu trình <strong>\" Phục Hồi Cơ Bản\"</strong>. Liệu trình này sẽ giúp các bạn khôi phục sức khỏe và cải thiện vẻ bề ngoài mau chóng và hoàn thiện nhất.</p>\r\n<p style=\"text-align: justify;\"><strong>Liệu trình bao gồm 9 bước chăm sóc cơ bản với các dược liệu từ tự nhiên mang lại cảm giác vô cùng thoải mái:</strong></p>\r\n<ul>\r\n<li>Massage giảm nhức mỏi với tinh dầu thảo mộc thiên nhiên;</li>\r\n<li>Chườm ấm bụng giúp mau co hồi dạ con;</li>\r\n<li>Xông vùng kín với thảo dược;</li>\r\n<li>Chăm sóc da mặt bằng tinh bột nghệ đen, mật ong;</li>\r\n<li>Xoa dịu đôi mắt giảm quầng thâm với trà xanh;</li>\r\n<li>Xoa bóp tăng tuyến sữa (đắp mặt nạ ngực khai thông tuyến sữa theo yêu cầu); </li>\r\n<li>Xoa bóp toàn thân bằng rượu ngâm gừng, nghệ, thuốc bắc, địa liền hạ thổ;</li>\r\n<li>Ngâm chân và massage chân với thảo mộc giúp lưu thông khí huyết và giảm nhức mỏi;</li>\r\n<li>Xông toàn thân với lá thảo dược tươi;</li>\r\n</ul>\r\n<p style=\"text-align: justify;\">Sau khi trải nghiệm liệu trình, các bạn sẽ cảm thấy thoải mái hơn và sức khỏe được cải thiện tốt hơn để có thể đồng hành cùng con yêu trong những ngày tháng sắp tới.</p>', '', '', '<p>Giá trọn gói 10 ngày - 4.200.000VND (90\'/Ngày)</p>\r\n<p>Giá thành 1 ngày - 550.000VND</p>', '<p>Massage giảm nhức mỏi với tinh dầu thảo mộc thiên nhiên</p>', '<p>Chăm sóc da mặt bằng tinh bột nghệ đen, mật ong</p>', '', 'http://vuongtronspa.com.vn/storage/uploads/2019-05-15/13507105-1340478465969780-1841230215691059342-n-2_size_350x350.jpg', '1', 'publish', null, 'http://vuongtronspa.com.vn/contents/images/defaults/no-image.jpg', '0', '', 'service', '0', '0', '0', '0', '2019-04-09 08:08:00', '2019-04-09 08:16:51', '2019-07-12 02:32:55');
INSERT INTO `posts` VALUES ('35', 'Yêu Thương Trọn Vẹn', 'yeu-thuong-tron-ven', null, '<p style=\"text-align: justify;\">Một liệu trình tuyệt hảo, phục hồi cho phụ sữ sau khi sinh bé được chăm chút tận tình.</p>\r\n<p style=\"text-align: justify;\">Với 14 bước chăm sóc khác nhau kết hợp với dược liệu tự nhiên tốt cho sức khỏe sẽ mang lại cảm giác thoải mái, thư giãn cho cơ thể.</p>\r\n<p><strong>Các bước thực hiện bao gồm: </strong></p>\r\n<ul>\r\n<li>Chăm sóc da mặt bằng bột nghệ đen, mật ong; </li>\r\n<li>Massage kích sữa ( theo yêu cầu ); </li>\r\n<li>Massage cơ thể giảm nhức mỏi bằng tinh dầu thảo mộc thiên nhiên;</li>\r\n<li>Xoa bóp toàn thân bằng rượu gừng, nghệ, thuốc bắc hạ thổ;</li>\r\n<li>Xông vùng kín với thảo dược;</li>\r\n<li>Gội thảo dược nấu (bồ kết, sả, chanh, lá lốt, hương nhu..);</li>\r\n<li>Tẩy thâm nách, bẹn, mông;</li>\r\n<li>Massage giảm thâm và vết rạn vùng bụng;</li>\r\n<li>Chườm ấm bụng co hồi dạ con, giảm vết rạn bằng thảo dược (muối, gừng, ngải cứu); </li>\r\n<li>Đắp mặt nạ bụng bằng thảo dược săn chắc bụng; </li>\r\n<li>Xoa dịu đôi mắt giảm quầng thâm với trà xanh;</li>\r\n<li>Massage chân giảm nhức mỏi và đào thải nước;</li>\r\n<li>Tẩy tế bào chết và đắp ủ nghệ đen toàn thân giúp da trắng sáng và mịn màng;</li>\r\n<li>Xông hơi & tắm thảo dược cổ truyền của người dân tộc Dao;</li>\r\n</ul>\r\n<p style=\"text-align: justify;\">Khi hoàn thành liệu trình, phụ nữ sau sinh sẽ nhận thấy sức khỏe được cải thiện rất nhiều. Bên cạnh đó, vẻ đẹp cơ thể cũng được phục hồi mau chóng, giúp xua tan nỗi lo lắng về vẻ ngoài của bản thân.</p>', '', '', '<p>Giá trọn gói 15 ngày - 8.000.000VND</p>\r\n<p>Giá 1 ngày - 550.000VND</p>\r\n<p> </p>', '<p>Massage cơ thể bằng tinh dầu thảo mộc thiên nhiên</p>', '<p>Chăm sóc da mặt bằng bột nghệ đen, mật ong</p>', '<p>Gội thảo dược nấu (bồ kết, sả, chanh, lá lốt, hương nhu..)</p>', 'http://vuongtronspa.com.vn/storage/uploads/2019-05-02/yeu-thuong-tron-ven-f_size_640x640.jpg', '1', 'publish', null, 'http://vuongtronspa.com.vn/contents/images/defaults/no-image.jpg', '0', '', 'service', '0', '0', '0', '0', '2019-04-09 08:25:00', '2019-04-09 08:31:10', '2019-05-15 10:40:01');
INSERT INTO `posts` VALUES ('36', 'Triệt Lông Vĩnh Viễn', 'triet-long-vinh-vien', null, '<p style=\"text-align: justify;\">Các bạn cảm thấy tự ti và không thoải mái khi lông mọc quá rậm rạp hay mọc những vị trí không thích hợp? Điều đó khiến bạn không tự tin khi khoác lên mình nhưng trang phục mùa hè hay bikini nóng bỏng. Để xua tan đi nỗi lo không đáng có, Vuông Tròn Spa sẽ giúp bạn khôi phục lại sự tự tin để tự do mặc những trang phục mình yêu thích.</p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p style=\"text-align: justify;\">Đến với Vuông Tròn Spa, các bạn sẽ được trải nghiệm công nghệ triệt lông tối tân nhất hiện nay. Công nghệ mới này chắc chắn sẽ làm bạn hài lòng với dịch vụ triệt lông vĩnh viễn mà spa mang lại.</p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p style=\"text-align: justify;\">Những ưu điểm vượt trội:</p>\r\n<ul style=\"list-style-type: disc; text-align: justify;\">\r\n<li>Dàn lạnh được trang bị giúp bảo vệ da</li>\r\n<li>Nhẹ nhàng êm ái, không gây đau rát.</li>\r\n<li>Không gây mẩn đỏ sau điều trị</li>\r\n<li>Da sẽ săn sau khi triệt, trả lại cho bạn một làn da mịn màng, êm ái.</li>\r\n<li>Bảo hành trọn đời miễn phí từ sau lần điều trị thứ 6. Nghĩa là từ lần thứ 7, nếu vùng lông vẫn còn thì spa sẽ miễn phí các lần triệt tiếp theo cho bạn. </li>\r\n</ul>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p style=\"text-align: justify;\">Giá cụ thể cho từng vùng:</p>\r\n<ul style=\"list-style-type: disc; text-align: justify;\">\r\n<li>Mặt: 1.200.000 VNĐ/lần</li>\r\n<li>Mép: 500.000 VNĐ/lần</li>\r\n<li>Nách: 1.000.000 VNĐ/lần</li>\r\n<li>Tay hoặc lưng: 2.000.000 VNĐ/lần</li>\r\n<li>Chân: 3.000.000 VNĐ/lần</li>\r\n<li>Bikini: 2.000.000 VNĐ/lần</li>\r\n<li>Wax Bikini: 1.000.000 VNĐ/lần</li>\r\n</ul>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p style=\"text-align: justify;\"><strong>Ưu đãi đặc biệt: </strong>Đăng ký liệu trình 8-10 lần giảm ngay 15% và bảo hành 10 năm nếu mọc lại.</p>', '', '', '<p>500.000 - 3.000.000VNĐ/Lần</p>\r\n<p> </p>', '<p style=\"text-align: justify;\">Triệt lông vĩnh viễn và được bảo hành trọn đời với công nghệ tối tân nhất tại Vuông Tròn Spa.</p>', '', '', 'http://vuongtronspa.com.vn/storage/uploads/2019-04-17/triet-long-b_size_800x800.jpg', '1', 'publish', null, 'http://vuongtronspa.com.vn/contents/images/defaults/no-image.jpg', '0', '', 'service', '0', '0', '0', '0', '2019-04-09 08:46:00', '2019-04-09 09:14:50', '2019-07-04 07:47:54');
INSERT INTO `posts` VALUES ('37', 'Hạnh Phúc Tròn Đầy 20 ngày', 'hanh-phuc-tron-day-20-ngay', null, '<p>Liệu trình mang lại vẻ đẹp tự tin cho những ai sau khi sinh con với tên gọi <strong>\"Hạnh Phúc Tròn Đầy 20 ngày\"</strong>. Đúng như tên gọi của nó, các bạn sẽ được trải nghiệm liệu trình tuyệt vời, với tất cả các bước được sử dụng hoàn toàn dược liệu từ thiên nhiên an toàn cho sức khỏe.</p>\r\n<p><strong>Các bước được thực hiện trên toàn cơ thể:</strong></p>\r\n<ul>\r\n<li style=\"text-align: justify;\">Chăm sóc da mặt bằng bột nghệ đen hay nghệ trắng trứng gà</li>\r\n<li style=\"text-align: justify;\">Massage kích sữa, thông tắc tuyến sữa</li>\r\n<li style=\"text-align: justify;\">Massage giảm nhức mỏi bằng tinh dầu thảo mộc Organic</li>\r\n<li style=\"text-align: justify;\">Xoa bóp toàn thân bằng rượu gừng, nghệ, thuốc bắc hạ thổ</li>\r\n<li style=\"text-align: justify;\">Xông và vệ sinh vùng kín với thảo dược </li>\r\n<li style=\"text-align: justify;\">Gội đầu thảo dược nấu (bồ kết, sả, chanh...)</li>\r\n<li style=\"text-align: justify;\">Hơ mặt vơi lá trầu và muối nghệ giúp da trắng sáng, hồng hào, săn chắc </li>\r\n<li style=\"text-align: justify;\">Tẩy thâm nách, bẹn, mông</li>\r\n<li style=\"text-align: justify;\">Massage giảm thâm và vết rạn vùng bụng</li>\r\n<li style=\"text-align: justify;\">Chườm ấm bụng co hồi dạ con, giảm vết rạn bằng thảo dược (muối, gừng, ngải cứu)</li>\r\n<li style=\"text-align: justify;\">Đắp nạ bụng, thảo dược săn chắc bụng</li>\r\n<li style=\"text-align: justify;\">Xoa dịu đôi mắt giảm quầng thâm với trà xanh Organic</li>\r\n<li style=\"text-align: justify;\">Ngâm chân thảo mộc giúp lưu thông khí huyết</li>\r\n<li style=\"text-align: justify;\">Massage chân giảm nhức mỏi và đào thải nước</li>\r\n<li style=\"text-align: justify;\">Tẩy tế bào chết và đắp ủ nghệ đen toàn thân giúp da trắng sáng và mịn màng</li>\r\n<li style=\"text-align: justify;\">Xông hơi và tắm thảo dược cổ truyền của người dân tộc Dao Đỏ</li>\r\n</ul>\r\n<p style=\"text-align: justify;\">Sau khi kết thúc liệu trình, các bạn cảm nhận thay đổi bất ngờ về cơ thể và sức khỏe của mình. Vẻ đẹp vẫn trường tồn theo thời gian nếu chúng ta chịu đầu tư chăm sóc bản thân nhiều hơn.</p>', '', '', '<p>20 ngày - 13.000.000VND (120\'/ngày)</p>\r\n<p>1 ngày - 780.000VND</p>\r\n<p> </p>', '<p>Massage toàn thân bằng tinh dầu thảo mộc Organic</p>', '<p>Chăm sóc da mặt bằng bột nghệ đen hay nghệ trắng trứng gà</p>', '<p>Gội đầu thảo dược nấu (bồ kết, sả, chanh...)</p>', 'http://vuongtronspa.com.vn/storage/uploads/2019-05-02/viber-image-2019-05-02-112216_size_800x800.jpg', '1', 'publish', null, 'http://vuongtronspa.com.vn/contents/images/defaults/no-image.jpg', '0', '', 'service', '0', '0', '0', '0', '2019-04-09 16:55:00', '2019-04-09 17:00:52', '2019-06-05 08:46:25');
INSERT INTO `posts` VALUES ('38', 'Hạnh Phúc Tròn Đầy 15 ngày', 'hanh-phuc-tron-day-15-ngay', 'Liệu trình \"Hạnh Phúc Tròn Đầy 15 ngày\" sẽ giúp các bạn phục hồi cơ thể và sức khỏe sau khi sinh. Sử dụng dược liệu hoàn toàn từ thiên nhiên kết hợp với nhiều phương pháp khác nhau mang lại những trải nghiệm hoàn hảo cho bạn.', '<p style=\"text-align: justify;\">Liệu trình \"Hạnh Phúc Tròn Đầy 15 ngày\" sẽ giúp các bạn phục hồi cơ thể và sức khỏe sau khi sinh. Sử dụng dược liệu hoàn toàn từ thiên nhiên kết hợp với nhiều phương pháp khác nhau mang lại những trải nghiệm hoàn hảo cho bạn.</p>\r\n<p><strong>Liệu trình bao gồm 17 bước:</strong></p>\r\n<ul>\r\n<li>Chăm sóc da mặt bằng bột nghệ đen hay nghệ trắng trứng gà</li>\r\n<li>Massage kích sữa, thông tắc tuyến sữa </li>\r\n<li>Massage giảm nhức mỏi bằng tinh dầu thảo mộc Organic</li>\r\n<li>Xoa bóp toàn thân bằng rượu gừng, nghệ, thuốc bắc hạ thổ </li>\r\n<li>Xông và vệ sinh vùng kín với thảo dược</li>\r\n<li>Gội đầu thảo dược nấu (bồ kết, sả, chanh...)</li>\r\n<li>Hơ mặt với lá trầu và muối nghệ giúp da trắng sáng, hồng hào, săn chắc </li>\r\n<li>Tẩy thâm nách, bẹn, mông</li>\r\n<li>Massage giảm thâm và vết rạn vùng bụng </li>\r\n<li>Chườm ấm bụng co hồi dạ con, giảm vết rạn bằng thảo dược (muối, gừng, ngải cứu)</li>\r\n<li>Đắp nạ bụng, thảo dược săn chắc bụng </li>\r\n<li>Xoa dịu đôi mắt giảm quầng thâm với trà xanh Organic</li>\r\n<li>Ngâm chân thảo mộc giúp lưu thông khí huyết</li>\r\n<li>Massage chân giảm nhức mỏi và đào thải nước</li>\r\n<li>Tẩy tế bào chết và đắp ủ nghệ đen toàn thân giúp da trắng sáng và mịn màng </li>\r\n<li>Xông hơi và tắm thảo dược cổ truyền của người dân tộc Dao</li>\r\n</ul>\r\n<p>Hiệu quả của liệu trình sẽ mang lại sự thay đổi từng ngày đồng thời mang lại vẻ đẹp vốn có và sức khỏe tốt.</p>', '', '', '<p>15 ngày - 9.800.000VND (120\'/ngày)</p>\r\n<p>1 ngày - 780.000VND</p>\r\n<p> </p>', '<p>Massage toàn thân bằng tinh dầu thảo mộc Organic</p>', '<p>Chăm sóc da mặt bằng bột nghệ đen hay nghệ trắng trứng gà</p>', '<p>Gội đầu thảo dược nấu (bồ kết, sả, chanh...)</p>', 'http://vuongtronspa.com.vn/storage/uploads/2020-02-12/qp9a3489_size_6292x3876.JPG', '1', 'publish', null, 'http://vuongtronspa.com.vn/storage/uploads/2020-02-12/qp9a3479-2_size_6720x4480.JPG', '0', '', 'service', '0', '0', '0', '0', '2019-04-09 17:00:00', '2019-04-09 17:09:22', '2020-02-12 08:04:47');
INSERT INTO `posts` VALUES ('39', 'Thắt Đáy Lưng Ong', 'that-day-lung-ong', null, '<p style=\"text-align: justify;\">Sau khi sinh, phụ nữ chúng ta thường hay lo sợ sẽ trở nên xấu đi, tăng cân làm tích tụ mỡ thừa ở bắp tay, đùi và đặc biệt là số đo vòng eo lớn hơn rất nhiều. Hiểu được nỗi lo của các bạn, Vuông Tròn Spa sẽ giúp các  bạn giảm được số đo và lấy lại được vóc dáng sau sinh nhanh chóng hơn mà không gây ra mệt mỏi, khi lựa chọn liệu trình <strong>\"Thắt Đáy Lưng Ong\"</strong>.</p>\r\n<p><strong>Quy trình làm thon gọn gồm các bước:</strong></p>\r\n<ul>\r\n<li style=\"text-align: justify;\">Bước 1: Lau sạch và làm nóng vùng bụng, eo, đùi với rượu gừng, nghệ đen, thuốc bắc, địa liền...hạ thổ.</li>\r\n<li style=\"text-align: justify;\">Bước 2: Thủy liệu pháp giúp đốt cháy mỡ thừa, làm săn chắc cơ bụng, eo, đùi, bắp tay.</li>\r\n<li style=\"text-align: justify;\">Bước 3: Massage làm thon gọn bụng, eo, đùi</li>\r\n<li style=\"text-align: justify;\">Bước 4: Quấn nóng giúp tan mô mỡ</li>\r\n</ul>\r\n<p style=\"text-align: justify;\">Với đội ngũ chuyên viên có nhiều năm kinh nghiệm và trình độ chuyên sâu của Vuông Tròn Spa, bạn sẽ lấy lại được số đo mà bạn mong muốn trong thời gian ngắn nhất.</p>', '', '', '<p>15 ngày - 9.450.000VND (90\'/Ngày)</p>\r\n<p>1 ngày - 680.000VND</p>', '<p style=\"text-align: justify;\">Massage làm thon gọn bụng, eo hoặc đùi nhằm giảm số đo các vòng, giúp bạn lấy lại được vóc dáng chuẩn sau sinh nhanh chóng mà không gây mệt mỏi, đau nhức</p>', '', '', 'http://vuongtronspa.com.vn/storage/uploads/2019-05-15/12705711-734090180061447-416346890743494469-n-2_size_802x802.jpg', '1', 'publish', null, 'http://vuongtronspa.com.vn/contents/images/defaults/no-image.jpg', '0', '', 'service', '0', '0', '0', '0', '2019-04-09 18:29:00', '2019-04-09 18:42:47', '2019-07-12 02:33:30');
INSERT INTO `posts` VALUES ('40', 'Nâng Cơ Không Phẫu Thuật', 'nang-co-khong-phau-thuat', null, '<p style=\"text-align: justify;\">Sử dụng công nghệ laser chuyên sâu được nhập khẩu trực tiếp từ Thụy Điển. Công nghệ này nhằm tác động lên bề mặt da, giúp làn da căng mịn, phục hồi các tế bào hư tổn và tái tạo nhanh chóng. Điều trị da công nghệ cao phù hợp với những làn da mất độ đàn hồi, bị chùng nhão hay có nếp nhăn trên mặt.</p>\r\n<p style=\"text-align: justify;\">Liệu trình vô cùng an toàn và hiệu quả với những ưu điểm:</p>\r\n<ul style=\"list-style-type: disc; text-align: justify;\">\r\n<li>Không xâm lấn phẩu thuật</li>\r\n<li>Không sưng đau hay để lại biến chứng</li>\r\n<li>Không cần thời gian nghỉ dưỡng</li>\r\n</ul>\r\n<p style=\"text-align: justify;\">Tại Vuông Tròn Spa, các bạn sẽ được các chuyên gia tư vấn và hướng dẫn cụ thể, để mang lại cho bạn một làn da tươi trẻ và tràn đầy sức sống.</p>', '', '', '<p>1 lần - 20.000.000VND</p>', '<p style=\"text-align: justify;\">Sử dụng công nghệ laser chuyên sâu được nhập khẩu trực tiếp từ Thụy Điển. Công nghệ này nhằm tác động lên bề mặt da, giúp làn da căng mịn, phục hồi các tế bào hư tổn và tái tạo nhanh chóng. Điều trị da công nghệ cao phù hợp với những làn da mất độ đàn hồi, bị chùng nhão hay có nếp nhăn trên mặt.</p>', '', '', 'http://vuongtronspa.com.vn/storage/uploads/2019-05-15/dscf3284_size_850x779.jpg', '1', 'publish', null, 'http://vuongtronspa.com.vn/contents/images/defaults/no-image.jpg', '0', '', 'service', '0', '0', '0', '0', '2019-04-09 19:02:00', '2019-04-09 19:05:54', '2019-07-12 02:33:52');
INSERT INTO `posts` VALUES ('41', 'Điều Trị Rạn Da - Săn Chắc Bụng', 'dieu-tri-ran-da-san-chac-bung', null, '<p style=\"text-align: justify;\">Đối với phụ nữ mang thai, rạn da luôn là nỗi lo lắng hàng đầu. Vì khi mang thai, da bị căng dãn tới mức quá đà làm đứt gãy các sợi collagen, sau khi sinh các vết rạn giảm dần thành màu trắng hoặc xám. Tuy nhiên, bạn không cần phải lo lắng về vấn đề đó khi đến với Vuông Tròn Spa.</p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p style=\"text-align: justify;\">Vuông Tròn Spa sử dụng công nghệ laser hiện đại được nhập khẩu trực tiếp từ Thụy Điển, các bạn sẽ được chữa rạn da mà không cần đến phẩu thuật. Công nghệ này phù hợp với tất cả loại da, giúp tác động tới các mạch máu tạo nên vết tím đỏ dưới da, làm chúng tan đi một cách nhẹ nhàng, và các vết rạn trên da sẽ dần biến mất.</p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p style=\"text-align: justify;\">Bên cạnh đó, công nghệ laser còn tác động và đốt các tế bào mỡ dưới da mà không gây hại hay ảnh hưởng đến bề mặt da, giúp vùng bụng trở nên săn chắc hơn.</p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p style=\"text-align: justify;\">Các ưu điểm khi sử dụng công nghê laser:</p>\r\n<ul style=\"list-style-type: disc; text-align: justify;\">\r\n<li>Không phẩu thuật xâm lấn</li>\r\n<li>Độ an toàn và hiệu quả cao</li>\r\n<li>Tiết kiệm thời gian</li>\r\n</ul>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p style=\"text-align: justify;\">Khi chọn lựa dịch vụ \"Điều Trị Rạn Da - Săn Chắc Da\" này, các bạn sẽ được chuyên gia hướng dẫn và tư vấn tận tình.</p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p style=\"text-align: justify;\">Giá cụ thể từng dịch vụ:</p>\r\n<ul style=\"list-style-type: disc;\">\r\n<li style=\"text-align: justify;\">Giá lẻ điều trị rạn da: 20.000.000 VND/Lần</li>\r\n<li style=\"text-align: justify;\">Giá gói 8 lần: 160.000.000VND</li>\r\n<li style=\"text-align: justify;\">Săn chắc da: 2.000.000VND/Lần</li>\r\n</ul>', '', '', '<p>2.000.000 - 20.000.000/Lần</p>', '<p style=\"text-align: justify;\">Vuông Tròn Spa sử dụng công nghệ laser hiện đại được nhập khẩu trực tiếp từ Thụy Điển, các bạn sẽ được chữa rạn da mà không cần đến phẩu thuật. Công nghệ này phù hợp với tất cả loại da, giúp tác động tới các mạch máu tạo nên vết tím đỏ dưới da, làm chúng tan đi một cách nhẹ nhàng, và các vết rạn trên da sẽ dần biến mất.</p>', '', '', 'http://vuongtronspa.com.vn/storage/uploads/2019-05-15/dscf3290_size_865x793.jpg', '1', 'publish', null, 'http://vuongtronspa.com.vn/contents/images/defaults/no-image.jpg', '0', '', 'service', '0', '0', '0', '0', '2019-04-09 19:06:00', '2019-04-09 19:25:39', '2019-07-12 02:34:32');
INSERT INTO `posts` VALUES ('42', 'Điều Trị Chỉ Máu', 'dieu-tri-chi-mau', null, '<p style=\"text-align: justify;\">Chỉ máu xuất hiện dưới da do nhiều nguyên nhân gây ra và thường khó xác định nguyên nhân cho tình trạng này. Nếu duy trì quá lâu, sẽ dẫn đến những biến chứng khác nặng nề hơn. Tuy nhiên, tại Vuông Tròn Spa, các bạn không còn phải lo lắng về chỉ máu dưới da vì đã có công nghệ tiên tiến giúp bạn trị các tĩnh mạch đó.</p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p style=\"text-align: justify;\">Công nghệ laser được Vuông Tròn Spa nhập khẩu trực tiếp từ Thụy Điển. Trong quá trình điều trị, laser sẽ nhắm đến những mạch máu gây nên tình trạng trên. Những mạch máu hấp thu năng lượng laser được những sẽ bị phân hủy và dần co lại. Bạn sẽ thấy ngay kết quả sau lần trị đầu tiên nhưng để thấy được hiệu quả tối ưu cần phải thực hiện thêm vài lần trị liệu chuyên sâu. </p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p style=\"text-align: justify;\">Các ưu điểm khi lựa chọn công nghệ laser:</p>\r\n<ul style=\"list-style-type: disc; text-align: justify;\">\r\n<li>Không gây đau</li>\r\n<li>Không phẫu thuật xâm lấn</li>\r\n<li>Độ an toàn cao</li>\r\n<li>Chữa trị nhanh chóng</li>\r\n<li>Không tốn thời gian nghỉ dưỡng</li>\r\n</ul>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p style=\"text-align: justify;\">Cùng với đội ngũ chuyên viên của Vuông Tròn Spa, các bạn sẽ được hướng dẫn tận tình, tư vấn và giải đáp mọi thắc mắc.</p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p style=\"text-align: justify;\">Giá cụ thể dịch vụ:</p>\r\n<ul style=\"list-style-type: disc;\">\r\n<li style=\"text-align: justify;\">Giá lẻ: 2.000.000VND/Lần</li>\r\n<li style=\"text-align: justify;\">Giá gói 6 lần: 12.000.000VND giàm 15% còn 10.200.000VND</li>\r\n</ul>', '', '', '<p>1 lần - 2.000.000VND</p>', '<p style=\"text-align: justify;\">Công nghệ laser được Vuông Tròn Spa nhập khẩu trực tiếp từ Thụy Điển. Trong quá trình điều trị, laser sẽ nhắm đến những mạch máu gây nên tình trạng trên. Những mạch máu hấp thu năng lượng laser được những sẽ bị phân hủy và dần co lại.</p>', '', '', 'http://vuongtronspa.com.vn/storage/uploads/2019-05-15/triet-long-2_size_860x788.jpg', '1', 'publish', null, 'http://vuongtronspa.com.vn/contents/images/defaults/no-image.jpg', '0', '', 'service', '0', '0', '0', '0', '2019-04-09 19:25:00', '2019-04-09 19:42:21', '2019-07-12 02:33:58');
INSERT INTO `posts` VALUES ('44', 'Tẩy Ủ Cám Gạo Đỏ Nhật Bản, Nghệ Đen, Mật Ong', 'tay-u-cam-gao-do-nhat-ban-nghe-den-mat-ong', null, '<p><strong>Tẩy Ủ Cám gạo đỏ Nhật Bản, nghệ đen, mật ong</strong> là một liệu trình được các chị em phụ nữ tin dùng vì chất lượng cũng như hiệu quả nhanh chóng do phương pháp này mang lại.</p>\r\n<p>Tẩy tế bào chết giúp da bạn tươi sáng, rạng rỡ hơn và kích thích quá trình tuần hoàn, tái tạo collagen, xóa mờ các vết thâm, xỉn màu, làm tăng hiệu quả của quá trình dưỡng da, giúp các dưỡng chất thấm sâu vào da. Khách hàng sẽ được lựa chọn tẩy tế bào chết với một trong hai thành phần cao cấp của Vuông Tròn Spa:</p>\r\n<ul>\r\n<li>Cám gạo đỏ Nhật Bản giàu vitamin và dưỡng chất, giúp lấy đi các tế bào chết và để lại làn da tươi sáng. Phù hợp với mọi loại da.</li>\r\n<li>Muối hồng Himalaya giàu khoáng chất, có tác dụng giúp da sạch, trắng sáng mịn màng và đặc biệt tốt cho da dầu nhiều mụn.</li>\r\n</ul>\r\n<p>Cơ thể sẽ được ủ dưỡng với kem dưỡng Cám gạo đỏ Nhật Bản, nghệ đen và mật ong. Đây là một công thức tuyệt vời giữa các nguyên liệu thiên nhiên giúp làn da của người phụ nữ trở nên sáng da, mờ các vết thâm do mụn gây nên, các vết nám dính sâu vào da. Ngoài ra, khi sử dụng liệu trình Tẩy ủ Cám gạo đỏ Nhật Bản, nghệ đen, mật ong còn giúp hạn chế mụn, bảo vệ làn da và chống lão hóa.</p>\r\n<p><strong>Quy trình Tẩy ủ với Cám gạo đỏ Nhật Bản:</strong></p>\r\n<ul>\r\n<li>Bước 1: Vệ sinh da, làm sạch toàn thân.</li>\r\n<li>Bước 2: Tẩy tế bào chết cho da bằng Cám gạo đỏ Nhật Bản hoặc Muối hồng Himalaya.</li>\r\n<li>Bước 3: Thoa đều và ủ toàn thân với hỗn hợp Cám gạo đỏ Nhật Bản, nghệ đen và mật ong.</li>\r\n<li>Bước 4: Vệ sinh, chăm sóc da bằng nước ấm.</li>\r\n</ul>', '', '', '<p>60\' - 430.000VNĐ</p>', '<p style=\"text-align: justify;\">Tẩy tế bào chết bằng Cám gạo đỏ Nhật Bản hoặc Muối hồng Himalaya giúp da bạn tươi sáng, rạng rỡ hơn và kích thích quá trình tuần hoàn, tái tạo collagen, xóa mờ các vết thâm, xỉn màu,...</p>', '', '<p style=\"text-align: justify;\">Ủ toàn thân bằng hỗn hợp Cám gạo đỏ Nhật Bản, Nghệ đen, Mật ong giúp làn da của người phụ nữ trở nên sáng da, mờ các vết thâm do mụn gây nên, các vết nám dính sâu vào da, hạn chế mụn và chống lão hóa.</p>', 'http://vuongtronspa.com.vn/storage/uploads/2019-05-07/cam-gao-4_size_3610x3264.jpg', '1', 'publish', null, 'http://vuongtronspa.com.vn/contents/images/defaults/no-image.jpg', '0', '', 'service', '0', '0', '0', '0', '2019-04-10 01:14:00', '2019-04-10 01:16:11', '2019-07-08 09:05:52');
INSERT INTO `posts` VALUES ('45', 'Tẩy Ủ Tinh Chất Sen', 'tay-u-tinh-chat-sen', null, '<p style=\"text-align: justify;\"><strong>Tẩy ủ với tinh chất sen</strong> là liệu trình chăm sóc da độc đáo với sự kết hợp giữa khoa học và những nguyên liệu thiên nhiên cao cấp.</p>\r\n<p style=\"text-align: justify;\"><br />Tẩy tế bào chết giúp da bạn tươi sáng, rạng rỡ hơn và kích thích quá trình tuần hoàn, tái tạo collagen, xóa mờ các vết thâm, xỉn màu, làm tăng hiệu quả của quá trình dưỡng da, giúp các dưỡng chất thấm sâu vào da. Khách hàng sẽ được lựa chọn tẩy tế bào chết với một trong hai thành phần cao cấp của Vuông Tròn Spa:</p>\r\n<ul>\r\n<li style=\"text-align: justify;\">Cám gạo đỏ Nhật Bản giàu vitamin và dưỡng chất, giúp lấy đi các tế bào chết và để lại làn da tươi sáng. Phù hợp với mọi loại da.</li>\r\n<li style=\"text-align: justify;\">Muối hồng Himalaya giàu khoáng chất, có tác dụng giúp da sạch, trắng sáng mịn màng và đặc biệt tốt cho da dầu nhiều mụn.</li>\r\n</ul>\r\n<p style=\"text-align: justify;\">Cơ thể sẽ được ủ dưỡng với kem dưỡng Tinh dầu sen giúp da trở nên hồng hào hiệu quả hơn bất kỳ kem dưỡng nào. Tinh dầu sen có chứa enzyma L-isoaspartyl methyltran, có tác dụng phục hồi những thương tổn của làn da, tái tạo tế bào từ đó giúp làn da trở nên khỏe và bền vững.</p>\r\n<p> </p>\r\n<p><strong>Quy trình Tẩy ủ với Tinh chất sen</strong>:</p>\r\n<ul>\r\n<li>Bước 1: Vệ sinh da, làm sạch toàn thân.</li>\r\n<li>Bước 2: Tẩy tế bào chết cho da bằng Cám gạo đỏ Nhật Bản hoặc Muối hồng Himalaya.</li>\r\n<li>Bước 3: Thoa đều và ủ toàn thân với Tinh chất Sen.</li>\r\n<li>Bước 4: Vệ sinh, chăm sóc da bằng nước ấm.</li>\r\n</ul>', '', '', '<p>60\' - 430.000VNĐ</p>', '<p style=\"text-align: justify;\">Tẩy tế bào chết bằng Cám gạo đỏ Nhật Bản hoặc Muối hồng Himalaya giúp da bạn tươi sáng, rạng rỡ hơn và kích thích quá trình tuần hoàn, tái tạo collagen, xóa mờ các vết thâm, xỉn màu,...</p>', '', '<p style=\"text-align: justify;\">Ủ toàn thân bằng Tinh chất Sen nhằm phục hồi những thương tổn của làn da, tái tạo tế bào từ đó giúp làn da trở nên khỏe, hồng hào và bền vững</p>', 'http://vuongtronspa.com.vn/storage/uploads/2019-05-15/11659424-647248305412302-3693004568663225218-n_size_470x431.jpg', '1', 'publish', null, 'http://vuongtronspa.com.vn/contents/images/defaults/no-image.jpg', '0', '', 'service', '0', '0', '0', '0', '2019-04-10 01:17:00', '2019-04-10 01:19:25', '2019-07-12 02:33:22');
INSERT INTO `posts` VALUES ('46', 'Tẩy Ủ Trà Xanh Organic', 'tay-u-tra-xanh-organic', null, '<p style=\"text-align: justify;\"><strong>Tẩy Ủ Trà xanh Organic</strong> là một liệu trình rất hiệu quả với làn da của chị em phụ nữ. Với tinh chất đặc biệt có trong Trà xanh là Tannin, thành phần này đã tạo thành một lớp bảo vệ trên da, chống lại các tia UV gây hại da, giúp phục hồi tế bào da bị hỏng, thúc đẩy quá trình tái tạo tế bào da mới và giữ cho da căng bóng, săn chắc.</p>\r\n<p><strong>Liệu trình của Vuông Tròn Spa sẽ gồm hai bước chính: Tẩy tế bào chết và Ủ toàn thân.</strong></p>\r\n<p style=\"text-align: justify;\">Tẩy tế bào chết giúp da bạn tươi sáng, rạng rỡ hơn và kích thích quá trình tuần hoàn, tái tạo collagen, xóa mờ các vết thâm, xỉn màu, làm tăng hiệu quả của quá trình dưỡng da, giúp các dưỡng chất thấm sâu vào da. Khách hàng sẽ được lựa chọn tẩy tế bào chết với một trong hai thành phần cao cấp của Vuông Tròn Spa:</p>\r\n<ul>\r\n<li style=\"text-align: justify;\">Cám gạo đỏ Nhật Bản giàu vitamin và dưỡng chất, giúp lấy đi các tế bào chết và để lại làn da tươi sáng. Phù hợp với mọi loại da.</li>\r\n<li style=\"text-align: justify;\">Muối hồng Himalaya giàu khoáng chất, có tác dụng giúp da sạch, trắng sáng mịn màng và đặc biệt tốt cho da dầu nhiều mụn.</li>\r\n</ul>\r\n<p>Cơ thể sẽ được ủ dưỡng với kem dưỡng Trà xanh Organic.</p>\r\n<p><strong>Quy trình Tẩy ủ với Trà xanh Organic:</strong></p>\r\n<ul>\r\n<li>Bước 1: Vệ sinh da, làm sạch toàn thân.</li>\r\n<li>Bước 2: Tẩy tế bào chết cho da bằng Cám gạo đỏ Nhật Bản hoặc Muối hồng Himalaya.</li>\r\n<li>Bước 3: Thoa đều và ủ toàn thân với Trà xanh Organic.</li>\r\n<li>Bước 4: Vệ sinh, chăm sóc da bằng nước ấm.</li>\r\n</ul>', '', '', '<p>60\' - 460.000VNĐ</p>', '<p style=\"text-align: justify;\">Tẩy tế bào chết bằng Cám gạo đỏ Nhật Bản hoặc Muối hồng Himalaya giúp da bạn tươi sáng, rạng rỡ hơn và kích thích quá trình tuần hoàn, tái tạo collagen, xóa mờ các vết thâm, xỉn màu,...</p>', '', '<p style=\"text-align: justify;\">Ủ toàn thân bằng Trà xanh Organic bảo vệ trên da, chống lại các tia UV gây hại da, giúp phục hồi tế bào da bị hỏng, thúc đẩy quá trình tái tạo tế bào da mới và giữ cho da căng bóng, săn chắc.</p>', 'http://vuongtronspa.com.vn/storage/uploads/2019-04-17/tra-xanh_size_800x800.JPG', '1', 'publish', null, 'http://vuongtronspa.com.vn/contents/images/defaults/no-image.jpg', '0', '', 'service', '0', '0', '0', '0', '2019-04-10 01:29:00', '2019-04-10 01:31:42', '2019-07-12 02:31:42');
INSERT INTO `posts` VALUES ('47', 'Tẩy Ủ Đất Sét Xanh Pháp, Yến Mạch Organic và Mật Ong', 'tay-u-dat-set-xanh-phap-yen-mach-organic-va-mat-ong', null, '<p><strong>Tẩy ủ đất sét xanh Pháp, Yến mạch Organic và mật ong</strong> là một liệu trình luôn được các bạn khách hàng của Vuông Tròn Spa tin dùng để xoa dịu làn da, loại bỏ vi khuẩn nhanh hơn, làm sạch, thông thoáng các lỗ chân lông, trả lại sức sống mới cho làn da của bạn.</p>\r\n<p><strong>Liệu trình của Vuông Tròn Spa sẽ gồm hai bước chính</strong>: Tẩy tế bào chết và Ủ toàn thân.</p>\r\n<p>Tẩy tế bào chết giúp da bạn tươi sáng, rạng rỡ hơn và kích thích quá trình tuần hoàn, tái tạo collagen, xóa mờ các vết thâm, xỉn màu, làm tăng hiệu quả của quá trình dưỡng da, giúp các dưỡng chất thấm sâu vào da. Khách hàng sẽ được lựa chọn tẩy tế bào chết với một trong hai thành phần cao cấp của Vuông Tròn Spa:</p>\r\n<ul>\r\n<li>Cám gạo đỏ Nhật Bản giàu vitamin và dưỡng chất, giúp lấy đi các tế bào chết và để lại làn da tươi sáng. Phù hợp với mọi loại da.</li>\r\n<li>Muối hồng Himalaya giàu khoáng chất, có tác dụng giúp da sạch, trắng sáng mịn màng và đặc biệt tốt cho da dầu nhiều mụn.</li>\r\n</ul>\r\n<p>Cơ thể sẽ được ủ dưỡng với kem dưỡng hỗn hợp Đất sét xanh Pháp, Yến mạch Organic và mật ong</p>\r\n<p><strong>Quy trình Tẩy ủ với Đất sét xanh Pháp:</strong></p>\r\n<ul>\r\n<li>Bước 1: Vệ sinh da, làm sạch toàn thân.</li>\r\n<li>Bước 2: Tẩy tế bào chết cho da bằng Cám gạo đỏ Nhật Bản hoặc Muối hồng Himalaya.</li>\r\n<li>Bước 3: Thoa đều và ủ toàn thân với hỗn hợp Đất sét xanh Pháp, Yến mạch Organic và mật ong.</li>\r\n<li>Bước 4: Vệ sinh, chăm sóc da bằng nước ấm.</li>\r\n</ul>', '', '', '<p>60\' - 650.000VNĐ</p>', '<p style=\"text-align: justify;\">Tẩy tế bào chết bằng Cám gạo đỏ Nhật Bản hoặc Muối hồng Himalaya giúp da bạn tươi sáng, rạng rỡ hơn và kích thích quá trình tuần hoàn, tái tạo collagen, xóa mờ các vết thâm, xỉn màu,...</p>', '', '<p style=\"text-align: justify;\">Ủ toàn thân bằng hỗn hợp Đất sét xanh Pháp, Yến mạch Organic và mật ong nhằm xoa dịu làn da, loại bỏ vi khuẩn nhanh hơn, làm sạch, thông thoáng các lỗ chân lông</p>', 'http://vuongtronspa.com.vn/storage/uploads/2019-05-05/dat-set-xanh-f_size_365x330.jpg', '1', 'publish', null, 'http://vuongtronspa.com.vn/storage/uploads/2019-05-05/dat-set-xanh-f_size_365x330.jpg', '0', '', 'service', '0', '0', '0', '0', '2019-04-10 01:36:00', '2019-04-10 01:38:41', '2019-07-08 09:05:23');
INSERT INTO `posts` VALUES ('48', 'Điều Trị Da Chuyên Sâu', 'dieu-tri-da-chuyen-sau', null, '<p style=\"text-align: justify;\">Sống tại đất nước nhiệt đới như Việt Nam, khiến làn da của bạn bị tổn hại khi luôn phải tiếp xúc trực tiếp với ánh nắng gay gắt và độ ẩm. Bên cạnh đó, ô nhiễm môi trường khói bụi càng làm da bị tổn thương nhiều hơn. Ngoài ra, còn những tác nhân do nội tiết tố, tuổi tác, phụ nữ sau sinh, chế độ ăn uống không hợp lý, thức khuya, làm việc quá căng thẳng cũng làm da bạn trở nên xấu đi. </p>\r\n<p style=\"text-align: justify;\">Kể cả nam và nữ, nếu không loại bỏ được các nguyên nhân đó sẽ dẫn đến các vấn đề về da như: da trở nên sạm đi, lỗ chân lông to, mụn, nám, tàn nhang,... . Hiểu được nỗi lo của bạn, Vuông Tròn Spa mang đến dịch vụ chăm sóc da bằng công nghệ laser được nhập khẩu trực tiếp từ Thụy Điển. Đây là phương pháp an toàn và mang lại hiệu quả tốt nhất, mà không cần phẫu thuật xâm lấn hay tốn thời gian nghỉ dưỡng.</p>\r\n<p> </p>\r\n<p><strong>Các vấn đề da có thể chữa trị bằng công nghệ laser:</strong></p>\r\n<ul style=\"list-style-type: circle;\">\r\n<li>Rạn nứt sau sinh (Stretch mark after giving birth)</li>\r\n<li>Da bị chảy xệ (Sagging skin)</li>\r\n<li>Da mụn, nám, nhạy cảm… (Skin with acne, pigmented, sensitive ...)</li>\r\n<li>Căng da mặt mà không cần phẫu thuật hay điều dưỡng (Facial lifting without surgery or nursing)</li>\r\n<li>Nếp nhăn sâu (Deep wrinkles)</li>\r\n<li>Sẹo do mụn và sẹo do phẫu .thuật (Acne scars and surgical scars)</li>\r\n<li>Lỗ chân lông to (Big pores)</li>\r\n<li>Da không đều màu (Skin is unevenly colored)</li>\r\n</ul>\r\n<p>* Giá lẻ cho một lần điều trị: 10.000.000VND</p>', '', '', '<p>1 lần - 10.000.000VND</p>', '<p>Dịch vụ chăm sóc da bằng công nghệ laser được nhập khẩu trực tiếp từ Thụy, mang lại hiệu quả tốt nhất, an toàn mà không cần phẫu thuật xâm lấn hay tốn thời gian nghỉ dưỡng.</p>', '<p>Phù hợp điều trị các vấn đề rạn nứt sau sinh, chảy xệ, nếp nhăn sâu, sẹo do da mụn, nám,...</p>', '', 'http://vuongtronspa.com.vn/storage/uploads/2019-04-17/dieu-tri-chuyen-sau-final_size_800x800.jpg', '1', 'publish', null, null, '0', '', 'service', '0', '0', '0', '0', '2019-04-10 03:40:00', '2019-04-10 04:25:29', '2019-04-18 12:52:21');
INSERT INTO `posts` VALUES ('49', 'Tinh Dầu Tràm - 10ml', 'tinh-dau-tram-10ml', null, '', '<p> </p>\r\n<ul style=\"list-style-type: circle;\">\r\n<li>Phòng ngừa cảm mạo, trúng gió.</li>\r\n<li>Tạo hương thơm dễ chịu lại vừa sát khuẩn, ức chế virus, đặc biệt đang trong mùa cao điểm sốt, cúm.</li>\r\n<li>Có khả năng chống khuẩn, nấm và khử trùng, tinh dầu tràm là liệu pháp chăm sóc và làm đẹp cơ thể an toàn.</li>\r\n<li>Điều trị các bệnh về da do vi khuẩn hay nấm gây nên như mụn trứng cá, mụn mủ, da nhờn, phồng rộp, mụn cóc, …</li>\r\n<li>Trị nhiễm nấm ở bàn chân, chứng hôi chân, nhiễm trùng móng và đau chân.</li>\r\n<li>Dầu tràm có mùi thơm không quá nồng, xoa vào vết bầm tím hay chỗ nhức mỏi vài phút sẽ khỏi.</li>\r\n</ul>\r\n<p> </p>\r\n<p> </p>', '<ul style=\"list-style-type: square;\">\r\n<li style=\"text-align: justify;\"><strong>D</strong><strong>ùng chống cảm lạnh, tránh gió và tránh ho:</strong></li>\r\n</ul>\r\n<p style=\"text-align: justify;\">Cho khoảng 5 giọt Tinh dầu tràm vào nước tắm của bé. Nhớ rửa mặt riêng để tránh dầu vào mắt bé. Bé tắm nước có tinh dầu tràm sẽ giữ được cơ thể ấm áp, chống cảm, chống ho đồng thời chống cả muỗi (muỗi rất sợ dầu tràm).</p>\r\n<p style=\"text-align: justify;\">Khi bé bị ho hãy dùng dầu tràm xoa lên tay sau đó dùng tay xoa lên lưng, ngực và cổ của bé sẽ giúp các nhóc đỡ ho, nếu bé ngạt mũi đừng xoa dầu tràm trực tiếp lên mũi hãy quàng cho bé một chiếc khăn để giữ ấm cổ và xức dầu tràm lên khăn. Điều này cũng có thể sử dụng để tránh gió cho bé trước khi đi ra ngoài.</p>\r\n<p style=\"text-align: justify;\">Khi bé bị ho nhiều về nửa đêm và sáng bạn có thể sử dụng dầu tràm để massage lòng bàn chân và day nhẹ vào huyệt Dũng tuyền (chỗ lõm ở giữa 1/3 lòng bàn chân về phía ngón) trong vòng 2-3 phút, sau đó đi tất mỏng vào để giữ ấm chân. Cách này cũng hiệu quả đối với người lớn.</p>\r\n<ul style=\"list-style-type: square; text-align: justify;\">\r\n<li><strong>B</strong><strong>ôi các vết thương do côn trùng cắn: </strong>Khi côn trùng như kiến, muỗi … cắn chúng ta có thể xoa dầu tràm lên vết cắn sau 2-3 phút là vết cắn sẽ hết đỏ.</li>\r\n</ul>\r\n<ul style=\"list-style-type: square;\">\r\n<li style=\"text-align: justify;\"><strong>C</strong><strong>hữa đầy hơi, đau bụng do khó tiêu hóa: </strong>Khi trẻ có triệu chứng đầy hơi ở bụng do khó tiêu hóa, bố mẹ có thể nhỏ 2-3 giọt dầu tràm ra tay và thoa đều lên bụng, việc này sẽ giúp làm nóng bụng tống hơi ra ngoài giúp bé dễ chịu hơn.</li>\r\n</ul>', '', '', '', '', 'http://vuongtronspa.com.vn/storage/uploads/2019-05-12/tinh-dau-123_size_3433x3433.jpg', '1', 'publish', null, 'http://vuongtronspa.com.vn/contents/images/defaults/no-image.jpg', '0', '', 'product', '0', '0', '0', '0', '2019-04-16 08:08:00', '2019-04-16 08:13:32', '2019-06-05 08:34:02');
INSERT INTO `posts` VALUES ('50', 'Cám Gạo', 'cam-gao-', null, '', '<ul style=\"list-style-type: circle;\">\r\n<li>Tẩy tế bào chết</li>\r\n<li>Làm sáng da</li>\r\n<li>Mờ vết thâm</li>\r\n<li>Hạn chế mụn đầu đen.</li>\r\n</ul>', '<p>Trộn cám gạo với sữa tươi không đường hoặc nước ấm, dùng tay massage mặt và toàn bộ cơ thể trong 10 phút, sau đó tắm lại bằng nước ấm. Tuần sử dụng 1-2 lần. </p>', '', '', '', '', 'http://vuongtronspa.com.vn/storage/uploads/2019-05-12/cam-gao-edit_size_2926x2746.jpg', '1', 'publish', null, 'http://vuongtronspa.com.vn/contents/images/defaults/no-image.jpg', '0', '', 'product', '0', '0', '0', '0', '2019-04-16 08:15:00', '2019-04-16 08:21:14', '2019-05-12 11:57:55');
INSERT INTO `posts` VALUES ('51', 'Muối Hồng Himalaya', 'muoi-hong-himalaya', null, '', '<ul style=\"list-style-type: circle;\">\r\n<li>Loại bỏ tế bào da chết.</li>\r\n<li>Giúp da trắng sáng, mịn màng.</li>\r\n<li>Ngăn ngừa mụn, giảm sưng tấy.</li>\r\n</ul>', '<p>Trộn 3-4 muỗng (cơm) muối tẩy với sữa tươi không đường (hoặc nước), dùng tay massage toàn bộ cơ thể trong 10p, sau đó tắm lại với nước.</p>', '', '', '', '', 'http://vuongtronspa.com.vn/storage/uploads/2019-05-12/muoi-hong-hymalaya-123_size_899x899.jpg', '1', 'publish', null, 'http://vuongtronspa.com.vn/contents/images/defaults/no-image.jpg', '0', '', 'product', '0', '0', '0', '0', '2019-04-16 08:21:00', '2019-04-16 08:29:27', '2019-05-12 11:58:29');
INSERT INTO `posts` VALUES ('52', 'Trà Xanh', 'tra-xanh', null, '', '<p>Trà xanh có tác dụng rất hiệu quả đối với làn da phụ nữ:</p>\r\n<ul style=\"list-style-type: circle;\">\r\n<li>Nếu da bị ảnh hưởng bởi tác hại của ánh nắng mặt trời, trà xanh có thể giúp chúng mau chóng hồi phục.</li>\r\n<li>Trà xanh còn giúp ngăn ngừa lão hóa sớm, làm da sáng hơn, đáng nói hơn hết là khả năng ngăn ngừa các loại ung thư da.</li>\r\n<li>Những chất chống oxi hóa sẽ làm mát da, lọc bỏ độc tố trên da, làm da căng mịn và sáng ra. bạn thường bị sưng húp mắt do thức khuya, thiếu ngủ..trà xanh sẽ giúp xoa dịu vùng da mắt đang bị kích thích, mắt sẽ hết bị sưng mọng</li>\r\n</ul>', '<ul style=\"list-style-type: circle;\">\r\n<li>Đắp mặt nạ</li>\r\n<li>Làm bánh</li>\r\n<li>Uống</li>\r\n</ul>', '', '', '', '', 'http://vuongtronspa.com.vn/storage/uploads/2019-05-07/bot-tra-xanh-2_size_3149x3483.jpg', '1', 'publish', null, 'http://vuongtronspa.com.vn/contents/images/defaults/no-image.jpg', '0', '', 'product', '0', '0', '0', '0', '2019-04-16 08:49:00', '2019-04-16 08:55:55', '2019-05-07 04:04:57');
INSERT INTO `posts` VALUES ('53', 'Bột Nghệ Đen', 'bot-nghe-den-100gram', 'Nghệ đen có nhiều công dụng, nhưng ở Vuông Tròn Spa thì chỉ có 1 công dụng là để làm đẹp cho các chị em, đặc biệt là các chị em bầu & sau khi sinh.', '', '<p>Nghệ đen có nhiều công dụng, nhưng ở Vuông Tròn Spa thì chỉ có 1 công dụng là để làm đẹp cho các chị em, đặc biệt là các chị em bầu & sau khi sinh.<br /><br />Nghệ đen khi trộn với mật ong sẽ cho 1 hỗn hợp tuyệt vời để làm trắng sáng da, giảm thâm nám hiệu quả.<span class=\"text_exposed_show\"><br /></span></p>\r\n<p>Bạn sẽ cảm nhận rõ làn da trắng sáng mịn.<br />Nhiều người nói sao bột nghệ đen của Vuông Tròn Spa khác bột nghệ đen nhiều nơi khác, hoặc thậm chí khác hẳn bột nghệ đen tự làm ở nhà quá! Không khác sao được khi không chỉ bột nghệ đen mà tất cả những loại bột khác của nhà Vuông Tròn đều là bột nguyên chất, có mùi vị đặc trưng riêng của từng loại. Riêng bột nghệ đen thì chỉ cần nếm thử 1 miếng ở đầu lưỡi thôi là đã có vị đắng không nuốt nổi rồi, chưa kể khi chế biến thì phải lựa những củ già, còn tươi nguyên, và cách làm cũng khác nữa, lí giải vì sao bột nghệ đen của Vuông Tròn lại đậm màu mà thơm như vậy, và giá cũng cao như vậy!</p>', '<ul style=\"list-style-type: circle;\">\r\n<li><strong>Dùng làm mask</strong> </li>\r\n</ul>\r\n<p>Trộn 2 muỗng cf bột nghệ đen + 1 muỗng cf mật ong + sữa tươi. Trộn đều, đắp lên mặt khoảng 15ph - 20ph rồi rửa sạch. </p>\r\n<ul style=\"list-style-type: circle;\">\r\n<li><strong>Dùng cho toàn thân</strong></li>\r\n</ul>\r\n<p>Trộn 1/3 chén bột nghệ đen + 1/2 chén bột yến mạch + 2 muỗng cf bột trà xanh + 2 muỗng cf mật ong + sữa tươi. Trộn đều rồi tắm.</p>', '', '', '', '', 'http://vuongtronspa.com.vn/storage/uploads/2019-05-07/bot-nghe-den-2_size_4424x4000.jpg', '1', 'publish', null, 'http://vuongtronspa.com.vn/storage/uploads/2019-05-15/525_size_1012x675.jpg', '0', '', 'product', '0', '0', '0', '0', '2019-04-16 08:58:00', '2019-04-16 09:03:19', '2019-06-12 15:35:56');
INSERT INTO `posts` VALUES ('54', 'Bột Yến Mạch', 'bot-ye-mach', null, '', '<ul style=\"list-style-type: circle;\">\r\n<li>Làm sạch da</li>\r\n<li>Mặt nạ dưỡng da: Giúp da ẩm mượt, trắng sáng và mịn màng</li>\r\n</ul>', '<p>Trộn bột yến mạch với sữa tươi không đường (hoặc nước ấm).</p>\r\n<ul style=\"list-style-type: circle;\">\r\n<li>Rửa mặt : massage 1-2 phút sau đó rửa lại với nước.</li>\r\n<li>Mặt nạ : đắp hỗn hợp lên mặt, sau 15p rửa lại bằng nước ấm.</li>\r\n</ul>', '', '', '', '', 'http://vuongtronspa.com.vn/storage/uploads/2019-05-12/bot-yen-mach-abc_size_1776x1667.jpg', '1', 'publish', null, 'http://vuongtronspa.com.vn/contents/images/defaults/no-image.jpg', '0', '', 'product', '0', '0', '0', '0', '2019-04-16 09:04:00', '2019-04-16 09:08:36', '2019-05-12 11:20:14');
INSERT INTO `posts` VALUES ('55', 'Nghệ Trắng Hạ Thổ - 250ml', 'nghe-trang-ha-tho-250ml', null, '', '<p>Đây là bài thuốc làm đẹp độc quyền mà Vuông Tròn Spa tự làm để gởi đến các mẹ bầu và sau sinh chăm chút cho làn da vốn mỏng manh của mình.</p>\r\n<p>Mẹ nào bị các vấn đề về da nói trên thì có thể hoàn toàn yên tâm sử dụng loại mask đặc biệt này của Vuông Tròn Spa - Nghệ trắng thuốc bắc. Nghệ trắng là một món quà của rừng núi ban tặng, cây thường mọc hoang dã, củ to, mắt cứng, có mùi thơm<span class=\"text_exposed_show\"> rất đặc trưng, nhiều công dụng trong làm đẹp như:</span></p>\r\n<ul style=\"list-style-type: circle;\">\r\n<li><span class=\"text_exposed_show\">Mờ thâm nám, trị mụn, làm trắng sáng da.</span></li>\r\n<li><span class=\"text_exposed_show\">Làm căng da, giúp da trắng hông.</span></li>\r\n<li>Mờ vết thâm rạn ở bụng cho phụ nữ sau sinh.</li>\r\n</ul>\r\n<p>Ngoài ra, nghệ trắng khi kết hợp với những bài thuốc khác nhau sẽ có những công dụng khác nhau như trị viêm loét dạ dày, hen suyễn...</p>', '<p><strong>Dành cho da mặt:</strong></p>\r\n<ul style=\"list-style-type: square;\">\r\n<li>Lấy 2 muỗng cf nghệ trắng + 1 góc trứng gà (da khô thì lấy lòng đỏ, da nhờn lấy lòng trắng, da hỗn hợp thì lấy cả trắng lẫn đỏ), trộn đều hỗn hợp rồi bôi lên da mặt khoảng 20 phút, lau với nước ấm rồi rửa nước lạnh cho săn da.</li>\r\n<li>Lấy 2 muỗng cf nghệ trắng + 1 muỗng cf mật ong, trộn đều hỗn hợp rồi đắp lên da khoảng 20 phút, lau với nước ấm rồi rửa nước lạnh cho săn da.</li>\r\n<li> Không cần pha trộn với gì hết, lấy 2 muỗng cf đầy nghệ trắng đắp trực tiếp lên da khoảng 20ph.</li>\r\n<li>Cách này đơn giản nhất, phù hợp với những mẹ bận rộn. Chuẩn bị 1 cái chén nhỏ, lót 1 cái khăn sữa nhỏ lên chén rồi đổ nghệ trắng lên miếng khăn, nắm khăn lại rồi lau lên mặt, thỉnh thoảng chặm chặm lại.</li>\r\n</ul>\r\n<p><strong>Dành cho bụng hoặc toàn thân:</strong></p>\r\n<ul style=\"list-style-type: square;\">\r\n<li>Cũng làm với cách ở trên nhưng tăng liều lượng.</li>\r\n</ul>\r\n<p><em><strong>*Lắc đều nghệ trắng trước khi sử dụng.</strong></em><br /><em><strong>*Chống chỉ định với những ai bị dị ứng với nghệ.</strong></em></p>', '', '', '', '', 'http://vuongtronspa.com.vn/storage/uploads/2019-04-16/nghe-trang-ha-tho_size_800x800.JPG', '1', 'publish', null, 'http://vuongtronspa.com.vn/contents/images/defaults/no-image.jpg', '0', '', 'product', '0', '0', '0', '0', '2019-04-16 09:09:00', '2019-04-16 09:19:25', '2019-05-09 04:19:19');
INSERT INTO `posts` VALUES ('56', 'Nước Rửa Mũi Humer', 'nuoc-rua-mui-humer', null, '', '<p>Humer là dung dịch nước biển đẳng trương, vô trùng, giàu các nguyên tố vị lượng, giúp vệ sinh mũi rất tốt.</p>\r\n<p>Humer cũng được đề nghị sử dụng trong trường hợp nghẹt mũi hoặc sổ mũi, không chứa chất bảo quản thích hợp cho trẻ nhỏ.</p>', '<p>Kiểm tra để dảm bảo ống nhỏ còn nguyên gốc trước khi sử dụng.</p>\r\n<ul style=\"list-style-type: circle;\">\r\n<li>Trẻ nhỏ : đặt trẻ nằm nghiêng 1 bên.</li>\r\n<li>Trẻ em, người lớn: ngồi hoặc đứng, đàu nghiêng sang một bên.</li>\r\n</ul>\r\n<p>Mở nắp ống, đặt đầu ống vào mỗi bên mũi và bóp nhẹ, lau sạch với khăn giấy.</p>\r\n<p><strong>Thận trọng :</strong> Mỗi ống chỉ dùng một lần, dùng đường mũi không được tiêm, bảo quản ở nhiệt độ phòng, để xa tầm tay trẻ em</p>', '', '', '', '', 'http://vuongtronspa.com.vn/storage/uploads/2019-05-07/nuoc-rua-mui-em-be_size_3166x2863.jpg', '1', 'publish', null, 'http://vuongtronspa.com.vn/contents/images/defaults/no-image.jpg', '0', '', 'product', '0', '0', '0', '0', '2019-04-16 09:19:00', '2019-04-16 09:22:23', '2019-05-07 04:33:10');
INSERT INTO `posts` VALUES ('57', 'Nước Tắm Cho Bé Elemis', 'nuoc-tam-cho-be-elemis', null, '', '<p>Nước tắm thảo dược cho baby bé nhỏ.<br /><br />Đặc biệt là nước tắm này cực tốt dành cho các bé:</p>\r\n<ul style=\"list-style-type: circle;\">\r\n<li>Bị hăm</li>\r\n<li>Bị rôm sảy</li>\r\n<li>Bị mụn nhọt</li>\r\n<li>Phòng chống muỗi vì có tinh dầu sả chanh</li>\r\n</ul>', '<p>Nước tắm gội thảo dược Elemis dành cho bé, dùng từ sơ sinh tới lớn, với thành phần hoàn toàn từ các loại cỏ cây như chè xanh, đu đủ, kinh giới, khổ qua, tinh dầu chanh.</p>\r\n<p><em><strong>*Giá: 250.000VNĐ /2 chai. Không bán lẻ 1 chai.</strong></em></p>', '', '', '', '', 'http://vuongtronspa.com.vn/storage/uploads/2019-04-16/dscf3111_size_800x800.JPG', '1', 'publish', null, null, '0', '', 'product', '0', '0', '0', '0', '2019-04-16 09:22:00', '2019-04-16 09:28:03', '2019-04-16 09:28:03');
INSERT INTO `posts` VALUES ('58', 'Rượu Gừng Nghệ Hạ Thổ', 'ruou-gung-nghe-ha-tho', null, '', '<p>Nghệ và gừng nhà Vuông Tròn sử dụng để ngâm rượu hạ thổ cho các mẹ sau sinh là nghệ nhà trồng và củ gừng sẻ mua từ ngoài bắc chuyển vào.<br /><br />Gừng và nghệ sau khi được làm sạch, gọt vỏ, xắt nhỏ, trộn với thuốc bắc và rượu theo công thức riêng, đổ vào những chum sành to, đậy thật kỹ nắp và hạ thổ xuống đất. Đất phải là nơi đất mặt, có độ ẩm và độ ấm vừa phải<span class=\"text_exposed_show\"> để các nguyên liệu trong chum được hòa hợp và tiếp nhận đầy đủ nguyên khi âm dương của trời đất. Sau 3 tháng 10 ngày, những chum rượu nghệ gừng này sẽ được đào lên.<br /><br /><strong>Tại sao phải hạ thổ?</strong><br /><br />Trong nghệ tươi có chứa nhiều axit, khi bôi lên da giúp mờ thâm, liền sẹo rất nhanh nhưng đồng thời nó cũng gây bào mòn da bởi tính axit cực mạnh, hạ thổ nghệ, gừng với các vị thuốc bắc và rượu (bazo) giúp trung hòa axit trong nghệ, giúp nghệ vẫn giữ nguyên được những ưu điểm của nó mà lại lành tính, dịu nhẹ, bất kể là bà bầu, phụ nữ sau sinh hay chưa sinh cũng đều dùng được. <br />Rượu gừng nghệ thuốc bắc hạ thổ có tác dụng giúp lưu thông máu , giữ ấm cho cơ thể phụ nữ sau sinh, giúp chị em tránh xa bệnh hậu sản. Không chỉ vậy, rượu gừng nghệ thuốc bắc hạ thổ sẽ giúp làm sáng hồng những vùng da thâm sạm trong quá trình mang thai như cổ, nách, bẹn, mông....<br /></span></p>', '', '', '', '', '', 'http://vuongtronspa.com.vn/storage/uploads/2019-05-09/final-ruou-ha-tho_size_3809x3444.jpg', '1', 'publish', null, 'http://vuongtronspa.com.vn/contents/images/defaults/no-image.jpg', '0', '', 'product', '0', '0', '0', '0', '2019-04-16 09:30:00', '2019-04-16 09:36:38', '2019-05-09 03:54:05');
INSERT INTO `posts` VALUES ('59', 'Sữa Tắm Bio', 'sua-tam-bio', null, '', '<div id=\"product-tabs\" class=\"c-tabs product-tabs\">\r\n<div class=\"product-description various-content\">\r\n<p>Bio Bio Baby với thành phần hữu cơ (100% Organic), chiết xuất của hoa cúc La Mã Chamomile và protein thực vật, là sản phẩm làm sạch da và tóc cho bé được nhập khẩu trực tiếp từ Ý.</p>\r\n<p>Khác với các sản phẩm hóa học, Sữa tắm gội 2 trong 1 cho bé yêu cảm giác thoải mái nhất mỗi khi tắm nhờ mùi thơm dịu nhẹ, không làm cay mắt cho bé sự khô thoáng, sạch mát mà không hề làm mấ<span class=\"text_exposed_show\">t cân bằng độ ẩm hay gây dị ứng da.</span></p>\r\n<p><span class=\"text_exposed_show\">Sản phẩm được yêu thích bởi khả năng bảo vệ da bé trước những tác động của vi khuẩn từ mồ hôi, bã nhờn và bụi môi trường. Dùng an toàn cho bé sơ sinh.</span></p>\r\n<div class=\"text_exposed_show\">\r\n<p>Sản phẩm đã được chứng nhận bởi Hiệp Hội Mỹ Phẩm Hữu Cơ của Ý ICEA.</p>\r\n<p>Không hoá chất, không chứa chất tẩy rửa.<br />Không gây kích ứng da, không làm cay mắt bé.<br /><br />Dung tích: 250ml</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"related-products\">\r\n<h2 class=\"heading-2\"> </h2>\r\n</div>', '', '', '', '', '', 'http://vuongtronspa.com.vn/storage/uploads/2019-05-07/bio-bio-baby_size_3610x3264.jpg', '1', 'publish', null, 'http://vuongtronspa.com.vn/contents/images/defaults/no-image.jpg', '0', '', 'product', '0', '0', '0', '0', '2019-04-16 09:36:00', '2019-04-16 09:40:59', '2019-05-15 10:41:13');
INSERT INTO `posts` VALUES ('60', 'Túi Muối Thảo Dược', 'tui-muoi-thao-duoc', null, '', '<p><span class=\"fbPhotosPhotoCaption\" tabindex=\"0\" aria-live=\"polite\" data-ft=\"{\"><span class=\"hasCaption\">Khi chườm túi muối thảo dược trên cơ thể, hơi nóng lan toả giúp:</span></span></p>\r\n<ul style=\"list-style-type: circle;\">\r\n<li><span class=\"fbPhotosPhotoCaption\" tabindex=\"0\" aria-live=\"polite\" data-ft=\"{\"><span class=\"hasCaption\">Làm dịu những vùng cơ đau nhức.</span></span></li>\r\n<li><span class=\"fbPhotosPhotoCaption\" tabindex=\"0\" aria-live=\"polite\" data-ft=\"{\"><span class=\"hasCaption\">Lưu thông khí huyết, cải thiện tuần hoàn máu giúp đưa Oxy tới các tế bào, làm tan mỡ dư thừa, và đào thải độc tố giúp da mịn màng hơn, giảm căng cơ …</span></span></li>\r\n<li><span class=\"fbPhotosPhotoCaption\" tabindex=\"0\" aria-live=\"polite\" data-ft=\"{\"><span class=\"hasCaption\">Ngoài ra đối với phụ nữ sau sinh còn giúp co hồi dạ con, thúc đẩy sản dịch nhanh chóng.</span></span></li>\r\n</ul>', '<p><strong>Cách làm nóng muối: </strong></p>\r\n<ul style=\"list-style-type: square;\">\r\n<li><span class=\"text_exposed_show\"><strong>Dùng lò viba: </strong>cho hết hỗn hợp muối chườm bụng vào túi vải có miếng dán hoặc dây kéo rồi để hẳn vào trong lò, đợi 1,2 phút sau đó xốc lên lần nữa cho đều, quay thêm 1 phút thì túi muối đó sẽ nóng đều.</span></li>\r\n<li><span class=\"text_exposed_show\"><strong>Dùng chảo rang:</strong> nếu nhà chị em nào không có lò viba, thì mình cứ cho hỗn hợp muối vô 1 cái chảo cũ, rang đều tay trong 4, 5 phút rồi trút ra túi vải.</span></li>\r\n<li><span class=\"text_exposed_show\"><strong>Dùng nồi cơm điện:</strong> cho túi muối vào nồi cơm điện mini rồi đậy nắp, khi muốn chườm thì bật nút \"Cook\" rồi đợi đến lúc nồi điện bật sang nút \"Warm\" là có thể lấy ra chườm bụng. </span></li>\r\n</ul>\r\n<p><strong><span class=\"text_exposed_show\">Cách chườm muối:</span></strong></p>\r\n<ul style=\"list-style-type: square;\">\r\n<li><span class=\"text_exposed_show\">Chườm 2 - 3 lần/ ngày, mỗi lần nên chườm từ 30 - 45\'.</span></li>\r\n<li><span class=\"text_exposed_show\">Khi vừa bắt đầu chườm, các chị nhớ lót 1 cái khăn mỏng lên bụng rồi mới đặt túi muối lên chườm vì lúc mới rang muối rất nóng, nếu để trực tiếp lên bụng sẽ khiến vùng da bụng bị phỏng, gây rát và thâm đen vùng da đó, trường hợp còn sản dịch thì sẽ dễ gây băng huyết.</span></li>\r\n<li><span class=\"text_exposed_show\">Khi chườm khoảng 10 phút thì có thể chườm trực tiếp túi muối lên bụng. Lâu lâu xốc qua lại cho túi muối nóng đều. Chị em mình nên nằm ngửa và đặt túi muối lên bụng, trong thời gian đó có thể thư giãn nghe nhạc, chơi game, đọc sách thoải mái.</span></li>\r\n<li><span class=\"text_exposed_show\">Chỉ cần chườm liên tục sau 2 tuần, các chị sẽ thấy hiệu nghiệm! Nếu được, hãy chườm đều đặn cho đến khi có kết quả như mong muốn.</span></li>\r\n</ul>\r\n<p><span style=\"text-decoration: underline;\"><strong><span class=\"text_exposed_show\">LƯU Ý:</span></strong></span></p>\r\n<ul style=\"list-style-type: square;\">\r\n<li><span class=\"text_exposed_show\">Nên massage bằng rượu gừng nghệ trước khi chườm muối để giúp thẩm thấu dễ dàng và có hiệu quả cao hơn.</span></li>\r\n<li><span class=\"text_exposed_show\">Các chị sinh thường thì sau 1 tuần là có thể chườm muối để bụng mau xuống.</span></li>\r\n<li>Các chị sinh mổ thì phải sau 2 đến 3 tuần, khi vết thương đã khô mới bắt đầu chườm muối, khi chườm nhớ tránh đè lên vết mổ để tránh nhiễm trùng vết mổ.</li>\r\n</ul>\r\n<p><span class=\"text_exposed_show\">Vuông Tròn Spa bán túi muối thuốc làm sẵn cho chị nào không tiện làm muối nhé. Một túi muối thuốc 200k, tặng kèm túi chườm, có thể sử dụng được 10-14 ngày.</span></p>', '', '', '', '', 'http://vuongtronspa.com.vn/storage/uploads/2019-05-12/123_size_800x800.jpg', '1', 'publish', null, 'http://vuongtronspa.com.vn/contents/images/defaults/no-image.jpg', '0', '', 'product', '0', '0', '0', '0', '2019-04-16 09:42:00', '2019-04-16 09:49:05', '2019-05-15 10:40:39');
INSERT INTO `posts` VALUES ('61', 'Thảo Dược Săn Chắc Bụng', 'thao-duoc-san-chac-bung', null, '', '<ul style=\"list-style-type: circle;\">\r\n<li>Săn chắc và thon gọn bụng.</li>\r\n<li>Kích thích tuần hoàn máu.</li>\r\n<li>Cân bằng tông màu da cho bụng.</li>\r\n<li>Mờ vết rạn da, giảm các đốm nâu vùng bụng.</li>\r\n</ul>', '<ul style=\"list-style-type: square;\">\r\n<li>Sử dụng từ ngày thứ 5 (sinh thường) và tuần thứ 4 (sinh mổ).</li>\r\n<li>Mỗi gói pha với 4 muỗng nước nóng, trộn đều thành hỗn hợp sệt, thoa lên bụng, đắp khăn mỏng lên trước khi nịt bụng.</li>\r\n<li>Giữ nguyên 8 đến 12 tiếng, nên sử dụng sau khi tắm.</li>\r\n<li>Sau khi lấy đai ra lau sạch vùng bụng.</li>\r\n</ul>', '', '', '', '', 'http://vuongtronspa.com.vn/storage/uploads/2019-05-12/dscf3266-111_size_800x800.jpg', '1', 'publish', null, 'http://vuongtronspa.com.vn/contents/images/defaults/no-image.jpg', '0', '', 'product', '0', '0', '0', '0', '2019-04-16 09:49:00', '2019-04-16 09:52:13', '2019-05-15 10:40:51');
INSERT INTO `posts` VALUES ('62', 'Xông Vùng Kín Tanamera', 'xong-vung-kin-tanamera', null, '', '<ul style=\"list-style-type: circle;\">\r\n<li>Làm sạch, khử mùi, sát khuẩn và co hồi âm đạo cho phụ nữ sau khi sinh.</li>\r\n<li>Giúp vết thương ở tầng sinh môn mau lành hơn.</li>\r\n<li>Chống viêm sưng, thúc đẩy quá trình phục hồi âm đạo.</li>\r\n</ul>\r\n<p>Sau sinh thì các chị có thể xông bằng một số loại như lá trầu, muối tiêu, và tùy vùng miền còn có một số bài thuốc riêng nữa. Tuy nhiên, nếu các bạn không ở gần chợ hoặc nhà không có cây trầu thì hơi bất tiện, vì không phải chợ nào cũng có bán, trong trường hợp này, các bạn có thể xông bằng thảo dược đã được đóng gói sẵn (tuy đóng gói sẵn những không có bất cứ thàn<span class=\"text_exposed_show\">h phần hóa chất nào). </span></p>\r\n<p><span class=\"text_exposed_show\">Đây là các thảo dược của dân tộc Malaysia với một số cỏ cây hiếm không có ở Việt Nam có tác dụng đặc trị với vùng kín của mẹ sau sinh.</span></p>\r\n<p><span class=\"text_exposed_show\">Các bạn nào sinh mổ cũng nên xông vệ sinh vùng kín để làm sạch sâu bên trong tử cung  vì sinh mổ hay thường thì cũng đều ra sản dịch hàng ngày, vệ sinh sẽ thấy dễ chịu hơn rất nhiều.</span></p>\r\n<p><span class=\"text_exposed_show\"><strong>Thành phần:</strong> </span><span class=\"text_exposed_show\">U sừng gỗ sồi, n</span><span class=\"text_exposed_show\">ghệ rễ vàng, nhục đậu khấu, tô mộc, cỏ hương bài và sả.<br /></span></p>', '<ul style=\"list-style-type: square;\">\r\n<li>Nấu 1 gói thảo dược với khoảng 1lit nước sôi.</li>\r\n<li>Sau đó, chia làm 2 phần: 1 phần để xông và 1 phần dùng để rửa sau khi xông; hoặc nếu không xông thì chỉ dùng để rửa vùng kín.</li>\r\n</ul>', '', '', '', '', 'http://vuongtronspa.com.vn/storage/uploads/2019-05-07/thao-moc-ve-sinh-phu-nu_size_3401x3075.jpg', '1', 'publish', null, 'http://vuongtronspa.com.vn/contents/images/defaults/no-image.jpg', '0', '', 'product', '0', '0', '0', '0', '2019-04-16 09:53:00', '2019-04-16 09:59:23', '2019-07-08 09:02:21');
INSERT INTO `posts` VALUES ('63', 'Thảo Dược Xông Hơi & Tắm Dao Mama', 'thao-duoc-xong-hoi-tam-dao-mama', 'Dao’spa mama kết hợp các thành phần quí như tinh dầu Oải hương, tinh chất Hoa đào Sapa trong bài thuốc tắm đặc biệt dành cho phụ nữ sau khi sinh của người Dao đỏ - Sapa đem lại hiệu quả bảo vệ và phục hồi sức khỏe toàn diện', '', '<ul style=\"list-style-type: circle;\">\r\n<li>Tăng cường sinh lực, phục hồi sức khỏe cho phụ nữ sau sinh.</li>\r\n<li>Phòng chống các chứng bệnh hậu sản.</li>\r\n<li>Tăng cường thải độc qua da khi tắm, co lỗ chân lông, hạn chế các tác nhân có hại xâm nhập vào cơ thể.</li>\r\n<li>Giảm đau mỏi, chống stress, tạo giấc ngủ sâu, lấy lại cân bằng về cảm xúc.</li>\r\n<li>Hỗ trợ điều trị và ngăn ngừa các bệnh chứng: phong thấp, nhức mỏi, đau đầu, cảm cúm…</li>\r\n</ul>\r\n<p>Với Dao\'spa Mama, các bà mẹ trẻ hoàn toàn yên tâm là mình được tắm một cách khoa học, nhanh chóng hồi phục sức khỏe thể chất và tinh thần để chăm sóc cho con yêu. Đây là sản phẩm xông tắm dược thảo từ nguồn cây thuốc quý của Sapa, được nghiên cứu phát triển một cách hệ thống và khoa học trong gần 10 năm bởi các nhà Thực vật học Trường Đại học Dược Hà Nội.<span class=\"text_exposed_show\"><br /><br />Dao’spa mama kết hợp các thành phần quí như tinh dầu Oải hương, tinh chất Hoa đào Sapa trong bài thuốc tắm đặc biệt dành cho phụ nữ sau khi sinh của người Dao đỏ - Sapa đem lại hiệu quả bảo vệ và phục hồi sức khỏe toàn diện</span></p>', '<p><span style=\"text-decoration: underline;\"><strong>CÁCH TẮM:</strong></span></p>\r\n<ul style=\"list-style-type: square;\">\r\n<li><strong>Xông hơi, tắm dội:</strong><br />Chuẩn bị chậu nhỏ nước sôi (5-10 lit) ; lắc đều, pha 1 lọ nước tắm Dao’spa vào chậu, khuấy đều; xông hơi kĩ trong 10-15 phút.<br />Đổ chậu nước xông ra chậu lớn, pha loãng với nước để được độ nóng vừa phải, thể tích khoảng 20-30 lit ; choàng khăn tắm quanh người, dội nước tắm vừa pha từ từ để thấm đều vào khăn (hoặc lấy khăn thấm nước tắm lau đều kháp người), điều chỉnh để thời gian tắm giai đoạn này được 5-10 phút. <br />Tắm xong lau khô người, không tráng lại bằng nước nóng thông thường.</li>\r\n<li><strong>Tắm bồn:</strong><br />Pha 1 một chai Dao’spa vào bồn tắm có sẵn 50-100 lit nước nóng từ 37-420C (nước nóng già) để ngâm trong 15-20 phút. Không tráng lại bằng nước thường sau khi ngâm.</li>\r\n</ul>\r\n<p><span style=\"text-decoration: underline;\"><strong>LIỆU TRÌNH TẮM:</strong></span></p>\r\n<ul style=\"list-style-type: square;\">\r\n<li>Nên tắm sau khi sinh 3 ngày nếu sinh thường, 7 ngày nếu sinh mổ (sau khi vết mổ đã khô). Liệu trình tắm nên kéo dài tối thiểu là 6 lần tắm.</li>\r\n<li>Sau thời gian này, bạn có thể tắm nhắc lại 1-2 lần mỗi tuần để đạt được hiệu quả tốt nhất.</li>\r\n</ul>\r\n<p><span style=\"text-decoration: underline;\"><strong>CHÚ Ý:</strong></span></p>\r\n<ul style=\"list-style-type: square;\">\r\n<li>Dung dịch dùng ngoài, không uống.</li>\r\n<li>Không sử dụng khi có tiền sử mẫn cảm với bất kỳ thành phần nào của sản phẩm, người say rượu bia, phụ nữ đang mang thai hoặc trong kỳ kinh nguyệt, người bệnh tim mạch, huyết áp cao hoặc thấp.</li>\r\n<li> Một số trường hợp khi tắm có thể có cảm giác mất thăng bằng, buồn ngủ… thì nên ngừng tắm, nghỉ ngơi 5-10 phút sẽ trở lại hoàn toàn bình thường.</li>\r\n</ul>\r\n<p><em><strong>Giá: 330k/ hộp 3 chai.</strong></em></p>', '', '', '', '', 'http://vuongtronspa.com.vn/storage/uploads/2019-05-12/daos-spa-123_size_853x800.jpg', '1', 'publish', null, 'http://vuongtronspa.com.vn/contents/images/defaults/no-image.jpg', '0', '', 'product', '0', '0', '0', '0', '2019-04-16 10:01:00', '2019-04-16 10:08:10', '2019-07-12 02:44:29');
INSERT INTO `posts` VALUES ('64', 'Tinh Dầu Cúc La Mã', 'tinh-dau-cuc-la-ma', null, '', '<p>Cúc La mã - paracetamol tự nhiên cho bé và cho cả người lớn.</p>\r\n<p>Tinh dầu Cúc La mã đã được người Ai Cập cổ đại dùng như một loại thuốc chữa bách bệnh. Ngày nay, tinh dầu cúc La Mã cũng được xếp *Top* của các loại tinh dầu bởi những công dụng tuyệt vời của nó với sức khỏe con người (và cũng Top đắt xắt ra miếng).</p>\r\n<p> </p>\r\n<ul style=\"list-style-type: square;\">\r\n<li><strong>Với trẻ em:</strong> Cúc La Mã được mệnh danh “thần dược” dành cho trẻ em bởi các c<span class=\"text_exposed_show\">ông dụng sau:<br />Đặc biệt hữu hiệu trong việc hỗ trợ điều trị bệnh sởi tại nhà cho trẻ<br />Tinh dầu cúc la mã rất tốt cho trẻ nhỏ khi sợ hãi, khó ngủ, đau răng, đau họng: có thể bôi vô nướu khi bé khó chịu vì mọc răng.<br />Chữa cảm lạnh, giảm sốt hiệu quả với các biểu hiện sốt do virus, đặc biệt hiệu quả khi điều trị bệnh chân tay miệng.<br />Giúp giảm đau, giảm sưng tấy ở các vết bầm tím khi trẻ bị ngã.<br />Chữa các nốt mẩn đỏ khi bị côn trùng cắn, muỗi đốt nhanh chóng và hiệu quả.</span></li>\r\n<li><span class=\"text_exposed_show\"><strong>Với phụ nữ:</strong><br />Chữa đau răng, đau cơ, viêm nhiễm, rối loạn tiêu hóa, giảm đau bụng kinh.<br />Chữa các chứng đau nhức đầu, giảm stress, bớt căng thẳng, giúp trấn an tinh thần, giảm buồn phiền và chữa mất ngủ.<br />Tốt cho bầu sữa của các bà mẹ khi nuôi con nhỏ, giảm sốt và các triệu chứng khác do tắc tuyến sữa.</span><span class=\"text_exposed_show\"><br />Sử dụng tinh dầu cúc la mã còn giúp tóc khỏe và mọc nhiều hơn, trị mụn trứng cá và dưỡng da hiệu quả.</span></li>\r\n<li><span class=\"text_exposed_show\"><strong>Với nam giới:</strong><br />Ngoài những ác dụng như giảm stress, trấn an tinh thần, chữa mất ngủ...tinh dầu cúc la mã còn có tác dụng giúp giải rượu rất tốt.<br />Massage và tắm với tinh dầu cúc la mã mỗi ngày sẽ giúp trị dị ứng, đau lưng, đau cơ khi chơi thể thao hoặc làm việc nặng nhọc.</span></li>\r\n</ul>', '<ul style=\"list-style-type: square;\">\r\n<li><strong>Điều trị bệnh sởi tại nhà cho trẻ:</strong> Khi bắt đầu lên sởi, trẻ có những chấm trắng bằng đầu kim mọc rải rác trong môi, má trước răng hàm, trán hoặc sau tai, sau gáy, lưng có 1 vài nốt đỏ như muỗi đốt. Do đó, bé đau và khóc nhiều. Để xoa dịu tinh thần cho bé, các bà mẹ nên nhỏ vài giọt tinh dầu cúc La Mã vào một chiếc khăn, rồi đặt trong phòng của bé. Tinh dầu cúc La Mã có thể giúp bé giảm đau và cảm giác khó chịu. Ngoài ra, mẹ bôi tinh dầu Cúc la mã vào vết sởi sẽ giúp vết sởi xẹp xuống và nhanh khỏi.</li>\r\n<li><strong>Trẻ bị sốt cao:</strong> Bôi một chút vào gan bàn chân bàn tay giúp trẻ hạ sốt hiệu quả và nhanh chóng.</li>\r\n<li>Trẻ bị ngã và bị bỏng: Bôi lên vết bỏng hay vết thâm tím sẽ giúp con không cảm thấy đau. Vết bỏng, vết bầm tím sẽ nhanh chóng được xoa dịu.</li>\r\n<li><strong>Trẻ bị chân tay miệng:</strong> Bôi vào các nốt trên bàn tay, bàn chân và dưới hàm, con sẽ giảm sốt, không đau ở các nốt mọng nước, và đặc biệt là không đau miệng nên ăn uống ngon lành, ngủ tốt và không sốt cao.</li>\r\n<li><strong>Trẻ bị đau răng không ăn được:</strong> Bôi một chút vào gan bàn chân hoặc dưới hàm (bé bé mọc răng bị sưng) cho bé sẽ giúp bé đỡ đau và có thể ăn uống bình thường.</li>\r\n<li><strong>Trẻ dị ứng:</strong> Bôi lên chỗ mẩn đỏ, trẻ hết ngứa, giảm mẩn đỏ hết mẩn rõ rệt</li>\r\n<li><strong>Trẻ bị khó ngủ:</strong> Nhỏ 1-2 giọt lên gối hoặc bôi gan bàn chân, bé sẽ ngủ ngon giấc hơn.</li>\r\n<li><strong>Để giúp ngủ ngon:</strong> Nhỏ 1-2 giọt tinh dầu Cúc la mã, lên gối trước khi ngủ hoặc nhỏ 3-5 giọt tinh dầu lên đĩa đèn để xông trong phòng sẽ giúp bạn có giấc ngủ ngon hơn.</li>\r\n<li><strong>Ngâm chân:</strong> Hòa từ 1-3 giọt vào 2 lít nước ấm để ngâm chân trước khi đi ngủ giúp giảm đau nhức gan bàn chân, tăng tuần hoàn máu.</li>\r\n<li><strong>Giải rượu:</strong> Chỉ cần bôi 1 ít lên gan bàn tay hoặc bàn chân cho người bị say, sau 30 phút sẽ hết say và không bị đau đầu, có thể làm việc bình thường.</li>\r\n<li><strong>Chữa nhức đầu, chóng mặt, tăng huyết áp:</strong> Có thể nhỏ 1-2 giọt ra lòng bàn tay rồi dùng xoa bóp lên thái dương, vùng trán, gáy, hay cho thêm vào nước uống hàng ngày .</li>\r\n<li><strong>Làm đẹp da:</strong> Pha với dầu nền để massage body, massage mặt giúp giảm nếp nhăn, giảm ngứa.. </li>\r\n<li><strong>Giảm căng thẳng, mệt mỏi:</strong> Pha tinh dầu Cúc la mã + Oải hương + Chamomile + dầu nền massage hoặc tắm hằng ngày sẽ giúp giảm căng thẳng, mệt mỏi, phục hồi sức khoẻ, giúp phục hồi các mô, cơ, các khớp xương và tái tạo năng lượng cho cơ thể.</li>\r\n</ul>\r\n<p><em><strong>Giá 2.000.000Vnđ (10ml)</strong></em></p>', '', '', '', '', 'http://vuongtronspa.com.vn/storage/uploads/2019-05-12/tinh-dau-123_size_3433x3433.jpg', '1', 'publish', null, 'http://vuongtronspa.com.vn/contents/images/defaults/no-image.jpg', '0', '', 'product', '0', '0', '0', '0', '2019-04-16 10:28:00', '2019-04-16 10:34:25', '2019-07-08 09:22:34');
INSERT INTO `posts` VALUES ('65', 'Những Cách Thai Giáo Cho Bé Yêu, Giúp Con Chào Đời Thông Minh', '5-meo-day-con-trong-bung-me-giup-be-chao-doi-thong-minh-de-bao', 'Trí thông minh của em bé khi chào đời phụ thuộc chủ yếu vào yếu tố di truyền. Tuy nhiên, môi trường phát triển của bé trong thai kỳ cũng có những ảnh hưởng nhất định đến vấn đề này. Dưới đây là 5 bí quyết thai giáo giúp mẹ bầu rèn trí thông minh cho bé ngay từ trong bụng. ', '<p>Trí thông minh của em bé khi chào đời phụ thuộc chủ yếu vào yếu tố di truyền. Tuy nhiên, môi trường phát triển của bé trong thai kỳ cũng có những ảnh hưởng nhất định đến vấn đề này. Dưới đây là 5 bí quyết thai giáo giúp mẹ bầu rèn trí thông minh cho bé ngay từ trong bụng. </p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<ul style=\"list-style-type: circle; text-align: justify;\">\r\n<li><strong>Mẹ thường xuyên giao tiếp với thai nhi</strong></li>\r\n</ul>\r\n<p style=\"text-align: justify;\">3 tháng cuối thai kỳ là giai đoạn bé đang phát triển và hoàn thiện trí não. Dù lúc này bé chưa thể hiểu được những gì mẹ nói nhưng vẫn có thể nghe, ghi nhớ và cảm nhận giọng nói của mẹ. Đây sẽ là những nền tảng cơ bản nhất để trẻ phát triển khả năng ngôn ngữ của mình trong những giai đoạn sau này.</p>\r\n<p style=\"text-align: justify;\">Chính vì vậy, mỗi ngày mẹ hãy dành thời gian để trò chuyện cùng con hoặc đọc cho bé nghe những quyển sách thú vị.</p>\r\n<p style=\"text-align: justify;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://cdn.eva.vn/upload/2-2019/images/2019-04-11/5-meo-day-con-tu-trong-bung-me-giup-be-chao-doi-thong-minh-de-bao-2-1554973015-296-width600height450.jpg\" alt=\"5 meo \" /></p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<ul style=\"list-style-type: circle; text-align: justify;\">\r\n<li><strong>Massage cho mẹ bầu</strong></li>\r\n</ul>\r\n<p style=\"text-align: justify;\">Thai nhi 20 tuần tuổi đã phát triển hệ thần kinh, giúp bé có thể cảm nhận những tác động từ bên ngoài “tổ ấm” của mình. Chính vì vậy, những động tác massage nhẹ nhàng không chỉ giúp thai nhi sớm phát triển khả năng nhận biết mà còn giúp tăng lượng máu và ô-xy nuôi dưỡng bé cưng trong bụng mẹ.</p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<ul style=\"list-style-type: circle; text-align: justify;\">\r\n<li><strong>Cho bụng bầu nghe nhạc</strong></li>\r\n</ul>\r\n<p style=\"text-align: justify;\">Bắt đầu từ tuần thứ 20 của thai kỳ, thai nhi đã có thể cảm nhận giai điệu của âm nhạc, và thậm chí trong những tháng cuối cùng, bé còn có thể phản ứng lại khi nghe thấy âm thanh. Nhiều nghiên cứu cũng cho thấy rằng, thường xuyên cho bé nghe nhạc ngay từ khi còn nằm trong bụng mẹ sẽ giúp cải thiện trí thông minh, khả năng sáng tạo và cảm xúc của trẻ. </p>\r\n<p style=\"text-align: justify;\">Sau khi chào đời, bé cảm thấy được dỗ dành khi nghe lại những giai điệu âm nhạc đã từng nghe lúc còn ở trong tử cung. Tuy nhiên, âm thanh lớn như tại các buổi hòa nhạc có thể khiến thai nhi bị căng thẳng. Vì vậy, khi cho thai nhi nghe nhạc, người mẹ lưu ý không để âm thanh quá lớn có thể ảnh hưởng đến thính lực về sau.</p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p style=\"text-align: justify;\" align=\"center\"><img class=\"news-image initial loaded\" src=\"https://cdn.eva.vn/upload/2-2019/images/2019-04-11/5-meo-day-con-tu-trong-bung-me-giup-be-chao-doi-thong-minh-de-bao-1-1554973015-136-width600height400.jpg\" alt=\"5 meo \" width=\"500\" height=\"333\" data-original=\"https://cdn.eva.vn/upload/2-2019/images/2019-04-11/5-meo-day-con-tu-trong-bung-me-giup-be-chao-doi-thong-minh-de-bao-1-1554973015-136-width600height400.jpg\" data-was-processed=\"true\" /></p>\r\n<p style=\"text-align: justify;\" align=\"center\"> </p>\r\n<ul style=\"list-style-type: circle; text-align: justify;\">\r\n<li style=\"text-align: left;\"><strong>Thai giáo bằng dinh dưỡng </strong></li>\r\n</ul>\r\n<p style=\"text-align: justify;\">Để cung cấp những dưỡng chất đầy đủ cho sự phát triển trí não của bé, trong thời gian mang thai, mẹ bầu nên duy trì một thực đơn đa dạng, với đầy đủ các nhóm chất. Đặc biệt, nên bổ sung nhiều a-xít béo omega 3, thành phần quan trọng “xây dựng” bộ não con người.</p>\r\n<p style=\"text-align: justify;\">Đặc biệt, mẹ không nên kén ăn vì thói quen xấu này có thể \"lây\" sang bé khi chào đời. </p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<ul style=\"list-style-type: circle; text-align: justify;\">\r\n<li><strong>Mẹ tập thể dục đều đặn </strong></li>\r\n</ul>\r\n<p style=\"text-align: justify;\">Tập thể dục khi mang thai không chỉ giúp tăng cường sức khỏe và hỗ trợ quá trình chuyển dạ diễn ra dễ dàng hơn mà còn giúp tăng cường trí thông minh của em bé trong bụng. Đây là kết quả nghiên cứu của các chuyên gia từ Đại học Montreal, Canada.</p>\r\n<p style=\"text-align: justify;\" align=\"center\"><img class=\"news-image initial loaded\" src=\"https://cdn.eva.vn/upload/2-2019/images/2019-04-11/5-meo-day-con-tu-trong-bung-me-giup-be-chao-doi-thong-minh-de-bao-3-1554973015-899-width600height400.jpg\" alt=\"5 meo \" width=\"500\" height=\"333\" data-original=\"https://cdn.eva.vn/upload/2-2019/images/2019-04-11/5-meo-day-con-tu-trong-bung-me-giup-be-chao-doi-thong-minh-de-bao-3-1554973015-899-width600height400.jpg\" data-was-processed=\"true\" /></p>\r\n<p style=\"text-align: justify;\">Theo các chuyên gia, chỉ với 20 phút tập thể dục mỗi ngày, mẹ sẽ giúp não của bé hoạt động vượt trội hơn hẳn. Tập thể dục sẽ giúp tăng lưu lượng máu và ô-xy cung cấp cho thai nhi, giúp nuôi dưỡng tế bào thần kinh và từ đó, phát triển não tốt hơn.</p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p style=\"text-align: justify;\">Link bài viết chi tiết tham khảo tại: <a href=\"https://eva.vn/ba-bau/5-meo-day-con-tu-trong-bung-me-giup-be-chao-doi-thong-minh-de-bao-c85a388597.html\">https://eva.vn/ba-bau/5-meo-day-con-tu-trong-bung-me-giup-be-chao-doi-thong-minh-de-bao-c85a388597.html</a></p>', '', '', '', '', '', '', 'http://vuongtronspa.com.vn/storage/uploads/2019-05-18/mang-thai-tuan-14-va-nhung-dieu-me-can-luu-y-1_size_766x860.jpg', '1', 'draft', null, null, '0', '', 'knowledge', '0', '0', '0', '0', '2019-04-17 07:29:00', '2019-04-17 08:01:25', '2019-05-18 03:44:40');
INSERT INTO `posts` VALUES ('66', 'Bí Quyết Lợi Sữa Sau Sinh', 'bi-quyet-loi-sua-sau-sinh', 'Nhiều bà mẹ đang cho con bú lo ngại rằng nguồn sữa của mình không đủ để cho con bú và mong muốn tăng nguồn sữa mẹ lên hay nhiều người còn gọi là muốn “lợi sữa”. Thực tế, việc bé có đủ sữa hay không thường dựa vào nhu cầu nhiều hay ít. Tuy nhiên, có một số bằng chứng cho thấy chế độ ăn uống đóng vai trò không nhỏ đến lượng sữa của mẹ và bạn hoàn toàn có thể đảm bảo cho con có đủ sữa với việc thực hiện những nguyên tắc đơn giản sau.', '<ul style=\"list-style-type: circle;\">\r\n<li style=\"text-align: justify;\"><strong>ĂN KHỎE</strong></li>\r\n</ul>\r\n<p style=\"text-align: justify;\">Cũng giống như phụ nữ mang thai, bà mẹ cho con bú phải ăn nhiều hơn những người phụ nữ bình thường để có đủ năng lượn sản xuất sữa mẹ. Phụ nữ cho con bú cần thêm khoảng 500 calo mỗi ngày bằng việc ăn nhiều loại thức ăn, bổ sung thêm vitamin để có đủ dưỡng chất cần thiết cho trẻ sơ sinh. Bạn cũng cần bổ sung ít nhất ba phần protein và năm phần canxi hàng ngày đồng thời ăn nhiều thực phẩm giàu chất sắt. Lựa chọn hàng đầu cho bạn: các loại rau lá xanh, ngũ cốc nguyên hạt, trái cây tươi, dầu cá và các sản phẩm từ sữa ít chất béo.</p>\r\n<ul style=\"list-style-type: circle; text-align: justify;\">\r\n<li><strong>UỐNG NHIỀU NƯỚC</strong></li>\r\n</ul>\r\n<p style=\"text-align: justify;\">Ngoài ăn nhiều loại thức ăn, bạn cũng cần phải uống nhiều nước. Bên cạnh đó, nước ép trái cây nguyên chất 100% và sữa ít chất béo cũng là những lựa chọn thích hợp để giúp mẹ lợi sữa. Các bà mẹ cho con bú nên uống ít nhất 8 ly nước mỗi ngày, không dùng thức uống có caffeine như cà phê và trà. Ngoài những đồ uống, bạn cũng có thể thử các loại trà thảo dược được điều chế để kích thích sữa, dù không hẳn là biện pháp được khoa học chứng minh nhưng cách này đã cho kết quả khả quan đối với một số trường hợp.</p>\r\n<ul style=\"list-style-type: circle; text-align: justify;\">\r\n<li><strong>DÙNG MỘT SỐ LOẠI THỰC PHẨM CỤ THỂ</strong></li>\r\n</ul>\r\n<p style=\"text-align: justify;\">Ngay cả khi không ăn uống tốt, mẹ vẫn sẽ có sữa cho con bú. Tuy nhiên, điều này sẽ ảnh hưởng đến chất lượng sữa mẹ, làm mất đi các chất dinh dưỡng cần thiết cho sức khoẻ của bé. Do đó, mẹ cần bổ sung một số loại thực phẩm có thể tăng nguồn sữa. Những loại thực phẩm này bao gồm bột yến mạch, tỏi và gừng. Nên dù không thể có chế độ ăn đầy đủ dưỡng chất, bạn cũng nên cố gắng ăn bột yến mạch cho bữa ăn sáng mỗi ngày và thêm nhiều các loại gia vị này cho bữa ăn bạn nhé.</p>\r\n<ul style=\"list-style-type: circle; text-align: justify;\">\r\n<li><strong>DÙNG NHỮNG LOẠI THỰC PHẨM BỔ SUNG</strong></li>\r\n</ul>\r\n<p style=\"text-align: justify;\">Ngoài chế độ ăn uống, có một số thực phẩm bổ sung trên thị trường có tác dụng tăng nguồn sữa mẹ. Nhiều bà mẹ cho con bú đã thành công trong việc dùng những loại thảo dược, tuy chưa có nhiều nghiên cứu khoa học chứng minh cho tính hiệu quả của phương pháp này. Nguồn thảo dược được khuyến khích dùng để thúc đẩy nguồn cung cấp sữa bao gồm lá mâm xôi, cỏ linh lăng và cây tầm ma châm chích. Với biệp pháp này, hãy tham khảo ý kiến bác sĩ về loại thảo dược trước khi dùng thử, mẹ nhé.</p>\r\n<p style=\"text-align: justify;\">Sữa mẹ luôn là nguồn cung cấp dưỡng chất không thể thiếu của trẻ sơ sinh và trẻ nhỏ. Do vậy, mẹ hãy quan tâm nhiều hơn đến chế độ ăn uống trong giai đoạn cho con bú để có thể đảm bảo cho bé khoẻ mạnh và phát triển toàn diện, mẹ nhé.</p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p style=\"text-align: justify;\">Link tham khảo: <a href=\"https://hellobacsi.com/mang-thai/cham-soc-me-bau/mach-me-bi-quyet-loi-sua-trong-thoi-ki-cho-con-bu/\">https://hellobacsi.com/mang-thai/cham-soc-me-bau/mach-me-bi-quyet-loi-sua-trong-thoi-ki-cho-con-bu/</a></p>', '', '', '', '', '', '', 'http://vuongtronspa.com.vn/storage/uploads/2019-05-18/cho-tre-bu-sua-me_size_668x751.jpg', '1', 'draft', null, null, '0', '', 'knowledge', '0', '0', '0', '0', '2019-04-17 08:07:00', '2019-04-17 08:13:59', '2019-05-18 04:57:01');
INSERT INTO `posts` VALUES ('67', 'Những Điều Cần Kiêng Cữ Sau Sinh Để Đảm Bảo Sức Khỏe', 'nhung-dieu-can-kieng-cu-sau-sinh-de-dam-bao-suc-khoe', 'Kiêng cữ sau sinh như thế nào để cơ thể nhanh hồi phục là nỗi băn khoăn của không ít người. Thực tế, sau sinh cơ thể bạn cần được nghỉ ngơi và có chế độ chăm sóc sức khỏe và dinh dưỡng phù hợp để mẹ khỏe, con vui.', '<ul style=\"list-style-type: circle;\">\r\n<li style=\"text-align: justify;\"><strong>Không ăn mặn và kiêng khem quá mức </strong></li>\r\n</ul>\r\n<p style=\"text-align: justify;\">Một số bà mẹ mới sinh được khuyên ăn thức ăn khô và mặn như thịt kho tiêu, cá bống kho tộ, kiêng ăn rau, canh… để da thịt được săn chắc. Thực tế, việc ăn thức ăn khô, mặn cùng chế độ ăn thiếu rau xanh có thể khiến bạn bị tăng huyết áp, táo bón ảnh hưởng xấu đến sức khỏe.</p>\r\n<p style=\"text-align: justify;\">Ngoài ra, bạn không nên ăn đồ lạnh, thức ăn lên men như các loại dưa muối hay thức ăn để qua đêm, không ăn đồ sống nhằm hạn chế tình trạng nhiễm khuẩn hay ký sinh trùng gây bệnh. Bạn nên ăn đồ mới nấu, uống đủ nước.</p>\r\n<p style=\"text-align: justify;\">Tuy cần kiêng cữ sau sinh nhưng bạn không nên kiêng khem quá mức vì dễ dẫn đến tình trạng suy nhược cơ thể, dễ nhiễm bệnh, thiếu dưỡng chất thiết yếu, ảnh hưởng đến chất lượng sữa mẹ. Ngoài các loại thực phẩm nên tránh kể trên, bạn nên ăn đa dạng các loại thực phẩm.</p>\r\n<p style=\"text-align: justify;\">Nếu mới sinh, bạn nên tránh ăn các thực phẩm chế biến sẵn vì trong nhóm thực phẩm này thường có nhiều muối, đường, các chất bảo quản không tốt cho sức khỏe, nhất là với các bà mẹ mới sinh.</p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<ul style=\"list-style-type: circle; text-align: justify;\">\r\n<li><strong>Tránh khiêng, mang vác vật nặng</strong></li>\r\n</ul>\r\n<p style=\"text-align: justify;\">Một kiêng cữ sau sinh khác bạn cần nhớ là không nên mang vác vật nặng. Không chỉ dùng đến cơ tay, khi nâng vật nặng, bạn phải gồng cả cơ bụng, điều này ảnh hưởng đến vết thương tầng sinh môn hoặc vết mổ lấy thai và vết rạch tử cung. Ngoài ra, bạn cũng nên hạn chế rướn người, giơ tay để lấy đồ trên cao.</p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<ul style=\"list-style-type: circle; text-align: justify;\">\r\n<li><strong>Đừng tập thể dục nặng</strong></li>\r\n</ul>\r\n<p style=\"text-align: justify;\">Khoảng thời gian ở cữ sau sinh, cơ thể còn mệt mỏi, bạn tránh tập thể dục với cường độ cao nhằm giảm cân, nhanh chóng lấy lại vóc dáng. Song bạn nên hoạt động nhẹ nhàng để máu huyết lưu thông, nhất là với những sản phụ sinh mổ. Hãy bắt đầu với việc đi bộ chậm rãi, tập các động tác vừa phải, nhẹ nhàng.</p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<ul style=\"list-style-type: circle; text-align: justify;\">\r\n<li><strong>Không uống rượu và thức uống có cồn, caffeine</strong></li>\r\n</ul>\r\n<p style=\"text-align: justify;\">Uống rượu và các thức uống có cồn có thể khiến bạn bị huyết áp cao. Sau sinh, nếu nuôi con bằng sữa mẹ, bạn tuyệt đối không uống rượu bia, vì những thức uống này có thể đi vào sữa mẹ, ảnh hưởng đến sức khỏe của trẻ. Nhiều nghiên cứu đã chứng minh, lượng sữa tiết ra sẽ giảmnếu mẹ thường xuyên uống rượu hay các thức uống có cồn. Bạn nên uống đủ nước để cơ thể khỏe mạnh, có đủ sữa cho bé bú. Những thức uống mà bạn nên uống là nước lọc, nước trái cây và sữa.</p>\r\n<p style=\"text-align: justify;\">Đồng thời, tránh sử dụng cà phê và các loại thức uống có caffeine. Caffeine có trong các loại thức uống có thể đi vào sữa mẹ khiến bé trằn trọc, khó ngủ. Bạn nên kiểm tra thông tin ghi trên nhãn bao bì các loại thức uống đóng chai vì một số loại có chứa caffeine để tránh uống nhầm.</p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<ul style=\"list-style-type: circle; text-align: justify;\">\r\n<li><strong>Không sử dụng thuốc bừa bãi</strong></li>\r\n</ul>\r\n<p style=\"text-align: justify;\">Nếu đang nuôi con bằng sữa mẹ và gặp các vấn đề về sức khỏe, bạn chỉ nên sử dụng thuốc khi có chỉ định của bác sĩ. Nguyên nhân là bởi những gì bạn nạp vào cơ thể đều có thể đi vào dòng sữa gây ảnh hưởng không tốt đến bé.</p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<ul style=\"list-style-type: circle; text-align: justify;\">\r\n<li><strong>Tránh quan hệ tình dục sớm </strong></li>\r\n</ul>\r\n<p style=\"text-align: justify;\">Sau khi sinh, bạn nên đợi khoảng 4 – 6 tuần mới quan hệ tình dục trở lại. Nguyên do là cơ thể cần có khoảng thời gian nhất định để hồi phục sau cuộc vượt cạn tốn nhiều sức lực. Do đó, trong thời gian ở cữ sau sinh, bạn nên tránh quan hệ sớm để giảm thiểu nguy cơ nhiễm trùng, chảy máu vùng kín.</p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<ul style=\"list-style-type: circle; text-align: justify;\">\r\n<li><strong>Không nên nói to</strong></li>\r\n</ul>\r\n<p style=\"text-align: justify;\">Phụ nữ sau sinh thường mệt mỏi, nếu nói to, nói ráng sức sản phụ dễ bị hụt hơi. Do đó, một điều cần kiêng cữ sau sinh là không nên nói to. Bên cạnh đó, bạn cần hạn chế xem tivi và sử dụng thiết bị thông minh để mắt không bị quá tải. Ngoài ra, bạn không nên lên xuống cầu thang nhiều lần nhằm tránh trượt ngã.</p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<ul style=\"list-style-type: circle; text-align: justify;\">\r\n<li><strong>Tránh căng thẳng, mệt mỏi</strong></li>\r\n</ul>\r\n<p style=\"text-align: justify;\">Nếu bạn mệt mỏi, căng thẳng, hormone gây nên tình trạng này cũng có thể đi vào sữa, tác động xấu đến bé yêu khiến bé khó chịu, quấy khóc, chậm lớn. Nếu việc chăm sóc bé và chăm lo việc nhà khiến bạn mệt mỏi, hãy cố gắng nhờ người thân hỗ trợ hoặc thuê người giúp việc theo giờ để bạn có thời gian nghỉ ngơi.</p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<ul style=\"list-style-type: circle; text-align: justify;\">\r\n<li><strong>Tắm nước lạnh hoặc bơi</strong></li>\r\n</ul>\r\n<p style=\"text-align: justify;\">Một trong những việc cần kiêng cữ sau sinh là bạn nên tránh tắm nước lạnh hoặc bơi nhằm hạn chế tình trạng nhiễm lạnh, nhiễm khuẩn, chuột rút.</p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<ul style=\"list-style-type: circle; text-align: justify;\">\r\n<li><strong>Những thực phẩm cần tránh ăn khi đang ở cữ sau sinh</strong></li>\r\n</ul>\r\n<p style=\"text-align: justify;\">Sau khi sinh và đặc biệt nếu đang cho con bú, bạn nên tránh ăn những thực phẩm sau: chocolate, quế, tỏi, ớt, hành tây, bông cải xanh, bông cải trắng, dưa chuột, bắp cải, dứa (thơm), kiwi, dâu tây, trái cây họ cam quýt và nước ép của chúng. Nguyên nhân là các loại thực phẩm này có thể khiến sữa có mùi khiến bé không thích bú.</p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p style=\"text-align: justify;\">Link tham khảo: <a href=\"https://hellobacsi.com/mang-thai/cham-soc-sau-sinh/10-dieu-can-kieng-cu-sau-sinh/\">https://hellobacsi.com/mang-thai/cham-soc-sau-sinh/10-dieu-can-kieng-cu-sau-sinh/</a></p>', '', '', '', '', '', '', 'http://vuongtronspa.com.vn/storage/uploads/2019-05-18/cach-cham-soc-ba-me-sau-khi-sinh-mo-555x370_size_685x771.jpg', '1', 'draft', null, null, '0', '', 'knowledge', '0', '0', '0', '0', '2019-04-17 08:43:00', '2019-04-17 08:49:29', '2019-05-18 04:37:45');
INSERT INTO `posts` VALUES ('68', 'Tăng Cường Trí Thông Minh Cho Trẻ', 'tang-cuong-tri-thong-minh-cho-tre', 'Thực phẩm giúp phát triển các chức năng của não, đồ chơi giúp phát triển trí tuệ, các bài tập thể chất, tiếp xúc với môi trường xung quanh…đều là những cách để tăng cường trí thông minh cho trẻ. Có rất nhiều yếu tố ảnh hưởng đến việc phát triển trí tuệ.', '<ul style=\"list-style-type: circle;\">\r\n<li style=\"text-align: justify;\"><strong>Đừng làm gián đoạn giấc ngủ của bé</strong></li>\r\n</ul>\r\n<p style=\"text-align: justify;\">Nếu bé ngủ thiếu một giờ mỗi ngày, khả năng nhận thức của bé sẽ giảm đi rất nhiều. Não bé thường phát triển rất nhanh trong quá trình ngủ. Đây là lúc mà các liên kết thần kinh được thực hiện, đặc biệt là liên kết giữa bán cầu não trái và bán cầu não phải. Những đứa bé ngủ đủ giấc thường phát triển ngôn ngữ tốt hơn, tăng cường khả năng tập trung và chú ý.</p>\r\n<ul style=\"list-style-type: circle; text-align: justify;\">\r\n<li><strong>Các hoạt động thể chất</strong></li>\r\n</ul>\r\n<p style=\"text-align: justify;\">Sự phát triển của não và các hoạt động thể chất có mối liên hệ chặt chẽ với nhau. Bạn nên cho bé tham gia các hoạt động thể chất một giờ mỗi ngày. Điều này sẽ làm tăng lượng máu lưu thông đến não và các bộ phận khác của cơ thể, giúp bé phát triển trí nhớ và tăng khả năng học tập. Ngoài ra, bạn cũng nên dành thời gian để chơi đùa với bé.</p>\r\n<ul style=\"list-style-type: circle; text-align: justify;\">\r\n<li><strong>Chọn nhạc cho bé</strong></li>\r\n</ul>\r\n<p style=\"text-align: justify;\">Tiếp xúc với những giai điệu nhẹ nhàng rất có lợi cho sự phát triển của não, qua đó tăng cường khả năng nhận thức. Bạn hãy bế bé và nhảy một vài giai điệu theo nhạc. Điều này giúp cơ thể bé tiết ra hormone tình yêu oxytocin. Loại hormone này cũng được tiết ra khi bạn cho bé bú. Những bé thường xuyên nghe nhạc sẽ có trí nhớ tốt và ít bị trầm cảm.</p>\r\n<ul style=\"list-style-type: circle; text-align: justify;\">\r\n<li><strong>Nói chuyện với bé</strong></li>\r\n</ul>\r\n<p style=\"text-align: justify;\"><a href=\"https://hellobacsi.com/wp-content/uploads/2017/10/10-meo-giup-tang-cuong-tri-thong-minh-cho-tre-hinh-anh-e1508606731645.jpeg?x30591\" target=\"_blank\" rel=\"noopener\"><img class=\"aligncenter size-full wp-image-69161\" style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://hellobacsi.com/wp-content/uploads/2017/10/10-meo-giup-tang-cuong-tri-thong-minh-cho-tre-hinh-anh-e1508606731645.jpeg?x30591\" alt=\"10-meo-giup-tang-cuong-tri-thong-minh-cho-tre-hinh-anh\" width=\"507\" height=\"338\" /></a></p>\r\n<p style=\"text-align: justify;\">Nói chuyện với béthường xuyên sẽ giúp tăng kỹ năng xử lý ngôn ngữ và nâng cao vốn từ ngay từ khi bé được 18 tháng. Trò chuyện giúp bé nắm được cách chuyển động môi, cách lắng nghe và cách phát âm từ ngữ.</p>\r\n<p style=\"text-align: justify;\">Việc lặp lại các từ cũng giúp tăng cường trí nhớ, giúp bé dễ dàng liên kết các đối tượng và từ ngữ lại với nhau hơn. Vì vậy, đừng nghĩ rằng nói chuyện với bé là một việc làm tốn thời gian vì bé đang học mọi thứ từ bạn đấy.</p>\r\n<ul style=\"list-style-type: circle; text-align: justify;\">\r\n<li><strong>Thói quen ăn uống lành mạnh</strong></li>\r\n</ul>\r\n<p style=\"text-align: justify;\">Cho bé ăn nhiều những món ăn tốt cho não là cách tốt nhất để tăng cường trí tuệ. Trái cây, rau xanh, các sản phẩm làm từ sữa, trái cây sấy khô, trứng và các loại hạt đều là những món ăn tốt cho não. Hãy chế biến những thực phẩm này thành những món ăn bổ dưỡng để đảm bảo sức khỏe và tăng cường trí tuệ.</p>\r\n<ul style=\"list-style-type: circle; text-align: justify;\">\r\n<li><strong>Tiếp xúc với môi trường xung quanh</strong></li>\r\n</ul>\r\n<p style=\"text-align: justify;\">Hãy dành thời gian cho bé chơi với bạn bè và các thành viên khác trong gia đình. Điều này sẽ giúp bé học được những điều mới mẻ từ môi trường xung quanh. Tiếp xúc càng nhiều bé sẽ càng có cơ hội học được nhiều thứ.</p>\r\n<ul style=\"list-style-type: circle; text-align: justify;\">\r\n<li><strong>Kể chuyện cho bé nghe trước khi đi ngủ</strong></li>\r\n</ul>\r\n<p style=\"text-align: justify;\">Kể chuyện và hát ru trước khi ngủ là những việc làm giúp phát triển trí tuệ ngay từ khi còn nhỏ. Những việc làm này không chỉ giúp cho sợi dây liên kết giữa bố mẹ và bé thêm bền chặt mà nó còn giúp tăng cường các chức năng của não. Hệ thần kinh của một đứa bé thường được nghe kể chuyện trước khi đi ngủ sẽ khác với hệ thần kinh của những đứa trẻ khác.</p>\r\n<ul style=\"list-style-type: circle; text-align: justify;\">\r\n<li><strong>Tiếp xúc với thiên nhiên</strong></li>\r\n</ul>\r\n<p style=\"text-align: justify;\"><a href=\"https://hellobacsi.com/wp-content/uploads/2017/10/10-meo-giup-tang-cuong-tri-thong-minh-cho-tre-hinh-anh-1-e1508606696346.jpg?x30591\" target=\"_blank\" rel=\"noopener\"><img class=\"aligncenter size-full wp-image-69159\" style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://hellobacsi.com/wp-content/uploads/2017/10/10-meo-giup-tang-cuong-tri-thong-minh-cho-tre-hinh-anh-1-e1508606696346.jpg?x30591\" alt=\"10-meo-giup-tang-cuong-tri-thong-minh-cho-tre-hinh-anh-1\" width=\"462\" height=\"308\" /></a></p>\r\n<p style=\"text-align: justify;\">Khi tiếp xúc với thiên nhiên như chơi trên thảm cỏ xanh mát, bé sẽ cảm thấy thoải mái hơn. Điều này thể hiện rõ khi bạn cho bé đi công viên, bé luôn vui vẻ. Một môi trường xanh mát sẽ giúp bé thư giãn và tăng cường chức năng của não.</p>\r\n<ul style=\"list-style-type: circle; text-align: justify;\">\r\n<li><strong>Để cho bé chọn</strong></li>\r\n</ul>\r\n<p style=\"text-align: justify;\">Bố mẹ luôn có xu hướng tự quyết định những điều tốt nhất cho con. Tuy nhiên, bạn có thể để bé tự chọn những gì mình thích. Điều này sẽ giúp phát triển khả năng nhận thức ở trẻ nhỏ. Hãy để bé tự chọn màu sắc, hương vị, con người và hình dạng để làm tăng khả năng ra quyết định của bé.</p>\r\n<ul style=\"list-style-type: circle; text-align: justify;\">\r\n<li><strong>Nuôi con bằng sữa mẹ</strong></li>\r\n</ul>\r\n<p style=\"text-align: justify;\">Sữa mẹ là thức ăn bổ não cơ bản nhất. Cho bé bú mẹ đến khi 1 tuổi sẽ giúp tăng cường sức khỏe và trí thông minh của bé. Sữa mẹ cung cấp những dưỡng chất cần thiết cho sự phát triển của bé. Một đứa trẻ khỏe mạnh sẽ là một đứa trẻ thông minh.</p>\r\n<p style=\"text-align: justify;\">Những việc làm trên đóng vai trò quan trọng trong việc nuôi dưỡng trí thông minh cho bé. Tuy nhiên, không có điều gì tốt hơn tình yêu thương và sự quan tâm chăm sóc của cha mẹ. Những đứa trẻ lớn lên khỏe mạnh và vui vẻ sẽ trở thành những đứa bé thông minh. Vì vậy, bạn hãy dành thời gian để ở bên bé, yêu thương và chăm sóc bé mỗi ngày để bé cưng của bạn lớn lên khỏe mạnh và thông minh nhé.</p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p style=\"text-align: justify;\">Link tham khảo: <a href=\"https://hellobacsi.com/nuoi-day-con/tre-tap-di/10-meo-giup-tang-cuong-tri-thong-minh-cho-tre/\">https://hellobacsi.com/nuoi-day-con/tre-tap-di/10-meo-giup-tang-cuong-tri-thong-minh-cho-tre/</a></p>', '', '', '', '', '', '', 'http://vuongtronspa.com.vn/storage/uploads/2019-05-18/9_size_775x872.png', '1', 'draft', null, null, '0', '', 'knowledge', '0', '0', '0', '0', '2019-04-17 08:50:00', '2019-04-17 09:01:04', '2019-05-18 04:50:38');
INSERT INTO `posts` VALUES ('69', 'Những Cách Dạy Trẻ Học Nói Sớm', 'nhung-cach-day-tre-hoc-noi-som', 'Nhiều bố mẹ luôn có suy nghĩ trẻ biết nói sớm sẽ thông minh hơn, phát triển tư duy tốt hơn. Nếu muốn con dễ dàng giao tiếp với mình thì phụ huynh hãy lưu ý những cách dạy trẻ học nói sớm đơn giản nhưng hiệu quả bất ngờ.', '<p style=\"text-align: justify;\">Với những cách dạy bé tập nói dưới đây, chắc chắn bé sẽ sớm bí bô suốt ngày quanh tai bạn đấy!</p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p style=\"text-align: justify;\"><strong>Nói chuyện cùng bé từ nhỏ</strong></p>\r\n<p style=\"text-align: justify;\">Ngay từ khi bé mới chào đời, bạn hãy nói chuyện với bé. Ôm bé và giao tiếp bằng mắt. Bé cần phải hiểu các từ trước khi nói. Vì vậy, việc nói chuyện sẽ giúp xây dựng các mối liên kết trong não của bé. Nghiên cứu chỉ ra rằng những bé được nghe âm thanh bi bô từ cha mẹ thường biết nói bập bẹ khi bé 1 tuổi.</p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p style=\"text-align: justify;\"><strong>Dạy bé nói bằng cách gọi tên</strong></p>\r\n<p style=\"text-align: justify;\">Trước khi bắt đầu nói chuyện, mẹ nên tạo sự chú ý bằng cách gọi tên bé. Đây là âm thanh bé thường xuyên được nghe nên cũng sẽ ghi nhớ lâu nhất.</p>\r\n<p style=\"text-align: justify;\">Ngoài ra, mẹ cũng nên lưu ý giao tiếp với trẻ bằng ánh mắt. Tránh tình trạng nói chuyện với bé nhưng lại nhìn sang chỗ khác, hoặc tệ hơn nữa là làm một việc khác. Bằng cách gọi tên và giao tiếp bằng mắt, bé sẽ dễ dàng đoán được ý câu nói của mẹ hơn.</p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<div id=\"attachment_240446\" class=\"wp-caption aligncenter\" style=\"text-align: justify;\"><img class=\"size-full wp-image-240446\" style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://www.marrybaby.vn/wp-content/uploads/2019/01/17/day-tre-hoc-noi-3.jpg\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://www.marrybaby.vn/wp-content/uploads/2019/01/17/day-tre-hoc-noi-3.jpg 600w, https://www.marrybaby.vn/wp-content/uploads/2019/01/17/day-tre-hoc-noi-3-400x284.jpg 400w\" alt=\"dạy trẻ học nói 3\" width=\"375\" height=\"266\" />\r\n<p class=\"wp-caption-text\">Việc gọi tên bé thường xuyên sẽ giúp trẻ học phản xạ nghe nói từ nhỏ</p>\r\n<p class=\"wp-caption-text\"> </p>\r\n</div>\r\n<p style=\"text-align: justify;\"><strong>Đặt câu hỏi cho trẻ</strong></p>\r\n<p style=\"text-align: justify;\">Khi 6 tuần tuổi, bé sẽ quan tâm nhiều hơn đến mọi thứ xung quanh. Vì vậy, hãy bắt đầu dạy bé tập nói ba mẹ hoặc đặt câu hỏi cho bé: “Con có đói không?”, “Con có muốn uống sữa không?”.</p>\r\n<p style=\"text-align: justify;\">Hãy chỉ cho bé một vài thứ, dạy trẻ học nói các con vật, ví dụ như: “Con nhìn kìa, một con mèo”, “Bà ngoại ở kia”… Khi bé lớn hơn, hãy nói thêm một vài chi tiết như: “Con nhìn kìa, chiếc xe màu đỏ” hoặc “Một ngôi nhà nhỏ”…</p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p style=\"text-align: justify;\"><strong>Sao chép âm thanh của bé</strong></p>\r\n<p style=\"text-align: justify;\">Khoảng 3 – 4 tháng tuổi, những âm thanh “oohs”, “ahhs” sẽ dần biến thành những tiếng bập bẹ. Đây là thời điểm mà bé làm quen với các từ như “babababa”, “dadadada”.</p>\r\n<p style=\"text-align: justify;\">Hãy thử dạy trẻ học nói bằng cách bắt chước lại những âm thanh mà bé phát ra. Điều này không chỉ khuyến khích trẻ làm nhiều hơn mà còn bắt đầu dạy trẻ nói chuyện. Chờ cho đến khi bé nói xong, bạn hãy nói lại những tiếng tương tự mà trẻ vừa nói.</p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p style=\"text-align: justify;\"><strong>Thể hiện cảm xúc khi tập nói với bé</strong></p>\r\n<p style=\"text-align: justify;\">Khi bé bắt đầu nói bập bẹ, bé sẽ thêm các giai điệu khác nhau vào giọng nói của mình. Đến 6 tháng tuổi, bé sẽ nhận ra sự tức giận hoặc kích động trong giọng nói của bạn và cũng sẽ bắt đầu phát ra nhiều âm thanh hơn để thu hút sự chú ý hoặc thông báo cho bạn biết bé đói.</p>\r\n<p style=\"text-align: justify;\">Nhận ra âm thanh của bé và nói chuyện sẽ giúp bé cảm thấy vui hơn. Đây là lúc mà bé bắt đầu cảm thấy thích thú với giọng nói của bản thân.</p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p style=\"text-align: justify;\"><strong>Tập nói bằng cách hát</strong></p>\r\n<p style=\"text-align: justify;\">Bài hát là một khuôn mẫu lý tưởng cho bé tập nói. Đó là lý do tại sao mà mỗi nền văn hóa lại có những bài hát riêng dành cho trẻ nhỏ.</p>\r\n<p style=\"text-align: justify;\">Đừng lo nếu bạn hát không hay vì bé sẽ không quan tâm đâu. Bé chỉ thích nghe giọng hát của bạn mà thôi. Nếu không biết hát những bài hát ru, bạn có thể hát bất kỳ bài nào mà bạn thích.</p>\r\n<p style=\"text-align: justify;\">Việc hiểu cách bắt đầu và kết thúc một âm thanh sẽ giúp ích nhiều cho bé trong việc dạy trẻ học nói, học phát âm sau này.</p>\r\n<div id=\"attachment_240447\" class=\"wp-caption aligncenter\" style=\"text-align: justify;\"><img class=\"wp-image-240447\" style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://www.marrybaby.vn/wp-content/uploads/2019/01/17/day-tre-hoc-noi-4.jpg\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://www.marrybaby.vn/wp-content/uploads/2019/01/17/day-tre-hoc-noi-4.jpg 660w, https://www.marrybaby.vn/wp-content/uploads/2019/01/17/day-tre-hoc-noi-4-400x267.jpg 400w\" alt=\"dạy trẻ học nói 4\" width=\"401\" height=\"267\" />\r\n<p class=\"wp-caption-text\">Tập hát cũng là một cách dạy bé học nói hiệu quả</p>\r\n<p class=\"wp-caption-text\"> </p>\r\n</div>\r\n<p style=\"text-align: justify;\"><strong>Cùng bé đọc sách để tập nói</strong></p>\r\n<p style=\"text-align: justify;\">Trẻ nhỏ thích sách và cảm thấy bị thu hút bởi những cuốn sách phù hợp với độ tuổi của trẻ. Với trẻ đang trong giai đoạn học nói, bạn nên mua những quyển sách có hình ảnh tươi sáng, rực rỡ để thu hút sự chú ý của bé. Lặp đi lặp lại tên sự vật hoặc dạy trẻ học nói tên các con vật trong sách sẽ giúp trẻ có thêm vốn từ và phát triển khả năng đọc và nói của mình.</p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p style=\"text-align: justify;\"><strong>Bổ sung và sửa chữa vốn từ cho bé</strong></p>\r\n<p style=\"text-align: justify;\">Khi được một tuổi, bé đã có thể nắm vững được một vài từ. Đây là thời điểm thúc đẩy bé nói ra những từ đầu tiên. Nếu bé nói sai điều gì, bạn hãy sửa lại cho bé.</p>\r\n<p style=\"text-align: justify;\">Bạn có thể giúp bé xây dựng vốn từ bằng cách đưa ra nhiều sự lựa chọn cho bé và khuyến khích bé sử dụng nhiều từ hơn. Ví dụ: “Con thích quả táo và quả chuối không?”…</p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p style=\"text-align: justify;\">Tivi có thể khiến trẻ mất tập trung. Do đó, hãy tắt tivi nếu bạn đang nói chuyện với con. Tắm cho con cũng là cơ hội tuyệt vời để trò chuyện với trẻ. Bạn có thế sử dụng những đồ chơi trong phòng tắm để giúp trẻ học từ và màu sắc mới.</p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p style=\"text-align: justify;\">Link tham khảo: <a href=\"https://www.marrybaby.vn/nuoi-day-con/cach-day-tre-hoc-noi-som-don-gian-va-hieu-qua\">https://www.marrybaby.vn/nuoi-day-con/cach-day-tre-hoc-noi-som-don-gian-va-hieu-qua</a></p>', '', '', '', '', '', '', 'http://vuongtronspa.com.vn/storage/uploads/2019-05-18/dcbn1_size_697x783.jpg', '1', 'draft', null, null, '0', '', 'knowledge', '0', '0', '0', '0', '2019-04-17 09:02:00', '2019-04-17 09:28:45', '2019-05-18 03:48:54');
INSERT INTO `posts` VALUES ('70', 'Cách Chăm Bé Sơ Sinh Để Con Xinh Đẹp và Thông Minh', 'cach-cham-be-so-sinh-de-con-xinh-dep-va-thong-minh', 'Tất cả các bậc phụ huynh đều mong muốn con mình xinh đẹp khi trưởng thành. Ngoài vấn đề di truyền, mọi người cũng nên chú ý đến cách chăm bé sơ sinh.', '<div class=\"stepContent\">\r\n<h2 style=\"text-align: justify;\"><strong>Để con có dáng đẹp</strong></h2>\r\n<p style=\"text-align: justify;\">Dân gian có câu \"Nhất dáng nhì da\", vóc dáng con người là yếu tố ngoại hình vô cùng quan trọng. Dáng vóc đẹp sẽ mang lại sự tự tin, nổi bật và giúp con xinh đẹp hơn bội phần. Để con lớn lên có dáng dấp thật đẹp, ngay từ khi con mới là em bé sơ sinh, mẹ đã cần biết cách chăm sóc, uốn nắn để tạo cho con cấu trúc xương thật đẹp. Vì trẻ sơ sinh hệ xương còn khá mềm và chưa phát triển hoàn toàn, nên mẹ có thể dùng một số mẹo để điều chỉnh nếu biết cách.</p>\r\n<p style=\"text-align: justify;\"><img title=\"Cách chăm bé sơ sinh để con xinh đẹp và thông minh1\" src=\"https://media.lamsao.com//Data//quynhdtn/21062016/cach_cham_be_so_sinh_de_con_xinh_dep_va_thong_minh1.jpg\" alt=\"Cách chăm bé sơ sinh để con xinh đẹp và thông minh1\" /></p>\r\n<p style=\"text-align: justify;\"><em><strong>Hạn chế bẹp đầu ở trẻ sơ sinh</strong></em></p>\r\n<p style=\"text-align: justify;\">Vì hệ xương còn khá mềm, nên khi mẹ cho bé nằm quá nhiều, đặc biệt là nằm lệch về một bên rất dễ dẫn tới tình trạng bẹp đầu ở trẻ. Trẻ bị bẹp đầu sẽ khiến khuôn mặt trông méo lệch rất thiếu thẩm mĩ. Khi trẻ lớn lên, khiếm khuyết này sẽ theo con cả đời và không thể thay đổi được. Để phòng tránh, mẹ cần chú ý đặt con nằm đúng tư thế.</p>\r\n<p style=\"text-align: justify;\">- Xoay đầu bé luân phiên qua các bên trong từng giấc ngủ để đầu con không bị bẹp về một bên. Có thể xoay đầu bé về bên phải trong giấc ngủ này, rồi lại xoay sang bên trái trong giấc ngủ kế tiếp.</p>\r\n<p style=\"text-align: justify;\">- Nếu thấy bé nằm ngửa thì nên xoay mặt con ngửa lên trên. </p>\r\n<p style=\"text-align: justify;\">- Hạn chế đặt bé nằm võng hoặc ngồi trong xe đẩy trẻ em.</p>\r\n<p style=\"text-align: justify;\">Những cách trên sẽ phần nào giúp phòng chống biến dạng đầu của bé. Bên cạnh đó, theo kinh nghiện dân gian, mẹ có thể sử dụng gối hình móng ngựa (lõm ở giữa) hoặc gối làm từ vỏ đỗ để bảo vệ bé. Những loại gối này cũng giúp tránh được tật lép đầu. </p>\r\n<p style=\"text-align: justify;\">Ngoài ra, bố mẹ cần lưu ý tuyệt đối không dùng tay xoa bóp hay nắn đầu của trẻ. Bởi việc nắn bóp không mang lại hiệu quả. Chưa kể đầu bé lúc này rất yếu, nắn bóp mạnh có thể gây ra những biến chứng nguy hiểm. Bên cạnh đó, mẹ cũng chú ý bổ sung đầy đủ canxi để hệ xương của con cứng cáp, khỏe mạnh.</p>\r\n<p style=\"text-align: justify;\"><em><strong>Mẹo giúp con có đôi chân dài và thẳng</strong></em></p>\r\n<p style=\"text-align: justify;\">Chân vòng kiềng là một dị tật nhẹ ở chân mà rất nhiều trẻ gặp phải. Theo các chuyên gia, dưới 6 tháng tuổi, chân của trẻ thường bị cong nhưng là hiện tượng cong sinh lý, do trẻ quen tư thế cong chân ở trong bụng mẹ. Khi bé lớn lên, chân sẽ thẳng dần ra. Tuy nhiên, nếu cha mẹ không biết cách chăm sóc thì chân trẻ sẽ bị cong vòng kiềng. Có nhiều nguyên nhân khác nhau dẫn tới tình trạng chân vòng kiềng. Ngoài yếu tố di truyền thì việc cho trẻ tập đi quá sớm, hay thường xuyên bế cắp nách khi bé còn quá nhỏ hoặc thiếu vitamin D được coi là nguyên nhân phổ biến gây ra chân vòng kiềng.</p>\r\n<p style=\"text-align: justify;\">Để phòng tránh chân vòng kiềng cho trẻ sơ sinh bố mẹ cần chú ý bổ sung đầy đủ vitamin D và canxi cho trẻ. Tránh cho trẻ tập đi quá sớm khi xương của con còn chưa đủ khỏe. Thời điểm tập đi hợp lý nhất cho bé là sau 12 tháng tuổi. Mẹ cũng hạn chế việc bế cắp nách khi bé còn nhỏ. Khi bế nên ôm cả chân của con, tránh để hai chân tách ra, kẹp vào bụng mẹ. </p>\r\n<div class=\"stepContent\" style=\"text-align: justify;\">\r\n<h2><strong>Chăm sóc làn da của trẻ</strong></h2>\r\n<p>Làn da cũng là một yếu tố ngoại hình quan trọng không kém. Hầu hết mọi người quan niệm, làn da đẹp hay không là do yếu tố di truyền. Tuy nhiên, thực tế việc chăm sóc cũng giúp cải thiện rất nhiều làn da của bé. Mẹ nên tăng cường vitamin C để giúp con có làn da sáng màu và vitamin A để da bé mịn màng hơn. Khi cơ thể mẹ được bổ sung đầy đủ những vitamin này thì con cũng được tiếp nhận chúng thông qua nguồn sữa mẹ. Ngoài ra, ngủ đủ giấc cũng giúp da con thêm căng mịn, hồng hào và đầy sức sống. Mẹ nên luyện cho con thói quen ngủ sớm và ngủ đủ giấc để giúp bảo vệ làn da của bé.</p>\r\n<p>Khi giặt đồ cho con, mẹ không thêm bất kỳ hóa chất nào vào nhé. Bởi da bé rất nhạy cảm và mỏng manh, có thể bị mẩn đỏ và dị ứng với hóa chất. Mẹ nên sử dụng các loại bột giặt, nước giặt hay nước xả vải dành riêng cho trẻ để bảo vệ làn da bé. Sau khi trẻ đi vệ sinh, mẹ cần lau rửa nhẹ nhàng bằng nước rồi thấm khô bằng khăn mềm trước khi mặc tã hay quần áo để chống hăm cho bé nhé. Mẹ cũng chú ý cách tắm cho trẻ sơ sinh, không sử dụng các loại sữa tắm, dầu gội của người lớn để dùng cho trẻ, không tùy tiện tắm lá để tránh gây dị ứng.</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" title=\"Cách chăm bé sơ sinh để con xinh đẹp và thông minh2\" src=\"https://media.lamsao.com//Data//quynhdtn/21062016/cach_cham_be_so_sinh_de_con_xinh_dep_va_thong_minh2.jpg\" alt=\"Cách chăm bé sơ sinh để con xinh đẹp và thông minh2\" width=\"361\" height=\"198\" /></p>\r\n</div>\r\n<div class=\"stepContent\" style=\"text-align: justify;\">\r\n<h2><strong>Chăm sóc đôi mắt trẻ sơ sinh</strong></h2>\r\n<p>Từ xưa đôi mắt đã được coi là cửa sổ tâm hồn. Nhiều người coi đôi mắt là một nửa vẻ đẹp của con người. Vì thế mẹ cần chú ý chăm sóc đôi mắt của bé ngay từ nhỏ. Khi mới sinh, nhiều bé đôi mắt không làm sao, nhưng sau một thời gian lại bị hiếng và lác, đó là do mẹ không biết đặt bé nằm ngủ đúng cách. Mắt của trẻ sơ sinh rất nhạy cảm với ánh sáng và màu sắc. Nếu nơi bé nằm ánh sáng và màu sắc lệch hẳn về một phía, sẽ tạo phản xạ khiến trẻ liên tục nhìn về hướng đó mà không quay đầu. Tầm mắt bị lệch sẽ dẫn đến lác mắt hoặc bị hiếng rất xấu.</p>\r\n<p>Để phòng tránh tình trạng này, nơi ngủ của trẻ cần được bố trí với ánh sáng đều, không treo đèn hay đồ chơi lệch về một bên của bé. Ngoài ra, mẹ cũng không nên treo những vật dụng này phía trên đầu bé khiến con phải nhìn ngược liên tục cũng ảnh hưởng rất xấu đến mắt của trẻ.</p>\r\n</div>\r\n<div class=\"stepContent\">\r\n<h2 style=\"text-align: justify;\"><strong>Giúp bé có hàm răng trắng đều</strong></h2>\r\n<p style=\"text-align: justify;\">Khi trẻ còn nhỏ, nhiều người có suy nghĩ bé còn đổi răng nên không quan tâm chăm sóc hàm răng. Tuy nhiên, răng sữa là cơ sở cho răng vĩnh viễn sau này. Nếu hàm răng không được chăm sóc ngay từ khi con còn nhỏ, thì lợi và cơ hàm sẽ không ở trạng thái tốt nhất, khiến răng vĩnh viễn mọc lên không đều mà xấu xí. Do đó, mẹ hãy lưu tâm đến việc chăm sóc từ sớm để con có hàm răng trắng, đều và đẹp sau này.</p>\r\n<p style=\"text-align: justify;\">- Khi trẻ chưa mọc răng, mẹ vẫn nên thường xuyên vệ sinh lợi cho con bằng cách dùng miếng gạc y tế, thấm nước sạch rồi nhẹ nhàng lau vùng lợi của bé.</p>\r\n<p style=\"text-align: justify;\">- Khi răng bắt đầu mọc, trẻ sẽ cần lượng fluor và canxi lớn để giúp men răng cứng chắc, chống đỡ vi khuẩn gây sâu răng. Mẹ cần bổ sung đầy đủ những dưỡng chất này thông qua các thực phẩm như cá, trứng, sữa tươi, gan động vật...</p>\r\n<p style=\"text-align: justify;\">- Luôn chú ý giữ vệ sinh răng miệng ngay cả khi bé ăn đêm bằng sữa. Sau mỗi lần ăn cần súc miệng bằng nước lọc, hoặc dùng gạc mềm lau sạch răng và lợi cho trẻ.</p>\r\n<p style=\"text-align: justify;\">- Không nên cho bé mút tay và ngậm vú giả vì lúc này các xương hàm có thể chưa ráp nối xong, còn hở ở đường giữa. Thói quen này sẽ đẩy các xương hàm chưa liền ra phía trước, gây tình trạng răng bị hô, vẩu, khấp khiểng...</p>\r\n<p style=\"text-align: justify;\">- Không cho bé ăn nhiều đồ ngọt hoặc đồ cứng để đề phòng sâu răng, răng mọc khấp khiểng.</p>\r\n<p style=\"text-align: justify;\">- Hình thành thói quen đánh răng cho bé từ sớm.</p>\r\n<p style=\"text-align: justify;\">Mẹ nên tránh những sai lầm khi chăm sóc trẻ sơ sinh, không làm đẹp cho bé bằng những cách thiếu khoa học như cắt lông mi, vuốt lông mày... để không gây ảnh hưởng tới sức khỏe của trẻ.</p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p style=\"text-align: justify;\">Link tham khảo: <a href=\"https://www.lamsao.com/huong-dan-nhung-viec-can-lam-tu-so-sinh-de-con-xinh-dep-p214a28116.html\">https://www.lamsao.com/huong-dan-nhung-viec-can-lam-tu-so-sinh-de-con-xinh-dep-p214a28116.html</a></p>\r\n</div>\r\n</div>', '', '', '', '', '', '', 'http://vuongtronspa.com.vn/storage/uploads/2019-05-18/50-ten-dep-cho-be-trai-sinh-nam-2018-ai-cung-muon-dat-an-gi-de-con-co-dong-tien-1-1528097865-12-width600height400_size_742x833.jpg', '1', 'draft', null, null, '0', '', 'knowledge', '0', '0', '0', '0', '2019-04-18 03:07:00', '2019-04-18 03:17:12', '2019-05-18 05:12:37');
INSERT INTO `posts` VALUES ('71', 'Làm Đẹp Da Sau Sinh Cho Mẹ Bầu', 'lam-dep-da-sau-sinh-cho-me-bau-', 'Làm đẹp da sau sinh luôn là mong muốn của hầu hết các mẹ vừa sinh con, bên cạnh hạnh phúc khi đón thiên thần nhỏ bé của mình cũng là lo lắng về cách làm đẹp da sau sinh để có được làn da trắng hồng hào, mịn màng không tì vết là một trong những điều các mẹ sau sinh quan tâm nhất.', '<ul style=\"list-style-type: circle;\">\r\n<li style=\"text-align: justify;\"><strong>Làm đẹp da mặt sau sinh bằng Massage</strong></li>\r\n</ul>\r\n<p style=\"text-align: justify;\">Massage là phương pháp chăm sóc giúp da mặt nhanh chóng lấy lại độ đàn hồi và căng mịn, bởi sau khi sinh trọng lượng cơ thể của mẹ bầu đã giảm đi đáng kể. Bên cạnh đó còn giúp các mạch máu lưu thông và mẹ sau sinh đỡ mệt mỏi, cũng như hạn chế sự xuất hiện của các nếp nhăn khi phải thức đêm nhiều để chăm con.</p>\r\n<div id=\"attachment_66660\" class=\"wp-caption aligncenter\" style=\"text-align: justify;\"><img class=\"size-full wp-image-66660\" style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://mecuti.vn/wp-content/uploads/2017/08/lam-dep-da-sau-sinh.jpg\" alt=\"lam dep da sau sinh\" width=\"425\" height=\"319\" />\r\n<p class=\"wp-caption-text\">Massage mặt bằng các loại tinh dầu tự nhiên giúp mẹ sau sinh lấy lại độ đàn hồi của da mặt.</p>\r\n</div>\r\n<p style=\"text-align: justify;\">Khi massage mặt, mẹ nên sử dụng các loại dinh dầu 100% chiết xuất từ thiên nhiên rất giàu vitamin E, C, A, như dầu dừa, dầu oliu,…</p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<ul style=\"list-style-type: circle; text-align: justify;\">\r\n<li><strong>Làm đẹp da sau sinh bằng cám gạo</strong></li>\r\n</ul>\r\n<p style=\"text-align: justify;\">Để giảm lượng sắc tố melanin và hạn chế các vết thâm nám trên da. Các mẹ chỉ cần dùng 2 thìa cám gạo trộn đều với 1 lòng trắng trứng (da dầu) hoặc lòng đỏ (da khô), 1 thìa mật ong. Đắp hỗn hợp này lên da mặt chừng 15 – 20 phút rồi rửa nhẹ bằng nước ấm. Mỗi tuần làm từ 1 – 2 lần sẽ giúp da mặt trắng đẹp mịn màng hơn.</p>\r\n<p style=\"text-align: justify;\">Ngoài ra, khi mang thai, do sự thay đổi hormone sẽ khiến da tăng tiết chất nhờn gây ứ đọng các chất bụi bẩn trên da khiến nhiều mẹ phải khổ sở vì mụn trứng cá. Sử dụng cám gạo được coi là cách chăm sóc da mặt sau sinh tuyệt vời, giúp các mẹ lấy lại được làn da khô ráo, sạch mụn.</p>\r\n<p style=\"text-align: justify;\">Cách sử dụng như sau: Trộn 2 muỗng canh cám gạo thơm + bột kiều mạch (hoặc bột gạo nếp), 2 muỗng canh nước ép củ cải bào thành bột nhão. Đắp hỗn hợp này lên mặt để chừng 15 – 20 phút rồi rửa nhẹ bằng nước ấm.</p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<ul style=\"list-style-type: circle; text-align: justify;\">\r\n<li><strong>Cách làm đẹp da sau sinh bằng nghệ</strong></li>\r\n</ul>\r\n<p style=\"text-align: justify;\">Nghệ là một trong những “thần dược” giúp làm đẹp của các chị em sau sinh bằng nghệ vì lành tính, giá thành không cao và cách làm lại rất dễ.</p>\r\n<div id=\"attachment_66661\" class=\"wp-caption aligncenter\" style=\"text-align: justify;\"><img class=\"size-full wp-image-66661\" style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://mecuti.vn/wp-content/uploads/2017/08/cach-lam-dep-da-sau-sinh-bang-nghe.jpg\" alt=\"cach lam dep da sau sinh bang nghe\" width=\"418\" height=\"314\" />\r\n<p class=\"wp-caption-text\">Nghệ được coi là “bảo bối” chăm sóc da không thể thiếu của mẹ sau sinh</p>\r\n</div>\r\n<p style=\"text-align: justify;\">Để da mặt căng mịn, trắng hồng hào trở lại sau khi sinh, mẹ có thể đắp mặt nạ nghệ trộn với mật ong, lòng đỏ trứng gà hoặc nước cốt chanh. Ngoài ra, mẹ có thể giã nhỏ nghệ tươi, ngâm cùng rượu rồi đun nóng và thoa đều lên mặt để có nhanh chóng “thay da đổi thịt” sau sinh.</p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<ul style=\"list-style-type: circle; text-align: justify;\">\r\n<li><strong>Dưỡng da sau sinh bằng đậu đỏ </strong></li>\r\n</ul>\r\n<p style=\"text-align: justify;\">Một trong những nguyên liệu an toàn, tự nhiên khác giúp làm trắng da sau khi sinh được nhiều chị em sử dụng là bột đậu đỏ. Không chỉ có tác dụng làm trắng da mặt, bột đậu đỏ còn giúp tắm trắng da toàn thân rất hiệu quả.</p>\r\n<p style=\"text-align: justify;\">Trong đậu đỏ có hàm lượng protein, kali và chất sắt giúp da săn chắc, trắng hồng tự nhiên và trông khỏe khoắn. Cách sử dụng cũng vô cùng đơn giản: mẹ chỉ cần trộn bột đậu đỏ với sữa tươi hoặc nước sạch, đắp lên mặt khoảng 15 phút và rửa sạch với nước ấm.</p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<ul style=\"list-style-type: circle; text-align: justify;\">\r\n<li><strong>Dưỡng da bằng chính sữa mẹ sau sinh</strong></li>\r\n</ul>\r\n<p style=\"text-align: justify;\">Sữa mẹ không chỉ là nguồn dinh dưỡng quý giá cho bé mà còn là “mỹ phẩm” dưỡng da tự nhiên an toàn và hiệu quả. Trong sữa mẹ có đầy đủ các vitamin và khoáng chất cần thiết để da được nuôi dưỡng, trắng đẹp mịn màng hơn. Sau khi sinh, mẹ hãy tận dụng nguồn mỹ phẩm có sẵn này để chăm sóc da mặt.</p>\r\n<div id=\"attachment_66662\" class=\"wp-caption aligncenter\" style=\"text-align: justify;\"><img class=\"size-full wp-image-66662\" style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://mecuti.vn/wp-content/uploads/2017/08/lam-dep-da-sau-sinh-bang-sua-me.jpg\" alt=\"lam dep da sau sinh bang sua me\" width=\"352\" height=\"264\" />\r\n<p class=\"wp-caption-text\">Tội gì mẹ không tận dụng nguồn mỹ phẩm sạch, sẵn có này để chăm sóc da mặt sau sinh.</p>\r\n</div>\r\n<p style=\"text-align: justify;\">Cách thực hiện: Vắt khoảng 3 thìa cà phê sữa ra rồi dùng miếng bông nhỏ thấm, xoa đều lên mặt, massage nhẹ nhàng. Để khô khoảng 5 phút sau đó rồi lại thấm sữa xoa đều lên mặt. Làm liên tục như vậy 3 lần. Tới lần thứ ba, để khô trong 15 phút và rửa mặt sạch bằng nước.</p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<ul style=\"list-style-type: circle; text-align: justify;\">\r\n<li><strong>Bổ sung protein để eo thon gọn</strong></li>\r\n</ul>\r\n<p style=\"text-align: justify;\">Protein đặc biệt tốt cho sự tăng trưởng của cơ bắp, đồng thời cũng chứa collagen giúp làn da săn chắc nhanh chóng. Lượng protein mẹ tiêu thụ nên phụ thuộc vào cân nặng và mức độ hoạt động thể chất của bạn. Trung bình, mẹ sau sinh cần tiêu thụ khoảng 50gram protein mỗi ngày.</p>\r\n<div id=\"attachment_66663\" class=\"wp-caption aligncenter\" style=\"text-align: justify;\"><img class=\"size-full wp-image-66663\" style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://mecuti.vn/wp-content/uploads/2017/08/cach-lam-nho-bung-sau-sinh.jpg\" alt=\"cach lam nho bung sau sinh\" width=\"443\" height=\"332\" /></div>\r\n<div class=\"wp-caption aligncenter\" style=\"text-align: justify;\"> </div>\r\n<ul style=\"list-style-type: circle; text-align: justify;\">\r\n<li><strong>Cho con bú đều đặn</strong></li>\r\n</ul>\r\n<p style=\"text-align: justify;\">Ngoài việc cung cấp những dưỡng chất cần thiết cho sức khỏe trẻ sơ sinh, cho con bú còn rất có lợi cho mẹ. Khi cho con bú, lượng calo từ cơ thể mẹ được chuyển vào nguồn sữa, giúp mẹ giảm béo hiệu quả. Rất nhiều nghiên cứu đã chỉ ra, mẹ cho con bú giảm cân nhanh chóng, hiệu quả hơn những người không cho con bú.</p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<ul style=\"list-style-type: circle; text-align: justify;\">\r\n<li><strong>Uống đủ nước</strong></li>\r\n</ul>\r\n<p style=\"text-align: justify;\">Nhiều người cho rằng nước thì liên quan gì đến việc giảm cân, thọn gọn sau sinh nhưng thực tế đồ uống này được coi là “thuốc tiên” cho cơ thể con người. Nước không chỉ có tác dụng dưỡng ẩm cho da mà còn giúp da đàn hồi hơn.</p>\r\n<p style=\"text-align: justify;\">Ngoài ra, nước còn giúp đốt cháy calo hiệu quả và uống đủ nước là cách tuyệt vời để giữ cho làn da mẹ khỏe mạnh, săn chắc.</p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<ul style=\"list-style-type: circle; text-align: justify;\">\r\n<li><strong>Tẩy tế bào chết</strong></li>\r\n</ul>\r\n<p style=\"text-align: justify;\">Một cách hiệu quả để giúp làn da mẹ săn chắc trở lại là tẩy tế bào chết trên da bụng. Việc làm này sẽ giúp tăng cường lưu thông máu bằng cách tăng dòng chảy của máu ở khu vực này, đồng thời giúp da khỏe mạnh, đàn hồi tốt và mịn màng hơn.</p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<ul style=\"list-style-type: circle; text-align: justify;\">\r\n<li><strong>Tập thể dục đều đặn giúp eo thon sau sinh</strong></li>\r\n</ul>\r\n<p style=\"text-align: justify;\">Khi cơ thể đã phục hồi sau ca sinh nở và được sự cho phép của bác sĩ chuyên khoa, mẹ nên nghĩ đến việc tập thể dục đều đặn. Mẹ nên bắt đầu bằng những bài tập nhẹ nhàng như đi bộ, yoga, sau đó chuyển đến những bài tập cho vùng bụng sẽ giúp tăng cường cơ bắp dạ dày và đốt cháy calo, giúp mẹ sớm lấy lại vòng eo như ý muốn.</p>\r\n<div id=\"attachment_66664\" class=\"wp-caption aligncenter\" style=\"text-align: justify;\"><img class=\"size-full wp-image-66664\" src=\"https://mecuti.vn/wp-content/uploads/2017/08/cach-lam-nho-bung-sau-sinh-1.jpg\" alt=\"cach lam nho bung sau sinh 1\" width=\"449\" height=\"299\" /></div>\r\n<div class=\"wp-caption aligncenter\" style=\"text-align: justify;\"> </div>\r\n<div class=\"wp-caption aligncenter\" style=\"text-align: justify;\"> </div>\r\n<div class=\"wp-caption aligncenter\" style=\"text-align: justify;\">Link tham khảo: </div>', '', '', '', '', '', '', 'http://vuongtronspa.com.vn/storage/uploads/2019-05-18/tinh-bot-nghe-giam-can-sau-sinh_size_786x884.jpg', '1', 'draft', null, null, '0', '', 'knowledge', '0', '0', '0', '0', '2019-04-18 03:40:00', '2019-04-18 03:56:48', '2019-05-18 04:32:42');
INSERT INTO `posts` VALUES ('73', 'Tẩy Ủ Cám Gạo Đỏ Nhật Bản, Nghệ Đen, Mật Ong', 'tay-u-cam-gao-do-nhat-ban-nghe-den-mat-ong-2', null, '<p>Nhân viên phục vụ dịch vụ sau sinh rất tốt! Rất chuyên nghiệp! Sau liệu trình được bạn Trang bên spa chăm sóc mình cảm thấy khoẻ lên mỗi ngày, bụng nhỏ lại, da sáng lên, đã vậy bạn rất nhiệt tình tư vấn mọi lo lắng của mẹ bỉm sữa, cách kích sữa và chăm sóc cơ thể nữa! Đang stress mà gặp bạn nhân viên nhiệt tình và chuyên nghiệp như thế như thể trút được gánh nặng vậy. May mắn khi được bạn Trang bên spa Vuông tròn chăm sóc! Mình cảm thấy thật sự hài lòng!!!</p>', '', '', '', '', '', '', 'http://vuongtronspa.com.vn/storage/uploads/2019-05-04/57408064-2465558936789140-6133144901333811200-n_size_810x810.jpg', '1', 'publish', null, null, '0', '', 'customer-feedback', '0', '0', '0', '0', '2019-05-04 04:36:00', '2019-05-04 04:38:17', '2019-05-04 04:45:38');
INSERT INTO `posts` VALUES ('75', 'CÂU CHUYỆN & SỨ MỆNH', 'cau-chuyen-su-menh-2', null, '<p>Mình dẫn bạn đến thử 1 lần qua giới thiệu, và vẫn tiếp tục muon quay lại. Các chị ở đây rất có kinh nghiệm và lần nào làm mình cũng cảm thấy thật thư giãn và thoải mái. Cám ơn Vuông tròn thật nhiều nhé. Mình sẽ ủng hộ Vuông Tròn Spa dài dài nè .</p>', '', '', '', '', '', '', 'http://vuongtronspa.com.vn/storage/uploads/2019-05-04/23561554-10212069187377601-6795759355162619002-n_size_532x532.jpg', '1', 'publish', null, null, '0', '', 'customer-feedback', '0', '0', '0', '0', '2019-05-04 04:46:00', '2019-05-04 04:47:14', '2019-05-05 02:34:33');
INSERT INTO `posts` VALUES ('76', 'Chăm Sóc Da Mặt Cơ Bản', 'cham-soc-da-mat-co-ban', null, '<p>Cảm ơn các chị và các bé KTV của Vuông Tròn Spa đã chăm sóc em/chị trong suốt quá trình mang bầu bé thứ hai và một tháng sau sinh. Mỗi lần đến Vuông Tròn cảm giác rất nhẹ nhàng, thoải mái, nhiều khi ước gì nhà ngay sát bên để được đi spa mỗi ngày. À, một điều đặc biệt thích nữa ở Vuông Tròn là mỗi khi mình dắt bé lớn theo, các em đều vui vẻ và tạo điều kiện cho hai mẹ con thoải mái.</p>', '', '', '', '', '', '', 'http://vuongtronspa.com.vn/storage/uploads/2019-05-04/58381166-2483905958289005-8125198553384484864-n_size_690x690.jpg', '1', 'publish', null, null, '0', '', 'customer-feedback', '0', '0', '0', '0', '2019-05-04 04:47:00', '2019-05-04 04:48:33', '2019-05-05 02:28:24');
INSERT INTO `posts` VALUES ('78', 'Tươi Mát Sảng Khoái', 'tuoi-mat-sang-khoa', null, '<p>Tươi Mát Sảng Khoái là liệu trình hoàn hảo với sự kết hợp từ các liệu trình chăm sóc cơ thể cũng như chăm sóc da mặt, da đầu. Đây là liệu trình có tác dụng giúp chị em xua tan mọi căng thẳng, mệt mỏi lo âu từ công việc, cuộc sống. </p>\r\n<p> </p>\r\n<p>Liệu trình phụ hợp với chị em phụ nữ và mẹ bầu, phụ nữ sau sinh.</p>', '', '', '<p>120\'- 800.000 VNĐ</p>\r\n<p>150\'- 900.000 VNĐ</p>', '<p>Massage body Tinh dầu thảo mộc Organic</p>', '<p>Chăm sóc da mặt cơ bản</p>', '<p>Gội đầu thảo dược</p>', 'http://vuongtronspa.com.vn/storage/uploads/2019-05-15/11659424-647248305412302-3693004568663225218-n_size_470x431.jpg', '1', 'publish', null, 'http://vuongtronspa.com.vn/contents/images/defaults/no-image.jpg', '0', '', 'service', '0', '0', '0', '0', '2019-06-10 06:34:00', '2019-06-10 06:39:22', '2019-06-12 14:08:14');
INSERT INTO `posts` VALUES ('79', 'Sẵn Sàng Làm Mẹ', 'san-sang-lam-me', null, '', '', '', '<p>150\' - 950.000 VNĐ</p>', '<p>Massage body Tinh dầu thảo mộc Organic</p>\r\n<p>Thanh tẩy dưỡng da toàn thân với Trà xanh Organic</p>', '<p>Giải độc và tái tạo da mặt với Yến mạch và Trà xanh lâu năm</p>', '<p>Gội đầu thảo dược</p>', 'http://vuongtronspa.com.vn/storage/uploads/2019-05-18/cho-tre-bu-sua-me_size_668x751.jpg', '1', 'publish', null, 'http://vuongtronspa.com.vn/contents/images/defaults/no-image.jpg', '0', '', 'service', '0', '0', '0', '0', '2019-06-12 14:12:00', '2019-06-12 14:12:46', '2019-06-12 14:15:20');
INSERT INTO `posts` VALUES ('80', 'Nàng Tiên Cá', 'nang-tien-ca', null, '', '', '', '<p>150\' - 1.000.000 VNĐ</p>', '<p>Massage body Tinh dầu thảo mộc Organic</p>\r\n<p>Thanh tẩy dưỡng da toàn thân với Tảo Spirulina</p>', '<p>Chăm sóc da mặt với Tảo Spirulina</p>', '', 'http://vuongtronspa.com.vn/storage/uploads/2019-06-12/cham-soc-da-mat-voi-collagen-tao-xoan-spirulina_size_868x795.jpg', '1', 'publish', null, 'http://vuongtronspa.com.vn/contents/images/defaults/no-image.jpg', '0', '', 'service', '0', '0', '0', '0', '2019-06-12 14:15:00', '2019-06-12 14:17:41', '2019-06-12 14:22:21');
INSERT INTO `posts` VALUES ('81', 'Vuông Tròn Spa 10 Ngày', 'vuong-tron-spa-10-ngay', null, '<p>Phù hợp với phụ nữ sau sinh</p>\r\n<p>Thời gian thực hiện: 90\'/ 1 ngày</p>\r\n<p>Số ngày thực hiện: 10 ngày</p>\r\n<p>Thông tin chi tiết liệu trình:</p>\r\n<p> </p>\r\n<p><a href=\"http://vuongtronspa.com.vn/storage/uploads/2019-06-12/12345_size_984x993.jpg\" target=\"_blank\" rel=\"noopener\"><img title=\"12345\" src=\"http://vuongtronspa.com.vn/storage/uploads/2019-06-12/12345_size_984x993.jpg\" alt=\"12345\" width=\"585\" height=\"590\" /></a></p>\r\n<p><a href=\"http://vuongtronspa.com.vn/storage/uploads/2019-06-12/1234_size_990x250.jpg\" target=\"_blank\" rel=\"noopener\"><img title=\"1234\" src=\"http://vuongtronspa.com.vn/storage/uploads/2019-06-12/1234_size_990x250.jpg\" alt=\"1234\" width=\"585\" height=\"148\" /></a></p>', '', '', '<p>Giá trọn gói: 6.300.000 VNĐ</p>\r\n<p>Giá thành mỗi ngày: 630.000 VNĐ</p>\r\n<p>Phí đi lại: 6.000 VNĐ/ km</p>', '<p>Đắp mặt nạ bụng bằng Thảo dược săn chắc bụng</p>\r\n<p>Massage giảm nhức mỏi, giảm thâm, vết rạn vùng bụng</p>\r\n<p>Xông và tắm thuốc tắm của người Dao Đỏ</p>\r\n<p>Chăm sóc da mặt</p>\r\n<p>Tẩy thâm nách, bẹn, mông</p>\r\n<p> </p>', '', '', 'http://vuongtronspa.com.vn/storage/uploads/2019-06-12/viber-image-2019-05-02-112216-2_size_800x800.jpg', '1', 'publish', null, 'http://vuongtronspa.com.vn/contents/images/defaults/no-image.jpg', '0', '', 'service', '0', '0', '0', '0', '2019-06-12 14:26:00', '2019-06-12 14:40:52', '2019-07-12 02:31:56');
INSERT INTO `posts` VALUES ('82', 'Vuông Tròn Spa 15 Ngày', 'vuong-tron-spa-15-ngay', null, '<p>Liệu trình phù hợp với phụ nữ sau sinh</p>\r\n<p>Thời gian thực hiện: 90\'/ 1 ngày</p>\r\n<p>Số ngày thực hiện: 15 ngày</p>\r\n<p> </p>\r\n<p><a href=\"http://vuongtronspa.com.vn/storage/uploads/2019-06-12/new1_size_991x1125.jpg\" target=\"_blank\" rel=\"noopener\"><img title=\"new1\" src=\"http://vuongtronspa.com.vn/storage/uploads/2019-06-12/new1_size_991x1125.jpg\" alt=\"new1\" width=\"585\" height=\"663\" /></a><a href=\"http://vuongtronspa.com.vn/storage/uploads/2019-06-12/new2_size_990x496.jpg\" target=\"_blank\" rel=\"noopener\"><img title=\"new2\" src=\"http://vuongtronspa.com.vn/storage/uploads/2019-06-12/new2_size_990x496.jpg\" alt=\"new2\" width=\"585\" height=\"293\" /></a><a href=\"http://vuongtronspa.com.vn/storage/uploads/2019-06-12/new3_size_988x475.jpg\" target=\"_blank\" rel=\"noopener\"><img title=\"new3\" src=\"http://vuongtronspa.com.vn/storage/uploads/2019-06-12/new3_size_988x475.jpg\" alt=\"new3\" width=\"585\" height=\"281\" /></a></p>', '', '', '<p>Giá trọn gói: 8.500.000 VNĐ</p>\r\n<p>Giá thành một ngày: 620.000 VNĐ</p>\r\n<p>Phí đi lại: 6.000 VNĐ/ km</p>', '<p>Đắp mặt nạ bụng bằng Thảo dược săn chắc bụng</p>\r\n<p>Massage giảm nhức mỏi, giảm thâm, vết rạn vùng bụng</p>\r\n<p>Xông và tắm thuốc tắm của người Dao Đỏ</p>\r\n<p>Chăm sóc da mặt</p>\r\n<p>Tẩy thâm nách, bẹn, mông</p>\r\n<p> </p>', '', '', 'http://vuongtronspa.com.vn/storage/uploads/2019-05-15/12705711-734090180061447-416346890743494469-n_size_802x802.jpg', '1', 'publish', null, 'http://vuongtronspa.com.vn/contents/images/defaults/no-image.jpg', '0', '', 'service', '0', '0', '0', '0', '2019-06-12 15:03:00', '2019-06-12 15:05:28', '2019-07-12 02:32:16');
INSERT INTO `posts` VALUES ('85', 'Sử dụng dịch vụ trả góp 0%', 'su-kien-1', 'Sự kiện 1', '<p>Từ nay, khách hàng sử dụng dịch vụ không cần mang tiền mặt & trả trước.</p>\r\n<p>Vuông Tròn Spa liên kết với ngân hàng VPBank đưa ra chương trình trả góp với 0% lãi suất, hỗ trợ mở thẻ tín dụng từ 5 - 7 ngày cho khách hàng nhà Vuông Tròn Spa</p>\r\n<p>Chi tiết liên hệ: 028 3935 0666 để được hỗ trợ.</p>\r\n<p><a href=\"http://vuongtronspa.com.vn/storage/uploads/2020-02-10/1-3_size_450x112.png\" target=\"_blank\" rel=\"noopener\"><img title=\"1-3\" src=\"http://vuongtronspa.com.vn/storage/uploads/2020-02-10/1-3_size_450x112.png\" alt=\"1-3\" /></a><a href=\"http://vuongtronspa.com.vn/storage/uploads/2020-02-10/2_size_356x142.png\" target=\"_blank\" rel=\"noopener\"><img title=\"2\" src=\"http://vuongtronspa.com.vn/storage/uploads/2020-02-10/2_size_356x142.png\" alt=\"2\" /></a></p>', '', '', '', '', '', '', 'http://vuongtronspa.com.vn/storage/uploads/2020-02-11/35486448-2398206300196986-4165136091113848832-n_size_960x960.jpg', '1', 'publish', null, null, '0', '', 'event-special', '0', '0', '0', '0', '2019-07-12 04:56:00', '2019-07-12 04:56:56', '2020-02-11 06:58:24');
INSERT INTO `posts` VALUES ('86', 'Liệu Trình Detox', 'lieu-trinh-detox', 'Liệu trình Detox - Thải Độc Tố độc quyền', '<p>Liệu trình gồm 20 buổi, mỗi buổi nằm máy từ 40 đến 60 phút kết hợp massage đầu cổ vai gáy.Công dụng của liệu trình:</p>\r\n<ul>\r\n<li>Trị chứng mất ngủ, ngủ ko ngon</li>\r\n<li>Điều trị xương khớp cực kì hiệu quả, đặc biệt tốt cho người lớn tuổi</li>\r\n<li>Đào thải độc tố tích tụ qua đường bài tiết</li>\r\n<li>Hỗ trợ điều trị bệnh tiểu đường</li>\r\n<li>Trị các triệu chứng đau đầu, stress ...</li>\r\n<li>Đào thải các kim loại nặng và mỡ xấu ra khỏi cơ thể</li>\r\n<li>Giúp lưu thông tuần hoàn máu</li>\r\n<li>Hỗ trợ các bệnh tim mạch, huyết áp, tiểu đường, gout... đặc biệt là xương khớp</li>\r\n</ul>\r\n<p> </p>\r\n<p>Hãy chăm sóc sức khỏe chủ động ngay khi có thể!</p>\r\n<p>Liên hệ : 028 3935 0666 - 0914 386 986 or inbox Page để được tư vấn cụ thể</p>', '', '', '<p>Thời gian : 60p/1 buổi</p>\r\n<p>Giá dịch vụ: 42.000.000đ/liệu trình (liên hệ để tư vấn & báo giá tốt nhất)</p>', '<p><br />Liệu trình gồm 20 buổi, mỗi buổi nằm máy từ 40 đến 60 phút kết hợp massage đầu cổ vai gáy.</p>', '', '', 'http://vuongtronspa.com.vn/storage/uploads/2020-02-12/qp9a3595_size_6348x4096.JPG', '1', 'publish', '1', 'http://vuongtronspa.com.vn/storage/uploads/2020-02-12/qp9a3595_size_6348x4096.JPG', '0', '', 'service', '0', '0', '0', '0', '2019-08-16 04:09:00', '2019-08-16 05:17:27', '2020-02-12 07:58:55');
