INSERT INTO `term_taxonomy` VALUES ('27', 'TUYỂN DỤNG & ĐÀO TẠO', 'tuyen-dung-dao-tao', 'introduction-category', 'Nhằm tạo điều kiện cho các bạn hộ lý, điều dưỡng, các bạn chưa có kinh nghiệm trong lĩnh vực chăm sóc sức khỏe và sắc đẹp có cơ hội kiếm việc làm tốt với thu nhập cao, Vuông Tròn Spa thường xuyên mở các lớp đào tạo kỹ thuật viên chuyên nghiệp.\r\n\r\nĐảm bảo 100% sau khi hoàn tất khóa đào tạo các bạn sẽ có việc làm ổn định, thu nhập cao.\r\nƯu tiên cho 10 bạn đăng ký đầu tiên sẽ được giảm 20% học phí.\r\n\r\n1. Khóa Kỹ Thuật Massage Body thường: 5.000.000 VND\r\n2. Khóa Kỹ Thuật Massage Mặt: 5.000.000 VND\r\n3. Khóa Kỹ Thuật Massage Chân: 5.000.000 VND\r\n4. Khóa học Kỹ Thuật Trọn Gói: 10.000.000 VND', '0', '3', '1');
